INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ed359-f3f9-11e4-910d-080027c336f0', 63, NULL, 'CavanTown', 'df74079f-f3f9-11e4-910d-080027c336f0', '2012-03-13 17:13:13+00', '2013-12-01 14:25:30+00', '3006', 1, 1, 2, 0, 'Generally monthly but will vary', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Ulster"}', '{}', '{"name":"Cavan","geonameId":"2965535"}', '54.000858,-7.35702', '{"lat":54.000858,"lon":-7.35702}', '<h1><strong>Next session -&nbsp; </strong></h1><h1><strong>Beginners - 21st Feb </strong></h1><h1><strong>Science Dojo -7th March </strong><a href="http://coderdojocavan.eventbrite.ie">http://coderdojocavan.eventbrite.ie</a><br /><br />If the session is sold out then we would advise you to register on the waiting list for cancellations. <strong>Please note that Cavan Institute is only the venue and will not be able to deal with any queries.</strong></h1><p>Coderdojo Cavan is volunteer led and run so we are unable to respond immediately to&nbsp;emails.</p><p>&nbsp;</p><p><strong>Cancelllation Policy</strong><br />If you book tickets and are unable to attend please cancel your tickets as soon as possible so we can release tickets to those on the waiting list. If you do not attend after booking we will assume you are not interested and remove you from our email alert list.</p><p>&nbsp;</p><p><strong>Mentors </strong></p><p>If you are interested in mentoring then please pop in and talk to us at one of the sessions. If you are looking for a place at one of sessions then book a ticket.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h1><strong>What is CoderDojo?</strong></h1><p><br />CoderDojo is a movement of free coding clubs for young people.<br /><br />At a CoderDojo, young people learn how to code, develop websites, apps, programs, games and more. Dojos are set up, run by and taught at by volunteers. In addition to learning to code, members meet like minded people, show off what they&#39;ve been working on and so on. CoderDojo makes development and learning to code a fun, sociable, kick ass experience. CoderDojo also puts a strong emphasis on open source and free software, and has a strong network of members and volunteers globally.<br /><br /><strong>So what about Cavan CoderDojo?</strong><br />Coder Dojo Cavan is run by a group of volunteers from the educational and business community in Cavan Town. Sessions are usually held in Cavan Institute or other venues around the town.<br /><br />At Coder Dojo our aim is to encourage kids to get into computing and to be really good at it! There are lots of jobs and start up opportunities for good programmers &ntilde; and as far as we can see there always will be.<br /><br /><strong>No lectures or classroom approaches here </strong>- it is 100% hands-on coding with the help of volunteer mentors to pass on their knowledge and keep you challenged!<br /><br />CoderDojo has just one rule: Above All: Be Cool, bullying, lying, wasting peoples time and so on is uncool.<br /><br /><strong>Who can attend?</strong><br />Everyone is welcome! Very young kids may not get much out of it, but there should be something in it for all children over the age of 7.<br /><br />No prior programming experience is required &ntilde; if you are honestly interested in computing come a long and try it out! Like all Dojo&iacute;s we try to make it relaxed, fun, cool and interesting.<br />&nbsp;</p><h2><br /><strong>VERY IMPORTANT:</strong></h2><p>A parent/guardian must stay with all children for the entire duration of the session. As well as keeping an eye on their children and equipment, parents/guardians will also be able to learn along with them.<br /><br /><strong>What you need to bring:</strong><br />A USB memory stick (for storing your work) and a snack.<br /><br /><strong>Cost</strong><br />Cost is absolutly free but where we have guest speakers etc we will have a donation box to cover their travel costs.<br /><br />The venue and utilities are provided to us by Cavan Institute at no charge and mentors donate their time so that we can provide this opportunity for kids at no charge.<br /><br /><strong>Topics covered</strong><br />- Scratch - Check out http://scratch.mit.edu/<br /><br />- Python</p><p>- Robotics</p><p>- Science workshops<br /><br />As we develop it is planned to introduce other other programming technologies. If you have any ideas please let us know. If you are available to mentor then please pop in for a chat during one of the sessions.<br /><br />Check back here for updates re our next session.<br /><br />&nbsp;</p><h1><strong>To book a ticket </strong><br />&nbsp;</h1><p>See http://coderdojocavan.eventbrite.ie<br />&nbsp;</p><p>We maintain an email list of those interested in attending Cavan Coderdojo and we will send an email to those on our email list with details of each sessions but you will then need to book a ticket. Inclusion on our list does not mean that you have a ticket.</p><p><br />If the session is sold out then we would advise you to register on the waiting list for cancellations. Please note that Cavan Institute is only the venue and will not be able to deal with any queries. Coderdojo Cavan is volunteer led and run so we are unable to deal with emails etc. If you are interested in mentoring then please pop in and talk to us at one of the sessions. If you are looking for a place at one of sessions then book a ticket.<br /><br />If you book tickets and are unable to attend please cancel your tickets as soon as possible so we can release tickets to those on the waiting list. If you do not attend after booking we will assume you are not interested and remove you from our email alert list.</p>', 'coderdojocavan@gmail.com', NULL, 'CoderDojoCavan', 'http://groups.google.com/group/coderdojocavan', 'http://www.eventbrite.ie/', NULL, 0, NULL, NULL, 0, 'ie/ulster/cavan/cavantown', 'EU', 'IE', 'IRL', 'Cavan Institute, Cathedral Road, Cavan Town', NULL, 372, 'Ireland', 'U', 'Ulster', '', '', '', '', '', '', '2965535', 'Cavan', NULL);
