INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f480b-f3f9-11e4-910d-080027c336f0', 293, NULL, 'Dungannon', 'df74eda3-f3f9-11e4-910d-080027c336f0', '2013-03-22 15:01:24+00', '2013-12-01 14:25:28+00', '3006', 1, 0, 4, 0, 'Every second Thursday from 11th April 3.30-5pm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>A pack lunch</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'emma.mccracken@swc.ac.uk', NULL, 'CoderDojo_swc', NULL, NULL, NULL, 0, NULL, NULL, 0, 'gb/dungannon', 'EU', 'GB', 'GBR', 'SWC Dungannon Stem Centre', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ec320-f3f9-11e4-910d-080027c336f0', 23, NULL, 'NSC Mahon Cork', 'df75502a-f3f9-11e4-910d-080027c336f0', NULL, '2013-12-01 14:25:30+00', '3006', 1, 0, 2, 0, 'Every Wednesday between 6:15pm and 7:15pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Ballinure","geonameId":"3286703"}', '51.888425,-8.403361000000018', '{"lat":51.888425,"lon":-8.403361000000018}', '<p><strong>Kids, </strong>3 things to know about programming...<br />1) there is a lot of typing. I assume that you are willing and able for that.<br />2) you&#39;re going in to the file system.<br />3) ask &quot;why&quot;. The what and the how is the easy part. I&#39;m showing you that, but ask why.</p><p>&nbsp;</p><p><strong>Be Crafty.js; I was asked to make a HTML5 version of &quot;The World&#39;s Hardest Game&quot; (the Stubbyland version) I&#39;ve had to consult the libraries. This isn&#39;t going to be easy, but I&#39;ll show you the &quot;vanilla&quot; versions before we implement it in Crafty. The mini game we&#39;ll be building is to get you used to using Crafty.js, and not too dissimilar to the end version (yes I&#39;m dreading level design). Which is why a 2D version of Slender will be the first stopping off point.</strong></p><p><strong>What you need to bring:</strong></p><ul><li>YOU MUST BRING A LAPTOP or Desktop. (yes iPads have app that teach coding like an interactive test, but Javascript requires access to the file system &#40;locked down on iOS&#41; and Chrome (the iOS version of Chrome is really Safari).)</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p><strong>Who can attend:</strong></p><ul><li>Due to fire insurance there is a maximum limit of 12 kids and 3 adults per room, so please pre-register to guarantee a place! There is space and comfy seats in the atrium next to the training rooms for parents to be on hand if needed</li><li>We require a parent or guardian to accompany 12s and under partially to keep an eye on their equipment, partially to keep an eye on their charges and partially to learn along with them. Parents and students can eventually become mentors (heck, the kids have come up with far more elegant solutions for some problems).</li><li>Very young kids may not get much out of it, but we regularly have 8 year olds. They would need to be able to handle medium strength English words and some mathematics to get much out of it. Its thought programming should be done in schools, or at least programmatic thinking, just after long division as its the first abstract algorithm most kids encounter. We do often have younger siblings of kids in the dojo who watch on or play on other computer devices, in preparation for future coding genius.</li><li>There will be a lot of typing, and some file management. A LOT of typing.</li></ul><p><strong>Cost: Free!</strong><br /><em>The venue and utilities are provided to us at no charge and mentors donate their time so that we can provide this opportunity for kids at no charge.</em></p><p><strong>Topics we cover at the moment include:</strong></p><ul><li>HTML/CSS/Javascript (Web Frontend).</li><li>Other topics will be presented depending on what mentors are around on the day. If there is anything in particular that you or the kids would like to cover, let us know.</li></ul><p>&nbsp;</p>', 'will@willknott.ie', NULL, 'CoderDojoCork', 'https://groups.google.com/forum/?fromgroups#!forum/coderdojonsc', '16087478080', NULL, 0, NULL, NULL, 0, 'ie/munster/ballinure/nsc-mahon-cork', 'EU', 'IE', 'IRL', 'National Software Centre, Mahon, Cork.', NULL, 372, 'Ireland', 'M', 'Munster', '', '', '', '', '', '', '3286703', 'Ballinure', NULL);
