INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ee4fa-f3f9-11e4-910d-080027c336f0', 123, NULL, 'Rosscarbery', 'df7468d1-f3f9-11e4-910d-080027c336f0', '2012-05-01 09:42:39+00', '2013-10-14 08:35:45+00', '21', 2, 1, 1, 0, 'Mondays 7-9pm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'You should bring (if you can): <ul><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). The parent must stay with the child/children for the entire session.</strong></li></ul> To start out, we''ll be working on the following: <ul><li>Basic HTML & CSS to set up your own webpage, using <a href="http://notepad-plus-plus.org/" target="_blank">Notepad ++</a> for Windows or <a href="http://www.barebones.com/products/textwrangler/" target="_blank">Text Wrangler for Mac.</a></li> <li><a href="http://scratch.mit.edu/" target="_blank">Scratch</a>, a programme designed for children to create their own games without knowing advanced coding, a great start to learning how coding a game works.</li> <li>There is also a group of teens learning the Python programming language.</li> </ul> <p>If possible, please download these two programmes to your laptops before the session.</p> <p>Also check out <a href="http://www.coderdojowestcork.wordpress.com" target="_blank">www.coderdojowestcork.wordpress.com</a> for more information as well as downloads of the presentations from previous sessions.</p> <p>The following websites are helpful to get some additional knowledge on these areas:</p> <ul><li><a href="http://w3schools.com/" target="_blank">W3Schools</a>, easy online tutorials for HTML and CSS</li> <li><a href="http://www.codecademy.com" target="_blank">Codecademy</a> an online, interactive, way to learn to code.</li></ul> <p><b>We are very grateful to The Celtic Ross Hotel for providing a great venue. Please show your thanks by purchasing drinks and other refreshments while you are here.</b></p>', 'rosscarbery@coderdojo.com', NULL, 'CoderDojoWCork', 'https://groups.google.com/forum/?fromgroups#!forum/coder-dojo-west-cork', NULL, 'http://coderdojo.com/wp-content/uploads/2012/05/ross-coderdojo-sponsers.jpg', 0, NULL, NULL, 0, 'ie/rosscarbery', 'EU', 'IE', 'IRL', 'Celtic Ross Hotel', NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
