INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ee56f-f3f9-11e4-910d-080027c336f0', 125, NULL, 'Clonakilty', 'df7469a1-f3f9-11e4-910d-080027c336f0', '2012-05-04 09:25:58+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 2, 0, 'Fridays, 6.30-8.30pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Clonakilty","geonameId":"2965402"}', '51.616377035672436,-8.895976486724862', '{"lat":51.616377035672436,"lon":-8.895976486724862}', '<p><b>Due to space limitations, you must register in order to attend.</b> Please visit <a href="http://coderdojoclonakilty.eventbrite.com" target="_blank">http://coderdojoclonakilty.eventbrite.com</a> to book. If ''Sold Out'' for this week, go on the waiting list and we may clear you to attend if space opens up. Booking for next week will open Saturday morning. You cannot block book, you will need to register each week. We do hate to restrict numbers, but due to space and mentors available it''s best for everyone.</p> <p>You must bring: <ul><li>A laptop. Borrow one from someone if needs be. (If possible install the applications noted below beforehand.)</li> <li>an extension cable, if you have a spare one <li><strong>A parent! (Very important) A parent must stay with a child/children for the session.</strong></li></ul></p> <p><b>Please label all of your belongings with your name, as things are often left behind or mixed up.</b></p> <p>We are working on the following: <ul> <li><b><a href="http://scratch.mit.edu/" target="_blank">Scratch</a></b>, a programme designed for children to create their own games without knowing advanced coding, a great start to learning how coding a game works.</li> <li>Basic HTML & CSS to set up your own webpage, using <b><a href="http://notepad-plus-plus.org/">Notepad ++</a> for Windows or <a href="http://www.barebones.com/products/textwrangler/" target="_blank">Text Wrangler for Mac</b></li> </ul></p> <p>If possible, please download the relevant programmes to your laptops before the session.</p> <p>See also <a href="http://www.coderdojowestcork.wordpress.com" target="_blank">www.coderdojowestcork.wordpress.com</a> for more information and download tutorials and presentations from previous sessions.</p> <p>The following websites are helpful to get some additional knowledge on these areas: <ul><li><a href="http://w3schools.com/" target="_blank">W3Schools</a>, easy online tutorials for HTML and CSS</li> <li><a href="http://www.codecademy.com/" target="_blank">Codecademy</a> an online, interactive, way to learn to code.</li></ul></p> <p><b>We are very grateful to The Quality Hotel Clonakilty for supplying a venue. Please show your thanks and support the hotel in buying refreshments while you are there.</b></p>', 'clonakilty@coderdojo.com', 'http://coderdojowestcork.wordpress.com/', 'CoderDojoWCork', 'https://groups.google.com/forum/?fromgroups#!forum/coder-dojo-west-cork', NULL, 'http://coderdojowestcork.files.wordpress.com/2012/05/quality-hotel-clonakilty.png', 0, NULL, NULL, 0, 'ie/munster/clonakilty/clonakilty', 'EU', 'IE', 'IRL', 'Quality Hotel, Clogheen, Clonakilty, County Cork, Ireland', NULL, 372, 'Ireland', 'M', 'Munster', '', '', '', '', '', '', '2965402', 'Clonakilty', NULL);
