INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fefd8-f3f9-11e4-910d-080027c336f0', 709, NULL, 'La Paz, Bolivia @ Bolivia Tech Hub', 'df75d08c-f3f9-11e4-910d-080027c336f0', '2014-03-04 19:19:29+00', '2014-03-06 09:38:06+00', '3006', 1, 1, 1, 0, 'Todos los Viernes y Sabado, desde las 16:00 a partir del 13 de febrero', '{"countryName":"Bolivia","geonameId":"3923057","alpha2":"BO"}', '{}', '{"toponymName":"La Paz"}', '{}', '{"name":"San Jorge","geonameId":"3905595"}', '-16.513461273544458,-68.12447649706723', '{"lat":-16.513461273544458,"lon":-68.12447649706723}', '<p><strong>Club de entrenamiento para estudiantes de Colegio</strong> (cualquier edad), profesores y demas interesados que busquen iniciarse en el mundo de la Programacion Competitiva, que puedan participar en el futuro en competencias como la Olimpiada Boliviana de Informatica, el Abierto de Informatica, el Iberoamericano de Informatica o la final mundial de la Olimpiada Internacional de Informatica!</p><p>Todo este contexto de competencias les permitira en un futuro poder participar en los torneos de programacion mas importantes, como ser el ICPC, Google Code Jam, TopCoder Open, Facebook Hacker Cup y otros. Esto les permitira tener un nivel competitivo alto y podran aspirar a puestos de trabajo en las mejores empresas de Software de Bolivia o el mundo, ya en la actualidad muchos exICPC trabajan en las mejores empresas nacionales de software, en Facebook y otros tienen opciones de ir a Google.</p><p>Los interesados deberan enviar un mensaje a&nbsp;coderdojo@icpc-bolivia.edu.bo</p><p>Se tendran sesiones semanales y cada sesion tiene una duracion de 2 horas. Se tiene planificado un total de 8 sesiones.</p><p>Cada asistente debe llevar:</p><ul><li>Una Laptop</li></ul><p>Los talleres inician desde el viernes 20 de febrero, bajo el siguiente rol:</p><div>16:00 &nbsp;a 18:00*</div><div>&nbsp;</div><div>Y los sabados en el mismo turno:</div><div>&nbsp;</div><div><div>16:00 &nbsp;a 18:00*</div><div>&nbsp;</div><div>* los horarios de alguna sesion pueden variar, pero seran anunciados en la sesion previa para coordinar el cambio con todos los asistentes.</div><div>&nbsp;</div><div><div><strong>Indice de Contenidos por sesion:</strong></div><div><br /><strong>Sesion&nbsp;1:</strong> Introcducci&oacute;n a la programacion en C++.<br />Tutor: Oscar Carvajal.<br /><br /><strong>Sesion&nbsp;2:</strong> Estructuras de Datos.<br />Tutor: Diego Charca.<br /><br /><strong>Sesion&nbsp;3:</strong> Programaci&oacute;n Modular.<br />Tutor: Rodrigo Castillo.<br /><br /><strong>Sesion&nbsp;4:</strong> Matem&aacute;ticas.<br />Tutor: Rodrigo Castillo.<br /><br /><strong>Sesion&nbsp;5:</strong> Estructuras de Datos 2.<br />Tutor: Addis Rengel.<br /><br /><strong>Sesion&nbsp;6:</strong> Grafos 1.<br />Tutor: Gabriel Mazuelos.<br /><br /><strong>Sesion&nbsp;7:</strong> Grafos 2.<br />Tutor: Addis Rengel.<br /><br /><strong>Sesion&nbsp;8:</strong> Programaci&oacute;n Din&aacute;mica.<br />Tutor: Branimir Espinoza.</div></div></div>', 'coderdojo@icpc-bolivia.edu.bo', 'http://olimpiada.icpc-bolivia.edu.bo/', 'wpimentel', 'http://ask.icpc-bolivia.edu.bo/', '15639740886', 'http://2014.desarrollandoamerica.org/wp-content/uploads/2014/07/sim1.png', 0, NULL, NULL, 0, 'bo/la-paz/san-jorge/la-paz-bolivia-bolivia-tech-hub', 'SA', 'BO', 'BOL', 'Av. Sanchez Lima (final) esquina Pasaje Fabiani, No 2687, Sopocachi, La Paz', NULL, 68, 'Bolivia, Republic of', '04', 'La Paz', '', '', '', '', '', '', '3905595', 'San Jorge', NULL);
