INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9125bc-f3f9-11e4-910d-080027c336f0', 1134, NULL, 'Rathmines, Dublin 6, @ St. Marys College', 'df76da76-f3f9-11e4-910d-080027c336f0', '2014-12-10 01:03:42+00', '2014-12-16 13:48:31+00', '4124', 1, 1, 2, 0, 'Every Saturday, 2:30pm to 4:40pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Portobello","geonameId":"7870000"}', '53.3275459,-6.266798999999992', '{"lat":53.3275459,"lon":-6.266798999999992}', '<p><em><strong>CoderDojo Club in St. Marys College</strong></em></p><p><em><strong>Age Group 11-16</strong></em></p><p><em><strong>Required for all members</strong></em></p><p>All Parents must attend their first child&#39;s first class to sign the parental permission. Parents of under 12 must stay on the premises at all times.&nbsp;Please make sure to fill out the parental permission form available&nbsp;<a href="https://docs.google.com/document/d/1ciBSadhRlVll82Bje7KE33y5VQuHs9ttw1iL0tN2_zI/edit?usp=sharing">here</a>.&nbsp;Print, sign and take it with you on your childs first visit. We will have some forms available on the day but it will save time and expense if you can print and bring them along.</p><p>Please be advised, places will be limited to ticket holders only:&nbsp;<strong>One Ticket Per Child.&nbsp;</strong></p><p><em><strong>Coderdojo is run completely by volunteers. If you can help in anyway please let us know.</strong></em></p><p>*CoderDojo is FREE for kids, If a parent would like to become a mentor please get in touch, experience is not necessary! Parents not mentoring are asked to entertain themselves while they wait, maybe bring a book. &nbsp;We&#39;d like to encourage the children to help &amp; work with each other.&nbsp;&nbsp;</p><p><em><strong>Directions</strong></em>&nbsp;St. Mary&#39;s College is located on Rathmines Road Lwr., Dublin 6.</p><p><em><strong>What to Bring</strong></em>&nbsp;<br />All children must have their ticket and be accompanied by their parent/gaurdian who has a signed consent form.<br />If possible we are asking children to bring their own laptop so they may continue what they have learnt at home however we will have a number of PC&#39;s available.</p>', 'info@smccdojo.com', 'http://www.smccdojo.com', NULL, NULL, '14832389075', NULL, 0, NULL, NULL, 0, 'ie/portobello/rathmines-dublin-6-st-marys-college', 'EU', 'IE', 'IRL', 'St. Marys College, Rathmines, Dublin 6.', NULL, 372, 'Ireland', '', '', '', '', '', '', '', '', '7870000', 'Portobello', NULL);
