itto.png', 0, NULL, NULL, 0, 'it/apulia/area-industriale/bitritto-bari-hp', 'EU', 'IT', 'ITA', 'Centro Direzionale Contrada La Marchesa', NULL, 380, 'Italy, Italian Republic', '13', 'Apulia', '', '', '', '', '', '', '8984881', 'Area Industriale', NULL);
