pmu.ro/sites/default/files/LGM_Timisoara_03.jpg', 0, NULL, NULL, 0, 'ro/timis/colonia-banschi/timisoara-moisil', 'EU', 'RO', 'ROU', 'Ghirlandei, Timisoara', NULL, 642, 'Romania', '36', 'Timiş', '', '', '', '', '', '', '681091', 'Colonia Banschi', NULL);
