INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ed58e-f3f9-11e4-910d-080027c336f0', 71, NULL, 'Bray', 'df740745-f3f9-11e4-910d-080027c336f0', '2012-03-15 11:42:50+00', '2013-12-01 14:25:30+00', '3006', 1, 1, 2, 0, 'Saturday 2:30pm-4:30pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Bray","geonameId":"2966022"}', '53.19197032889269,-6.101875305175781', '{"lat":53.19197032889269,"lon":-6.101875305175781}', '<p>CoderDojo Bray is currently on a break for Christmas/New Year.</p><p>CoderDojo Bray will return in January 2015, in Presentation College, Bray, each Saturday during the seconary school term @ 2:30pm.</p><p>We will be continuing our introduction to programming, using MIT Scratch. We will have Basic and Advanced Scratch streams, looking at multi-player and networked games in the Advanced Scratch stream.</p><p>We will continue with an introduction on mobile phone apps using AppInventor.</p><p>We will also continue HTML, CSS and web technology.</p><p>We&#39;ll be continuing our project-based activity stream, in three areas:</p><ul><li>Basic electronics and microcontrollers using Arduinos and Intel Galileos</li><li>Exploring Raspberry Pis</li><li>Robot control and programming (Arduino based)<p>&nbsp;</p><p>We will have our introduction to programming using Python stream, and start exploring programming using the Python language and pygame.</p><p>Due to very high demand, you <strong>must</strong> register ahead. The EventBrite URL will be activated nearer the date. We plan to issue 180&nbsp;tickets for this session in two groups of 90 places, for each of two &quot;cohorts&quot; of 3 weeks each.<br /><br />Note that this means there are&nbsp;<strong>two</strong>&nbsp;EventBrite events for this session which cannot be entered directly into this form. Visit <a href="http://coderdojobray.eventbrite.com">http://coderdojobray.eventbrite.com</a> to check for the individual listings.</p></li><li><p>What to bring:</p><p>We can always use more volunteers of course. So if you can help out, check out our contact details and drop us a line. Children of volunteers get preferential access to places.</p><p>Our contact details are on the right: to be kept informed about future events, add yourself to our <strong><a href="http://eepurl.com/I0ng5">mailing list</a></strong> by <strong><a href="http://eepurl.com/I0ng5">clicking on this link to fill in the registration form</a></strong>, drop us an email to get in touch, or follow us on Twitter.</p><p>CoderDojo Bray is free of charge because of the efforts of our volunteers, sponsorship from <a href="http://www.sheehanquinn.ie">HLB Sheehan Quinn</a> and provision of a venue by the <a href="http://presbray.com">Presentation College</a> Bray. CoderDojo Bray could not happen without their support, and we are extremely grateful for it.</p><p>If you would like to make a donation, provide equipment, or help out, please contact us at <a href="mailto:bray@coderdojo.com"><strong>bray@coderdojo.com</strong></a>. Any money or equipment donated will be used solely for CoderDojo.</p><ul><li><ul><li>A laptop</li><li>Paper/Pen - something to write on and with</li><li>A parent (if you&#39;re 12 or under, a parent/guardian must stay)</li><li>A snack/drink: we&#39;ll have a short break in the middle of each session. Or you can purchase a snack at our Tuck Shop at breaktime.</li></ul></li></ul></li></ul>', 'bray@coderdojo.com', 'http://coderdojobray.com', 'CoderDojoBray', 'http://groups.google.com/group/coderdojo-bray', '9995471725', NULL, 0, NULL, NULL, 0, 'ie/leinster/bray/bray', 'EU', 'IE', 'IRL', 'Presentation College, Bray', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2966022', 'Bray', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df900e61-f3f9-11e4-910d-080027c336f0', 809, NULL, 'Palos Verdes, LA', 'df763f1b-f3f9-11e4-910d-080027c336f0', '2014-05-07 06:30:24+00', '2014-06-04 09:39:48+00', '3006', 1, 0, 1, 0, 'Every month/ 2nd and 4th Saturdays of each month/ 3:00 pm - 5:00 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Los Angeles County"}', '{"toponymName":"California"}', '{}', '{"name":"Palos Verdes Peninsula","geonameId":"8480025"}', '33.7707747,-118.37075679999998', '{"lat":33.7707747,"lon":-118.37075679999998}', '<p>We are excited to announce our CoderDojo will be hosted in the Peninsula Center Library every 2nd and 4th Saturday from 3pm - 5pm! No matter your age or past programming experience, you are very welcome to&nbsp;partake in our fun and interactive enviorment to learn Java!&nbsp;</p><p>Computers will be provided by Peninsula Center Library; however, you may choose to bring a laptiop!</p><p><strong>Parent participation is strongly recommended but is not required.</strong></p><p>&nbsp;</p>', 'palosverdes.us@coderdojo.com', 'http://www.coderdojopv.weebly.com', NULL, 'https://groups.google.com/forum/?hl=en#!forum/coderdojo-palos-verdes', NULL, 'http://oi62.tinypic.com/beh5ol.jpg', 0, NULL, NULL, 0, 'us/california/palos-verdes-peninsula/palos-verdes-la', 'NA', 'US', 'USA', '701 Silver Spur Road Rolling Hills Estates, CA 90274', NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '8480025', 'Palos Verdes Peninsula', NULL);
