INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f44fa-f3f9-11e4-910d-080027c336f0', 280, NULL, 'Soar Studio Deep Ellum Dallas', 'df74803b-f3f9-11e4-910d-080027c336f0', '2013-03-12 14:09:02+00', NULL, NULL, 0, 1, 2, 0, 'Every Other Thursday from 4:30 - 7:30', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Dallas County"}', '{"toponymName":"Texas"}', '{}', '{"name":"Dallas","geonameId":"4684888"}', '32.781836,-96.782298', '{"lat":32.781836,"lon":-96.782298}', '<p>Tentative Start Date of May 2, 2013</p> <hr> Sign up at <a href="http://soarstudio.eventbrite.com/">http://soarstudio.eventbrite.com/</a><br> Limit to 15 students, UNLESS, we get more mentors. For each mentor we have, I''ll add 15 students to the total. <hr> <p>Bring...<br> <ul> <li>A snack.</li> <li>A laptop. Borrow one from someone if you need to.<em><br></em></li> <li><strong>A parent! (Very important). If you are 13 or under, your parent, or teacher, must stay with you during the session.</strong> We are connected to a coffee bar, so your parents should be comfortable.</li> <li>A Learning attitude. I will not be teaching you, you will be teaching you. I''ll be there to mentor you, show you where to go to learn, guide you in a good direction to meet your own goals, and answer any relevant questions you may have. If I don''t know the answer, we''ll find it together!</li> </ul> </p><hr><p> <ul <li>Look for the building with the big Umbrella Man on the side</li> </ul> </p><hr><p> Things I can mentor... <ul> <li>html</li> <li>JavaScript</li> <li>CSS</li> <li>JQuery</li> <li>PHP</li> <li>ActionScript</li> <li>Flash</li> <li>SketchUp</li> <li>3D Studio Max</li> <li>Unity 3D</li> </ul> </p><hr>', 'jd@soarstudio.com', NULL, 'jdviz', 'https://groups.google.com/forum/?fromgroups#!forum/soarstudio', '6248173455', NULL, 0, NULL, NULL, 0, 'us/texas/dallas/soar-studio-deep-ellum-dallas', 'NA', 'US', 'USA', 'Life in Deep Ellum, 2803 Taylor St., Dallas, TX 75226', NULL, 840, 'United States of America', 'TX', 'Texas', '', '', '', '', '', '', '4684888', 'Dallas', NULL);
