INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90f059-f3f9-11e4-910d-080027c336f0', 1068, NULL, 'Carrick On Shannon, Co. Leitrim', 'df76f095-f3f9-11e4-910d-080027c336f0', '2014-11-12 14:56:09+00', '2014-11-14 11:38:24+00', '4124', 1, 0, 2, 0, 'Every Saturday 2:30 pm 4:30 pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Connaught"}', '{}', '{"name":"Carrick on Shannon","geonameId":"2965727"}', '53.946122, -8.075020', '{"lat":53.946122,"lon":-8.07502}', '<ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session. </strong></li><li>Places are limited and you need to register prior to the session.</li><li>Tickets will be available 5 days before the sessions. You will need to book a place prior the event.</li><li>To book your ticket go to &nbsp;<a href="http://www.eventbrite.ie/o/carrick-on-shannon-coderdojo-7680093949">http://carrickonshannondojo.eventbrite.ie</a></li></ul>', 'carrickonshannondojo@gmail.com', 'http://www.carrickdojo.com/', 'CarrickDojo', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/connaught/carrick-on-shannon/carrick-on-shannon-co-leitrim', 'EU', 'IE', 'IRL', 'The Hive -- Leitrim County Enterprise Fund, Dublin Road, Carrick on Shannon, Co. Leitrim', NULL, 372, 'Ireland', 'C', 'Connaught', '', '', '', '', '', '', '2965727', 'Carrick on Shannon', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ee38f-f3f9-11e4-910d-080027c336f0', 118, NULL, 'Cork CIT Blackrock Castle Observatory', 'df745f46-f3f9-11e4-910d-080027c336f0', '2012-04-23 13:06:52+00', '2013-12-01 14:25:29+00', '3006', 1, 0, 2, 0, 'Friday''s between 17:00-19:00 EXCEPT for the first Friday of every month when it will NOT take place', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Blackrock","geonameId":"2966132"}', '51.900244103718194,-8.402462304229743', '{"lat":51.900244103718194,"lon":-8.402462304229743}', '<p><br /><strong>What You Need To Bring:</strong></p><p>&nbsp;</p><p>&nbsp;</p><ul><li>If you have one, a laptop. If not, let us know and we can have a machine for you to use</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p><br /><strong>Who can attend:</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>Due to space restrictions you must register each week. Registration opens every Sunday evening at 19:00 for the following Friday&#39;s class</li><li>We require a parent or guardian to accompany 12s and under partially to keep an eye on their equipment, partially to keep an eye on their charges and partially to learn along with them.</li><li>Parents and students can eventually become mentors (heck, the kids have come up with far more elegant solutions for some problems).</li><li>Very young kids may not get much out of it, but we regularly have 8 year olds. They would need to be able to handle medium strength English words and some mathematics to get much out of it. Its thought programming should be done in schools, or at least programmatic thinking, just after long division as its the first abstract algorithm most kids encounter. We do often have younger siblings of kids in the dojo who watch on or play on other computer devices, in preparation for future coding genius.</li></ul><p><br /><strong>Cost: Free!</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>The venue and utilities are provided to us at no charge and mentors donate their time so that we can provide this opportunity for kids at no charge.</li></ul><p><br /><strong>Topics we cover at the moment include:</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>HTML/CSS/Javascript (Web Frontend).</li><li>Other topics will be presented depending on what mentors are around on the day. If there is anything in particular that you or the kids would like to cover, let us know.</li><br /><li>Contact: <a href="mailto:info@bco.ie?Subject=CoderDojo BCO"> info@bco.ie</a><br /><br /><em>Please make sure you&#39;ve read the information above before emailing, as we think weve covered most topics that are likely to come up.</em></li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'info@bco.ie', 'http://coderdojo.bco.ie', 'blackrockcastle', NULL, '11503532375', NULL, 0, NULL, NULL, 0, 'ie/munster/blackrock/cork-cit-blackrock-castle-observatory', 'EU', 'IE', 'IRL', 'CIT Blackrock Castle Observatory, Blackrock, Cork.', NULL, 372, 'Ireland', 'M', 'Munster', '', '', '', '', '', '', '2966132', 'Blackrock', NULL);
