u', 'CoderDojoBNE', NULL, NULL, NULL, 0, NULL, NULL, 0, 'au/queensland/kenmore/brisbane-kenmore', 'OC', 'AU', 'AUS', 'Kenmore Village Shopping Centre, Brookfield Road  Kenmore  Brisbane, QLD 4069', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '6931020', 'Kenmore', NULL);
