INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f3642-f3f9-11e4-910d-080027c336f0', 263, NULL, 'North Dakota', 'df74da01-f3f9-11e4-910d-080027c336f0', '2013-02-28 15:31:02+00', '2013-12-01 14:25:28+00', '3006', 1, 1, 4, 0, 'Saturday January 25th 2:00pm-5:00pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Burleigh County"}', '{"toponymName":"North Dakota"}', '{}', '{"name":"Bismarck","geonameId":"5688025"}', '46.810103,-100.783778', '{"lat":46.810103,"lon":-100.783778}', '<p>Are you a kid in the Bismarck Mandan area between 7 and 17 years old? Want to learn how to code and build cool stuff? Create a game, website or app just for the fun of it. Join us for a fun day of learning to code.</p><p>&nbsp;</p><p><strong>About</strong></p><p>Coder Dojo ND is a free and open non-profit movement to teach youth (ages 7-17) to code. Our sessions are located in the Bismarck-Mandan area and are open to the community youth and parents/guardians. No one is turned away regardless of age. We accept anyone willing to play. Teaching in this case does not involve classes, rather a set of workshops and sessions of local youth interested in learning and collaborating with each other on their own projects.</p><p>&nbsp;</p><p><strong>Terms and Conditions</strong></p><p>By registering for this event you are agreeing to the terms and conditions of Coder Dojo ND. All participants 12 and under must be accompanied by a parent or guardian. You must bring a laptop for working on projects while at the session. If you do not have a laptop please contact us. We may be able to provide a laptop for use during the session. Coder Dojo ND programs and software should not harm or cause hardware/software problems. Coder Dojo ND is not responsible laptop/equipment repair or replacement or the fees that you may incur in the event of a laptop/equipment problem. Coder Dojo ND does not warranty against data loss. You are responsible for your own backups. Coder Dojo ND, the hosting facility, mentors, and sponsors are not liable for accidents, loss, theft, or any issue of liability.</p>', 'uriah@geekmyself.org', NULL, 'coderdojoND', 'https://groups.google.com/forum/#!forum/coder-dojo-nd', '9540216043', NULL, 0, NULL, NULL, 0, 'us/north-dakota/bismarck/north-dakota', 'NA', 'US', 'USA', 'Bismarck Public Library', NULL, 840, 'United States of America', 'ND', 'North Dakota', '', '', '', '', '', '', '5688025', 'Bismarck', NULL);
