INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fe7e3-f3f9-11e4-910d-080027c336f0', 677, NULL, 'Madison,WI, @Sun Prairie Public Library', 'df75c99a-f3f9-11e4-910d-080027c336f0', '2014-02-12 17:40:10+00', NULL, NULL, 0, 0, 2, 0, 'Saturday March 14th 12pm - 3pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Dane County"}', '{"toponymName":"Wisconsin"}', '{}', '{"name":"Sun Prairie","geonameId":"5275020"}', '43.1756527,-89.23557770000002', '{"lat":43.1756527,"lon":-89.23557770000002}', '<ul><li>A registration is required. Please email for event details.&nbsp;</li><li>Simple programming using scratch. More information at&nbsp;http://scratch.mit.edu/</li><li>Kids based on strength will be paired with someone to come up for various solutions to solve a problem.</li><li>All members will be asked to submit any questions two weeks prior to the call, if a question/topic is suggested by more than one member it will be included on the agenda.</li><li>A pack lunch.</li><li>A laptop. Minimum window/linux os needed. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'madisoncoderdojo@googlegroups.com', NULL, NULL, 'https://groups.google.com/d/forum/madisoncoderdojo', '10659606169', NULL, 0, NULL, NULL, 0, 'us/wisconsin/sun-prairie/madisonwi-sun-prairie-public-library', 'NA', 'US', 'USA', 'Sun Prairie public library,  1350 Linnerud Dr, Sun Prairie, WI 53590', NULL, 840, 'United States of America', 'WI', 'Wisconsin', '', '', '', '', '', '', '5275020', 'Sun Prairie', NULL);
