INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fbda1-f3f9-11e4-910d-080027c336f0', 561, NULL, 'Brisbane - Carindale Library', 'df757400-f3f9-11e4-910d-080027c336f0', '2013-11-28 02:38:07+00', '2013-12-20 12:28:25+00', '3006', 1, 1, 0, 0, 'Every Saturday from 14th February - 21st March, 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Carindale","geonameId":"7281839"}', '-27.5033262,153.10151740000003', '{"lat":-27.5033262,"lon":153.10151740000003}', '<p><strong>CoderDojo Brisbane kicks off Term&nbsp;1 2015&nbsp;at Carindale Library!</strong></p><p><strong>Registration for this event includes all sessions from Saturday 14th February until Saturday 21st March&nbsp;(inclusive) from 12.30 - 2.30pm.&nbsp;</strong></p><p>Kids aged 7 - 17 will be exposed to programming tools such as Scratch and HTML, and can then create their own projects to work on with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop</li><li>snack or lunch</li></ul><p><em><strong>Please Note: a parent is to supervise if a participant is aged under 15 years</strong></em></p><p>​<strong><strong>For more information, visit the&nbsp;<a href="http://coderdojobrisbane.com.au/get-involved/participants/">CoderDojo Brisbane website.</a></strong></strong></p><div>&nbsp;</div>', 'info@coderdojobrisbane.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', NULL, NULL, NULL, 0, NULL, NULL, 0, 'au/queensland/carindale/brisbane-carindale-library', 'OC', 'AU', 'AUS', 'Carindale Library, 1151 Creek Rd, Carindale QLD 4152', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '7281839', 'Carindale', NULL);
