INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90b515-f3f9-11e4-910d-080027c336f0', 923, NULL, 'Bangor, NI, @SERC', 'df76bc4a-f3f9-11e4-910d-080027c336f0', '2014-08-26 03:40:35+00', '2014-09-10 08:18:00+00', '4124', 1, 0, 2, 0, 'Every other Thursday 6:00 PM - 8:00 PM, term-time', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"North Down"}', '{"toponymName":"Northern Ireland"}', '{}', '{"name":"Bangor","geonameId":"2656396"}', '54.6561275,-5.661032699999964', '{"lat":54.6561275,"lon":-5.661032699999964}', '<p>In this Coder Dojo we will start by working through developing&nbsp;computer games in Unity.&nbsp; The coder Dojo runs in the evening from 6:00 PM to 8:00 PM</p><div><p>In session 11 we will look at developing mobile apps using App Inventor 2. In this session you will see how to download the app onto a phone.</p><p>We will look at how the apps are developed and how they work, starting with some simple apps. You can then develop your own app.</p><p>As normal a number of lego Mindstorm kits are available.</p><p>There is also be a number of Lego Mindstorm kits for people to use.</p></div><p>Registration is required before the event (see link below), though you can call in on the day (if not registered you will need a computer with Unity installed).</p><ul><li>Aged between 11 and 18, though if you are over 18 you are welcome to attend.</li><li>We will be focusing on Games Development, but will also be spending time on mobile application development, web design and Raspberry Pi.</li><li>If you want to save your project bring along a USB pen to store the project.</li><li><strong>A parent! (Very important). If you are 14 or under, your parent must stay with you during the session.</strong></li><li><strong>If you have your own laptop, bring it and install Unity 3D </strong></li></ul><p>The location of the Coder Dojo is SERC, Bangor Campus, Room C12. If you have any further queries can you please e-mail Eamonn Brankin (ebrankin@serc.ac.uk).</p><p>&nbsp;</p>', 'sercbangor.gb@coderdojo.com', NULL, 'SERC_Coder_Dojo', NULL, '15972372797', NULL, 0, NULL, NULL, 0, 'gb/northern-ireland/bangor/bangor-ni-serc', 'EU', 'GB', 'GBR', 'SERC, Castle Park Road, Bangor, Co.Down, Northern Ireland, BT20 4TD', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'NIR', 'Northern Ireland', '', '', '', '', '', '', '2656396', 'Bangor', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90b633-f3f9-11e4-910d-080027c336f0', 928, NULL, 'Friuli Venezia Giulia, Italy', 'df76c040-f3f9-11e4-910d-080027c336f0', '2014-08-30 15:04:49+00', NULL, NULL, 0, 1, 1, 0, 'We have a calendar on the site', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Pordenone"}', '{"toponymName":"Friuli Venezia Giulia"}', '{"toponymName":"Pordenone"}', '{"name":"Sclavons","geonameId":"3166896"}', '45.96701620528132,12.685135135720884', '{"lat":45.96701620528132,"lon":12.685135135720884}', '<p>CoderDojo Friuli Venezia Giulia (FVG) organizza dojo in tutta la regione.&nbsp; Informazioni dettagliate sugli incontri e il luogo sono disponibili sul sito www.codedojofvg.it</p><p><em>CoderDojo Friuli Venezia Giulia (FVG) arranges dojo in all cities of the FVG region. To get detailed information about places and times please check our website www.coderdojofvg.it.</em></p><p>&nbsp;</p>', 'info@coderdojofvg.it', 'http://www.coderdojofvg.it', 'CoderdojoFVG', NULL, NULL, NULL, 1, '4202', '2014-09-03 20:47:35+00', 0, 'it/friuli-venezia-giulia/sclavons/friuli-venezia-giulia-italy', 'EU', 'IT', 'ITA', 'Via Vittorio Veneto, 31 33170  Pordenone', NULL, 380, 'Italy, Italian Republic', '06', 'Friuli Venezia Giulia', '', '', '', '', '', '', '3166896', 'Sclavons', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df916574-f3f9-11e4-910d-080027c336f0', 1288, NULL, 'Coderdojo Noale', 'df771a99-f3f9-11e4-910d-080027c336f0', '2015-02-14 15:54:24+00', NULL, NULL, 0, 0, 0, 0, 'L''ultimo sabato del mese, dalle 15 alle 18', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Venice"}', '{"toponymName":"Veneto"}', '{"toponymName":"Noale"}', '{"name":"Ponte Casino","geonameId":"8980414"}', '45.55396843336671,12.077883437078867', '{"lat":45.55396843336671,"lon":12.077883437078867}', '<ul><li>DOVE? A Noale, in via Ongari presso la Sala Civica Daminato, nel retro della nuova Casa di Riposo</li><li>CHI PUO&#39; ISCRIVERSI? Possono iscriversi fino a 30 ragazzi dalla seconda elementare alla terza media, &egrave; sufficiente un PC portatile (anche se cercheremo di fornirne alcuni per i ragazzi che non ne hanno uno a disposizione) una merenda e almeno un genitore che li accompagni e che rimanga con noi durante l&#39;incontro.</li><li>Vai al nostro sito www.talentree.it o nella nostra pagina Facebook www.facebook.it/talentree.it</li><li>Prima di ogni nuovo incontro sar&agrave; messa a disposizione una nuova scheda di iscrizione.</li></ul>', NULL, 'http://www.talentree.it', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'it/veneto/ponte-casino/coderdojo-noale', 'EU', 'IT', 'ITA', 'Noale', NULL, 380, 'Italy, Italian Republic', '20', 'Veneto', '', '', '', '', '', '', '8980414', 'Ponte Casino', NULL);
