INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ef1f3-f3f9-11e4-910d-080027c336f0', 165, NULL, 'Okinawa', 'df7407cf-f3f9-11e4-910d-080027c336f0', '2012-07-09 07:34:00+00', '2013-12-01 14:25:29+00', '3006', 1, 0, 1, 0, 'Upon Request (Workshop Style)', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{}', '{"toponymName":"Okinawa"}', '{}', '{"name":"Yogi","geonameId":"1848393"}', '26.2002013,127.6881363', '{"lat":26.2002013,"lon":127.6881363}', '<div>CoderDojo Okinawa is now being prepared. Please visit our web page at <a href="http://coderdojo-okinawa.github.com/">http://coderdojo-okinawa.github.com/</a> (Japanese only).</div><p>&nbsp;</p><div>If you are interested in organizing CoderDojo Okinawa, please let us know it via email.</div><p>&nbsp;</p><p>&nbsp;</p><div>Below is the list of what we plan to do:</div><p>&nbsp;</p><p>&nbsp;</p><ul><li>Create Games with Scratch</li><li>Create Home Pages with HTML/CSS/Javascript</li><li>Create Games with Javascript</li></ul><p>&nbsp;</p>', 'coderdojo.okinawa@gmail.com', 'http://okinawa.coderdojo.jp/', 'CoderDojoOKNW', NULL, NULL, NULL, 0, NULL, NULL, 0, 'jp/okinawa/yogi/okinawa', 'AS', 'JP', 'JPN', 'GeekHouse Okinawa, Naha, Okinawa, Japan', NULL, 392, 'Japan', '47', 'Okinawa', '', '', '', '', '', '', '1848393', 'Yogi', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90e00f-f3f9-11e4-910d-080027c336f0', 1048, NULL, 'Majadahonda, Madrid', 'df76eb15-f3f9-11e4-910d-080027c336f0', '2014-10-30 16:15:04+00', '2014-11-07 16:13:07+00', '4124', 1, 1, 2, 0, 'Every Saturday 11-13 h / Todos los sábados de 11 a 13 h', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Madrid"}', '{"toponymName":"Madrid"}', '{"toponymName":"Majadahonda"}', '{"name":"Majadahonda","geonameId":"3117667"}', '40.47414253170484,-3.866673620237748', '{"lat":40.47414253170484,"lon":-3.866673620237748}', '<h4><strong>Informaci&oacute;n B&aacute;sica</strong></h4><ul><li>Todas las personas entre 8 y 17 a&ntilde;os con ganas aprender programar y compartir todo lo que saben son bienvenidas en CoderDojo Majadahonda.<br />&nbsp;</li><li>Si te interesa la programaci&oacute;n contamos con los/as mejores mentores a este lado la zona noroeste para ayudarte a avanzar ;)<br />&nbsp;</li><li>El equipo de mentores/as esta formado por personas con muy diferentes habilidades, experiencia y formaci&oacute;n; ellos y ellas no son profesores al uso pero s&iacute; est&aacute;n para guiarte.<br />&nbsp;</li><li>Los/as mentores son personas voluntarias que rotar&aacute;n durante el proyecto.<br />&nbsp;</li><li>Para ser un coder s&oacute;lo tienes que enviarnos un correo a mlorenzo@majadahonda.org e indicanos si quieres ser mentor/a o participante. Te facilitaremos la ficha de preinscripci&oacute;n y te contestaremos lo m&aacute;s pronto que nos sea posible.<br />&nbsp;</li><li>Es recomendable que un adulto acompa&ntilde;e durante la actividad a las personas menores de 12 a&ntilde;os.<br />&nbsp;</li><li>Es necesario traer el port&aacute;til a todas las reuniones, del resto nos encargamos desde CoderDojo Majadahonda ;)</li></ul><p>---</p><h4><strong>Basic Information:</strong></h4><ul><li>Everyone between the ages of 8 and 17, with an interest in programming and willingness to share their knowledge with others, is welcome to CoderDojo Majadahonda.<br />&nbsp;</li><li>If you have an interest in programming, we can supply you with the best possible mentors to help you progress in your knowledge ;)<br />&nbsp;</li><li>The mentoring team consists of people with very different skills, experience and training; they are not teachers but are here to guide and support you.<br />&nbsp;</li><li>The mentors are volunteers that attend at a rotating schedule throughout the duration of the project.<br />&nbsp;</li><li>To be a coder, just send an email to mlorenzo@majadahonda.org&nbsp;and let us know if you want to be a mentor or participant. We will provide the pre-registration form and get back to you as soon as we can.<br />&nbsp;</li><li>It is recommended for an adult to accompany participiants below the age of 12.<br />&nbsp;</li><li>It is necessary that you bring your own laptop to the events, but the rest will be supplied by CoderDojo Majadahonda ;)</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'mlorenzo@majadahonda.org', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'es/madrid/majadahonda/majadahonda-madrid', 'EU', 'ES', 'ESP', 'Centro Juvenil &quot;Príncipe de Asturias&quot; C/ Dr. Calero, 37. CP: 28220. Majadahonda. Madrid', NULL, 724, 'Spain, Kingdom of', '29', 'Madrid', '', '', '', '', '', '', '3117667', 'Majadahonda', NULL);
