ne.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', NULL, '11578189677', NULL, 1, '4124', '2014-09-26 14:54:29+00', 0, 'au/queensland/carindale/to-be-deleted-brisbane-brisbane-carindale-library', 'OC', 'AU', 'AUS', 'Carindale Library, 1151 Creek Rd, Carindale QLD 4152', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '7281839', 'Carindale', NULL);
