INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fe93e-f3f9-11e4-910d-080027c336f0', 684, NULL, 'Rochester, IL, @ Rochester Intermediate School', 'df75cc8a-f3f9-11e4-910d-080027c336f0', '2014-02-18 01:02:11+00', '2014-02-20 11:42:48+00', '3006', 1, 1, 1, 0, 'Every Monday 6:30-8 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Sangamon County"}', '{"toponymName":"Illinois"}', '{}', '{"name":"Rochester","geonameId":"4248284"}', '39.74888929999999,-89.51894040000002', '{"lat":39.74888929999999,"lon":-89.51894040000002}', '<ul><li>Next dojo <strong>Monday February 23 at 6:30 pm</strong></li><li>Four tracks: &nbsp;Scratch, Minecraft PC Edition, Minecraft Pocket Edition, and Javascript</li><li>There is also a LEGO Robots track that will become a 4-H SPIN group in March</li><li>It&#39;s never too late to start. &nbsp;Make this meeting the first one you attend!</li><li>We meet every Monday that school is in session through May 11, 2015</li><li>Open to all grade levels K-12</li><li>Must be a student in RCUSD 3A</li><li>Parent must stay with RES students and students in Minecraft Pocket Edition track</li><li>Equipment to bring:<ul><li>For Scratch and Javascript, bring your chromebook or a PC</li><li>For Minecraft PC edition, bring your PC with a purchased and installed copy of Minecraft</li><li>For Minecraft pocket edition, bring your Android or iOS phone or tablet with the latest version of Minecraft pocket edition installed</li></ul></li><li><a href="https://docs.google.com/forms/d/1ELJg5RRSupFU8Jhd_QMRRcP6rSq8XDSLzDuA7Zu5e9w/viewform">Click here</a> to preregister</li><li><a href="https://www.facebook.com/groups/600278793422692/">Click here</a> for announcements and the full schedule on Facebook</li><li>This Dojo is run by Rochester Rocket Robotics, a community organization</li></ul>', 'rochrocketrobotics@gmail.com', 'https://www.facebook.com/groups/600278793422692/', 'CoderDojoRochIL', NULL, NULL, NULL, 0, NULL, NULL, 1, 'us/illinois/rochester/rochester-il-rochester-intermediate-school', 'NA', 'US', 'USA', 'Rochester Intermediate School, Rochester, IL', NULL, 840, 'United States of America', 'IL', 'Illinois', '', '', '', '', '', '', '4248284', 'Rochester', NULL);
