INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df906498-f3f9-11e4-910d-080027c336f0', 823, NULL, 'Kodaira', 'df768d48-f3f9-11e4-910d-080027c336f0', '2014-05-19 08:19:04+00', '2014-05-20 08:47:27+00', '3006', 1, 1, 2, 0, 'bi-weekly(almost 1st, 3th) Wednesday, 3.30pm-5pm', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{}', '{"toponymName":"Tōkyō"}', '{}', '{"name":"Suzukichō","geonameId":"8572763"}', '35.7246285,139.499321', '{"lat":35.7246285,"lon":139.499321}', '<h3>For attending:</h3><ul><li>You MUST register ahead.<br />(&nbsp;<a href="https://www.facebook.com/coderdojo.kodaira">Facebook Page</a>,&nbsp;<a href="http://www.zusaar.com/">Zussar</a>,&nbsp;<a href="http://www.doorkeeper.jp/">Doorkeeper</a>&nbsp;and more)</li><li>Age 7-18yrs<br />recommends: mathimatics level&nbsp;&gt; Elementary Grade 3rd</li><li><strong>A parent! (Very important). If you are 9 or under, your parent must stay with you during the session.</strong></li><li>Bring your own laptop. (Win/Mac/Linux)</li><li>Please bring a drink if you wish.</li><li>Just for beginners, we teach how to use <a href="http://scratch.mit.edu/">Scratch</a>.</li></ul><h3>Dojo Information:</h3><ul></ul><ul><li>All events are free.</li><li>Check our site for information about the location of our next Dojo. (Almost we use public facilities. Although we sometime use some personal houses.)</li><li>Looking for mentors and speakers. (in Japanese)</li><li>Go to&nbsp;<a href="http://coderdojo-kodaira.github.io/">our site</a>&nbsp;or&nbsp;<a href="https://www.facebook.com/coderdojo.kodaira">Facebook Page</a>&nbsp;for more information.</li></ul><p>詳細については<a href="http://coderdojo-kodaira.github.io/">公式サイト</a>および<a href="https://www.facebook.com/coderdojo.kodaira">Facebook Page</a>を御確認ください（日本語のみ）。</p>', 'coderdojokodaira@gmail.com', 'http://coderdojo-kodaira.github.io/', 'CoderDojoKodaJp', NULL, NULL, NULL, 0, NULL, NULL, 0, 'jp/tky/suzukich/kodaira', 'AS', 'JP', 'JPN', 'Kodaira, Tokyo', NULL, 392, 'Japan', '40', 'Tōkyō', '', '', '', '', '', '', '8572763', 'Suzukichō', NULL);
