INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f1dc8-f3f9-11e4-910d-080027c336f0', 215, NULL, 'Brickodeurs::Saint Gratien 95', 'df74a5ce-f3f9-11e4-910d-080027c336f0', '2012-11-07 12:58:58+00', '2013-12-01 14:25:28+00', '3006', 1, 1, 1, 0, 'Every Saturday, 10am-12am', '{"countryName":"France","geonameId":"3017382","alpha2":"FR"}', '{"toponymName":"Val d''Oise"}', '{"toponymName":"Île-de-France"}', '{"toponymName":"Arrondissement de Sarcelles"}', '{"name":"Saint-Gratien","geonameId":"2979627"}', '48.96137351829812,2.286513923942607', '{"lat":48.96137351829812,"lon":2.286513923942607}', '<p>Depuis 1980, l&#39;association Forum Education Science Culture (FESC) propose des activites de decouverte des sciences et techniques : Astronomie et electronique dans les annees 80, Micro-informatique dans les annees 90, montages photos et videos dans les annees 2000.</p><div>Depuis 2008, nous avons monte un club/atelier de Robotique ludique pour participer a la First Lego League.</div><div>Aujourd&#39;hui FESC se concentre sur 4 ateliers :</div><div><ul><li>Incubateur d&#39;initiatives numeriques et creatives</li><li>Atelier Photos numeriques pour tous (mais surtout des seniors),</li><li>Atelier Videos pour tous (mais surtout des seniors),</li><li>Atelier Robotique pour les juniors, mais nous nous sommes diversifies vers la programmation de jeux videos avec SCRATCH, KODU et RPG Maker.</li></ul></div><div>Chaque semaine nous organisons des seances : le mercredi et le vendredi soir pour la photo et la video, le jeudi pour l&#39;initiation informatique, le samedi matin pour la &quot;robotique&quot;.</div><div>Notre ligne directrice est l&#39;utilisation creative des technologies en explorant, combinant et transformant les usages numeriques.</div><div>&nbsp;</div><div>Nous sommes base <a target="_blank" href="https://www.google.com/maps/ms?msid=212249516430509179786.0004942458953d081ff5e&msa=0">a Saint Gratien a 400 metres de la gare RER C</a>.</div><div>&nbsp;</div><div>La contribution que nous pouvons apporter est de vous proposer des locaux (que nous avons la chance d&#39;avoir de facon permanente).</div><div>Nous pouvons proposer des ateliers de creation de jeux video avec SCRATCH/KODU/RPG Maker. Ces ateliers peuvent etre animes par un facilteur ou par nos jeunes membres qui ont entre 12/15 ans.</div><div>Un atelier LEGO Mindstorms : construire son robot Mindstorms et le programmer avec NXT-G ou Scratch/Enchanting,</div><div>Un atelier Montage video : monter des videos prise avec son telephone portable et les publier sur Youtube animes par des &quot;seniors&quot; qui serait heureux d&#39;accueillir un nouveau public.</div><div>&nbsp;</div><div>Visitez notre site web :<a href="http://fesc.asso.fr/">http://fesc.asso.fr/</a></div><div>&nbsp;</div><div>Consultez notre agenda :<a href="http://fesc.asso.fr/Agenda-du-club-de-robotique-de">http://fesc.asso.fr/Agenda-du-club-de-robotique-de</a></div><div>&nbsp;</div><div><a href="http://facebook.fr/fesc.St.gratien">http://facebook.fr/fesc.St.gratien</a></div><div>&nbsp;</div><p>&nbsp;</p><p>&nbsp;</p><h3>For English speakers :</h3><p>&nbsp;</p><p>&nbsp;</p><div><div>Since 1980, the Association Forum Education Science Culture (FESC) provides discovery activities Science and Technology: Astronomy and electronics in the 80s, Micro-computers in the 90s, photo montages and videos in the 2000s.</div><div>Since 2008, we have started a club / workshop Robotics fun to participate in the First Lego League.</div><div>Today FESC focuses on four workshops:</div><div><ul><li>Introduction to computers for seniors,</li><li>Workshop Digital Photos for all (but especially seniors),</li><li>Videos workshop for all (but especially seniors),</li><li>Robotics workshop for juniors, but we diversified into game programming with SCRATCH videos, and Kodu RPG Maker.</li></ul></div><div>Every week we organize sessions: Wednesday and Friday evenings for photo and video on Thursday for computer literacy on Saturday morning for &quot;robotics&quot;.</div><div>Our guideline is the creative use of technology, exploring, combining and transforming digital uses.</div><div>&nbsp;</div><div>We are based in Saint Gratien 400 meters from the RER C.</div><div>&nbsp;</div><div>The contribution we can make is to provide you with local (we are lucky to have permanently).</div><div>We can offer creative workshops with video games SCRATCH / Kodu / RPG Maker. These workshops can be facilitated by myself or by our young members who are between 12/15 years.</div><div>LEGO Mindstorms workshop: build a robot and program it with Mindstorms NXT-G or Scratch / Enchanting,</div><div>Video Editing workshop: mount videos taken with your mobile phone and post them on Youtube.</div><div>&nbsp;</div><div><div>Our website :<a href="http://fesc.asso.fr/">http://fesc.asso.fr/</a></div><div>&nbsp;</div><div>Our agenda :<a href="http://fesc.asso.fr/Agenda-du-club-de-robotique-de">http://fesc.asso.fr/Agenda-du-club-de-robotique-de</a></div><p><a href="http://facebook.fr/fesc.St.gratien">http://facebook.fr/fesc.St.gratien</a></p></div></div>', 'club.storm@fesc.asso.fr', 'http://fesc.asso.fr/', 'Coderdojo_stgra', 'http://fesc.asso.fr/Idees-pour-ameliorer-le-club-STORM', NULL, 'http://fesc.asso.fr/IMG/siteon0.png', 0, NULL, NULL, 0, 'fr/ile-de-france/saint-gratien/brickodeurssaint-gratien-95', 'EU', 'FR', 'FRA', 'FESC, place Georgette Agutte, 95210 Saint Gratien, FRANCE', NULL, 250, 'France, French Republic', 'A8', 'Île-de-France', '', '', '', '', '', '', '2979627', 'Saint-Gratien', NULL);
