ogo.png', 0, NULL, NULL, 0, 'ie/leinster/mountjoy/dublin-science-gallery', 'EU', 'IE', 'IRL', 'Science Gallery, Pearse Street, Dublin 2', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2962486', 'Mountjoy', NULL);
