INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ee3cd-f3f9-11e4-910d-080027c336f0', 119, NULL, 'West Cork', 'df745f5b-f3f9-11e4-910d-080027c336f0', '2012-04-23 15:21:50+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 0, 0, 'Visit individual Dojo pages.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Dojos in West Cork: <ul> <li>Bandon (Booking Required), Tuesdays (starting 26th June), 6-8pm, Town Hall, <a href="http://zen.coderdojo.com/dojo/144">click for details</a></li> <li>Rosscarbery, Mondays, 7-9pm, Celtic Ross Hotel, <a href="http://zen.coderdojo.com/dojo/123">click for details</a></li> <li>Clonakilty (Booking Required), Fridays, 6.30-8.30pm, Quality Hotel, <a href="http://zen.coderdojo.com/dojo/125">click for details</a></li> <li>Kinsale, Fridays, 7-9pm, Kinsale Community School, <a href="http://zen.coderdojo.com/dojo/54">click for details</a></li> </ul> <p>Please check with the individual Dojos to confirm schedule. Some may be taking a break over the summer holidays.</p> <p>We''ve had enquiries about Dojos in Bantry and Beara, but haven''t heard of any plans to get started yet.</p> <p><b>All of the dojos need more mentors!</b> <a href="http://coderdojo.com/help-us/mentor-or-teach/">Click here to see more about being a mentor.</a> Contact your nearest Dojo and get involved.</p> If you are in West Cork and are interested in starting up a Dojo in your area: <ul> <li><a href="http://coderdojo.com/help-us/i-want-to-start-a-coderdojo-right-now/">Click here to read about setting up a Dojo</a></li> <li> <a href="mailto:westcork@coderdojo.com">click here to email for advice and support from other Dojos in West Cork</a></li> </ul>', 'westcork@coderdojo.com', NULL, 'CoderDojoWCork', 'https://groups.google.com/d/forum/coder-dojo-west-cork', NULL, NULL, 1, '12', '2014-03-13 11:31:27+00', 0, 'ie/west-cork', 'EU', 'IE', 'IRL', 'Visit individual Dojo pages.', NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9133a6-f3f9-11e4-910d-080027c336f0', 1172, NULL, 'São Paulo', 'df769a3d-f3f9-11e4-910d-080027c336f0', '2014-12-28 04:12:04+00', '2014-12-30 16:52:41+00', '3199', 1, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<div><p>Venha aprender Scratch, HTML, Python, Javascript ou qualquer outra coisa que voc&ecirc; gosta. Se voc&ecirc; tem 17 anos ou menos e gostaria de alguma ajuda para aprender a desenvolver, inscreva-se e junte-se a n&oacute;s. O evento &eacute; gratuito para todos os participantes.</p><p>Temos algumas atividades j&aacute; planejadas, mas se voc&ecirc; tem algum projeto que voc&ecirc; est&aacute; trabalhando e gostaria de alguma ajuda, estamos aqui para ajud&aacute;-lo.</p><p>N&atilde;o se preocupe se voc&ecirc; nunca programou antes, junte-se a n&oacute;s e venha se divertir um pouco.<br /><strong>Crie uma anima&ccedil;&atilde;o ou construa um jogo com Scratch.</strong></p><p>Se voc&ecirc; j&aacute; programa, ent&atilde;o venha melhorar suas habilidades.&nbsp;<strong>&nbsp;<br />Construa coisas legais como jogos, sites, anima&ccedil;&otilde;es e apps.</strong>&nbsp;Conhe&ccedil;a pessoas como voc&ecirc; que est&atilde;o interessadas nos mesmos tipos de coisas.</p><p>Esperamos mais para frente termos Arduino e outras coisas legais para mexer.</p><p><strong>Voc&ecirc; vai precisar trazer um laptop.</strong>&nbsp;Se voc&ecirc; n&atilde;o tiver um ou n&atilde;o conseguir um emprestado, favor enviar um e-mail para saopaulo.bra@coderdojo.com pois temos alguns que poderemos emprestar.</p><p><strong>Se voc&ecirc; tem 12 anos ou menos voc&ecirc; vai precisar trazer um adulto respons&aacute;vel!</strong></p><p>O evento &eacute; totalmente gratuito, mas as vagas s&atilde;o limitadas. N&oacute;s pedimos que voc&ecirc; se registre aqui com pelo menos 24 horas de anteced&ecirc;ncia para que possamos planejar o encontro de forma adequada.</p><p><strong>O que voc&ecirc; precisa trazer:</strong><br />Um laptop. Pe&ccedil;a um emprestado, se for preciso.<br />Um adulto respons&aacute;vel! (Muito importante). Se voc&ecirc; tem 12 anos ou menos, um respons&aacute;vel deve ficar com voc&ecirc; durante toda a sess&atilde;o.<br />Um lanche saud&aacute;vel &eacute; recomend&aacute;vel, mas n&atilde;o &eacute; necess&aacute;rio.<br />Se voc&ecirc; j&aacute; tem um projeto que voc&ecirc; est&aacute; trabalhando, traga-o com voc&ecirc;.</p><p>Estamos sempre &agrave; procura de mentores por isso se voc&ecirc; gosta de compartilhar suas habilidades, por favor entre em contato conosco pelo email saopaulo.bra@coderdojo.com</p><p><strong>Para maiores informa&ccedil;&otilde;es, visite o site&nbsp;<a target="_blank" href="http://coderdojosp.com/">coderdojosp.com</a>.</strong></p></div><div>--------------------------------------------------------------------</div><div>&nbsp;</div><div>Come along to learn Scratch, HTML, Python, Javascript or just anything you need. If you&#39;re 17 or under and would like some help with learning to code please register to come along. It&#39;s free for all participants.</div><div><p>We will have some tasks for you to complete although if you have a project you have been working on and would like some help we are here for you.</p><div>Don&rsquo;t worry if you&rsquo;ve never programmed before, come along and have some fun.</div><p><strong>Create an animation or build a game with Scratch.<br />&nbsp;</strong><br />If you already can code then improve your skills.<br /><strong>Build cool stuff, from games to websites to animations to apps</strong>. Meet people like you who are interested in the same sort of things.</p><p>We hope to have a few Arduino&#39;s and other cool stuff to try.</p></div><div><strong>You will need to bring a laptop</strong>,&nbsp;If you don&#39;t have a laptop or can&#39;t borrow one please email saopaulo.bra@coderdojo.com as we do have a few.</div><div>&nbsp;</div><div><strong>If you are 12 or under you will need to bring an adult!</strong></div><div>&nbsp;</div><div>The event is completely free but numbers are limited and we do ask that you register here&nbsp;and get a ticket at least 24 hours before each meetup so that we can plan for the correct numbers.</div><div>&nbsp;</div><div><strong>What you need to bring:</strong></div><p>A laptop. Borrow one from someone if needs be.<br />A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.<br />A healthy snack is recommended but not required.<br />If you have a project you&#39;ve been working on bring it with you.</p><div>We are always looking for mentors so if you fancy sharing your skills please email&nbsp;saopaulo.bra@coderdojo.com</div><div><br /><strong>Please visit <a target="_blank" href="http://coderdojosp.com">coderdojosp.com</a> for more information.</strong></div><div>&nbsp;</div>', 'saopaulo.bra@coderdojo.com', 'http://coderdojosp.com', 'CoderDojoSP', 'https://groups.google.com/d/forum/coderdojosp', '15086123000', NULL, 0, NULL, NULL, 0, 'br/sao-paulo', 'SA', 'BR', 'BRA', NULL, NULL, 76, 'Brazil, Federative Republic of', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
