INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8eeeb4-f3f9-11e4-910d-080027c336f0', 155, NULL, 'Greystones', 'df748031-f3f9-11e4-910d-080027c336f0', '2012-06-18 11:53:46+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 2, 0, 'Saturday Afternoons from 2pm, 4pm and mid-week in local schools 7pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Ballynerrin","geonameId":"3315085"}', '53.13237073269521,-6.07021198045652', '{"lat":53.13237073269521,"lon":-6.07021198045652}', '<p>We are running since November 2012 and offer a variety of classes (Scratch, HTML, 3D modelling, Python, etc) for kids aged 7-17 across a number of venues.</p><div>&nbsp;</div><div>Currently we have almost 20 technical mentors but always looking for more! The more technical mentors we have the more kids we can take in a session.</div><div>&nbsp;</div><div>If you want to register interest - for your children to attend, or to volunteer - <strong>then sign up to our mailing list at http://coderdojogreystones.com</strong></div><div>&nbsp;</div><p>- For any other query send us an email at coderdojogreystones@gmail.com or</p><p>- Visit our Facebook page http://www.facebook.com/CoderDojoGreystones</p><p>- Visit our Website http://coderdojogreystones.com</p><p>&nbsp;</p><div><strong>We will be posting updates regularly on Facebook / Website and send occasional emails to our mailing list</strong></div>', 'coderdojogreystones@gmail.com', 'http://coderdojogreystones.com', 'CoderDojoGStone', 'https://groups.google.com/forum/?hl=en&fromgroups;#!forum/coderdojogreystones', NULL, 'https://media.licdn.com/media/p/7/000/2a2/3c7/375ea75.png', 0, NULL, NULL, 0, 'ie/leinster/ballynerrin/greystones', 'EU', 'IE', 'IRL', 'Greystones Lawn Tennis Club,  Mill Rd., Greystones', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '3315085', 'Ballynerrin', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f7116-f3f9-11e4-910d-080027c336f0', 427, NULL, 'Mount Washington Valley NH Dojo', 'df7542ac-f3f9-11e4-910d-080027c336f0', '2013-08-25 17:26:14+00', NULL, NULL, 0, 0, 0, 0, 'TBA', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>We are doing a brief feasibility and sanity check here, but you should expect to hear more about our group in the near future. With a handful of quality local businesses, we believe we can offer a tremendous program for the youth of the MWV area.</p><p>If you are interested, please email Dave at mwvCoderDojo@gmail.com, or even better, join our Google group by clicking the link down and to the right a little bit... yup... right down there!</p><ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'mwvCoderDojo@gmail.com', NULL, 'MWVCoderDojo', 'http://MWVCoderDojo', NULL, NULL, 0, NULL, NULL, 0, 'us/mount-washington-valley-nh-dojo', 'NA', 'US', 'USA', 'TBA', NULL, 840, 'United States of America', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
