ttp://coderdojodarearca.com', 'CoderdojoDarEar', 'https://groups.google.com/forum/#!forum/coderdojo-darearca', NULL, 'http://s10.postimg.org/87ohcvmdl/sponsorlogo.png', 0, NULL, NULL, 0, 'ie/munster/chapeltown/dar-earca-valentia-island', 'EU', 'IE', 'IRL', 'Valentia Island Resource and Childcare Centre, Chapeltown, Valentia Island', NULL, 372, 'Ireland', 'M', 'Munster', '', '', '', '', '', '', '3297707', 'Chapeltown', NULL);
