INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f734d-f3f9-11e4-910d-080027c336f0', 437, NULL, 'Cleveland - HER Ideas in Motion', 'df754fd4-f3f9-11e4-910d-080027c336f0', '2013-09-11 23:54:45+00', '2013-12-01 14:25:26+00', '3006', 1, 1, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>We&#39;re current planning &amp; looking for space.</p><ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'contact@herideasinmotion.com', NULL, 'herideas', NULL, '6460037145', 'http://www.herideasinmotion.com/sites/all/themes/tophit/logo.png', 0, NULL, NULL, 0, 'us/cleveland-her-ideas-in-motion', 'NA', 'US', 'USA', 'Cleveland, OH', NULL, 840, 'United States of America', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fded9-f3f9-11e4-910d-080027c336f0', 648, NULL, 'McDonough, GA', 'df75cca8-f3f9-11e4-910d-080027c336f0', '2014-01-30 23:11:08+00', '2014-02-18 15:11:39+00', '3006', 1, 1, 2, 0, 'Second Sunday of the month, 1:30pm - 4pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Henry County"}', '{"toponymName":"Georgia"}', '{}', '{"name":"McDonough","geonameId":"4208442"}', '33.4427939,-84.12730340000002', '{"lat":33.4427939,"lon":-84.12730340000002}', '<p>If you are a parent interested in having your child participate in CoderDojo Henry County, please join our <strong><a href="http://www.meetup.com/CoderDojoMcDonough/">Meetup</a></strong> or follow us on <strong><a href="https://twitter.com/CoderDojoHenry">Twitter</a></strong> or <strong><a href="http://facebook.com/CoderDojoMcDonough">Facebook</a></strong> to be informed when tickets are released for coding sessions.<br />&nbsp;</p><p>CoderDojo McDonough is seeking developers of all skill levels who are interested in sharing their knowledge with local youth. &nbsp; The time commitment required is very low since the monthly sessions only last a couple hours and no preparation is necessary on your part because we will be using resources like codecademy.com. &nbsp;If you are interested in mentoring at CoderDojo McDonough please join our Meetup at <a href="http://www.meetup.com/CoderDojoMcDonough"><strong>http://www.meetup.com/CoderDojoMcDonough</strong></a>.</p>', 'william@coderdojohenry.com', 'http://coderdojohenry.com', 'CoderDojoHenry', NULL, NULL, NULL, 0, NULL, NULL, 0, 'us/georgia/mcdonough/mcdonough-ga', 'NA', 'US', 'USA', 'McDonough Public Library, 1001 Florence Mcgarity Blvd, McDonough, GA 30253', NULL, 840, 'United States of America', 'GA', 'Georgia', '', '', '', '', '', '', '4208442', 'McDonough', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ef2e1-f3f9-11e4-910d-080027c336f0', 167, NULL, 'Birr, Co. Offaly', 'df7486d7-f3f9-11e4-910d-080027c336f0', '2012-07-12 08:22:49+00', '2013-12-01 14:25:28+00', '3006', 1, 1, 2, 0, 'Every Wednesdays 6pm-8.30pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Birr","geonameId":"2966154"}', '53.092696837366695,-7.911314964294434', '{"lat":53.092696837366695,"lon":-7.911314964294434}', '<p><br /><strong>How to join Coderdojo Birr:</strong></p><p>&nbsp;</p><p>&nbsp;</p><ul><li><strong>1.</strong> If it&#39;s your first time to coming along, please complete the registration form for Coderdojo Birr available <strong><a href="https://docs.google.com/spreadsheet/viewform?fromEmail=true&formkey=dHVNTHF4VmhDQUczZFRKZ1B5UVc5WlE6MA">here</a></strong>. Completing this form does not guarantee your child a place nor does it reserve a place. It&#39;s purpose is to provide essential information and parental contact details to the Birr Dojo organisers.<br /><br /><strong>2.</strong> If you&#39;re planning to join our next session, please note that details of tickets are circulated to all members of our <strong><a target="_blank" href="https://groups.google.com/d/forum/birr-coder-dojo">Google Group.</a></strong> Details of available tickets are issued on Friday lunchtimes. Tickets must be booked through our <a target="_blank" href="http://coderdojobirr.eventbrite.ie">EventBrite</a> Ticketing System. This is the only mentod to secure a place for your child. Please note, that this is a lottery based on first come, first served. Mentors recieve priority booking for their children.</li></ul><p>&nbsp;<p><br /><strong>What you need to bring:</strong></p></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>An evening snack, if desired.</li><li>A FULLY CHARGED laptop. Borrow one from someone if needs be. We have a very limited number of machines to loan each evening. Please email birrcoderdojo@gmail.com for information. Loan laptops are issued on a first come first served basis.</li><li>A parent! (Very important). If you are 13 or under, your parent <strong>must</strong> stay with you during the session. Mums &amp; Dad&#39;s loads of tea &amp; coffee while you get to know each other!</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'BirrCoderDojo@gmail.com', NULL, 'CoderDojoBirr', 'https://groups.google.com/d/forum/birr-coder-dojo', '2421988', NULL, 0, NULL, NULL, 0, 'ie/leinster/birr/birr-co-offaly', 'EU', 'IE', 'IRL', 'Birr Technology Centre, Mill Island, Birr, Co. Offaly', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2966154', 'Birr', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fd634-f3f9-11e4-910d-080027c336f0', 624, NULL, 'Damansara Perdana, @xcodemonks', 'df75bc04-f3f9-11e4-910d-080027c336f0', '2014-01-21 03:10:11+00', '2014-01-22 12:34:27+00', '3006', 1, 1, 1, 0, 'Every second Saturday of the month, 3pm to 5pm', '{"countryName":"Malaysia","geonameId":"1733045","alpha2":"MY"}', '{}', '{}', '{}', '{"name":"Kampong Bukit Lanjan","geonameId":"1770201"}', '3.1660281419703815, 101.6073614358902', '{"lat":3.1660281419703815,"lon":101.6073614358902}', '<p>You will need the following:</p><ul><li>A Mac laptop running OS X 10.9.5 and Xcode 6.0. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li><strong>Important!</strong> Session on 4th October 2014 is cancelled. Next session will be on of 8 November 2014.</li></ul>', 'xcodemonks@icloud.com', 'http://xcodemonks.tumblr.com', 'xcodemonks', NULL, NULL, NULL, 0, NULL, NULL, 0, 'my/kampong-bukit-lanjan/damansara-perdana-xcodemonks', 'AS', 'MY', 'MYS', 'Mohammad Chow Restaurant, 3-1, Jalan PJU 8/5H, Damansara Perdana Business Center, 47820 PJ, Selangor', NULL, 458, 'Malaysia', '00', '', '', '', '', '', '', '', '1770201', 'Kampong Bukit Lanjan', NULL);
