INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f51b1-f3f9-11e4-910d-080027c336f0', 332, NULL, 'Deansrath Clondalkin Coder Dojo', 'df750e3a-f3f9-11e4-910d-080027c336f0', '2013-04-17 09:19:10+00', '2013-12-01 14:25:27+00', '3006', 1, 0, 2, 0, 'Thursdays 4pm-5pm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Computers will be provided. Children must respect each other, the volunteers and the equipment at all times. Contact Deansrath Family Centre Tel: 01 4574069/ e-mail: info@deansrathfamily.ie for further information.', 'coderdojodfc@deansrathfamily.ie', NULL, 'DeansrathCoderd', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/deansrath-clondalkin-coder-dojo', 'EU', 'IE', 'IRL', 'Bawnogue Enterprise Centre, Clondalkin, Dublin 22', NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fde9a-f3f9-11e4-910d-080027c336f0', 647, NULL, 'Edinburgh @Prewired', '0', '2014-01-30 19:41:57+00', '2014-02-05 13:27:51+00', '3006', 1, 0, 2, 0, 'First and third Wednesday of every month, 5.30-7.30pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Edinburgh"}', '{"toponymName":"Scotland"}', '{}', '{"name":"Old Town","geonameId":"7644905"}', '55.944373,-3.1868930000000546', '{"lat":55.944373,"lon":-3.1868930000000546}', '<p>Most Prewired sessions are unstructured, and give you a chance to work on your own projects or learn something new with the help of our mentors. Sometimes we have a special talk or workshop so you can learn a lot about something you might not have thought about before (please check the website to see what''s coming up).</p> <p><strong>Registering</strong></p> <p>Everyone under 19 is welcome, even if you''ve never coded before. Only enthusiasm is necessary!</p> <p>Make sure you register on the eventbrite! So we know how many people are coming, and so we can get important details like your parents'' phone numbers.</p> <p><strong>Resources</strong></p> <p>Bring a laptop if you can (we have a few spares, but not many) and any cool technology you want to hack with. And if you have bugs that need fixing, bring those, we have people who can help :)</p> <p>Light refreshments provided.</p> <p><strong>Parents</strong></p> <p>Parents welcome but not necessary.</p> <p><strong>Mentors</strong></p> <p>If you''d like to come along as a mentor, please request to join prewired-helpers@googlegroups.com with some information about yourself and skills, and we''ll be in touch.</p>', 'hello@prewired.org', 'http://prewired.org', 'prewired', 'https://groups.google.com/forum/#!forum/prewired-discuss', '10049009859', NULL, 0, NULL, NULL, 0, 'gb/scotland/old-town/edinburgh-prewired', 'EU', 'GB', 'GBR', 'Level 4 Appleton Tower, 11 Crichton Street, Edinburgh', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'SCT', 'Scotland', '', '', '', '', '', '', '7644905', 'Old Town', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90e375-f3f9-11e4-910d-080027c336f0', 1056, NULL, 'Hamburg @ seoseo', 'df76ecc3-f3f9-11e4-910d-080027c336f0', '2014-11-07 13:17:11+00', '2014-11-10 15:37:53+00', '4124', 1, 0, 1, 0, 'Samstags, 10-14Uhr, (monatlich)', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Hamburg"}', '{}', '{"name":"Hamburg-Nord","geonameId":"8354626"}', '53.59452,9.98070000000007', '{"lat":53.59452,"lon":9.98070000000007}', '<p>Das Dojo findent bei der seoseo GmbH statt. Ihr findet das B&uuml;ro im Hinterhof.</p><p>Bitte meldet euch verbindlich unten &uuml;ber Eventbrite zum n&auml;chsten Treffen im Januar an.</p><p>Ihr m&uuml;sst nichts mitbringen. Wir haben einige Computer hier die wir nutzen k&ouml;nnen. Bitte bringt aber ein Ipad und/oder Laptop mit, wenn ihr habt.</p><p>Bei Kindern unter 12 Jahren muss ein Verantwortlicher mitkommen. Entweder ist ein Elternteil die ganze Zeit da oder die Eltern von jemand anderem &uuml;bernehmen die Aufsicht.</p>', 'coderdojo.hamburg@gmail.com', NULL, NULL, 'https://plus.google.com/communities/104896960443665360572?hl=DE', '14729031931', NULL, 0, NULL, NULL, 0, 'de/hamburg/hamburg-nord/hamburg-seoseo', 'EU', 'DE', 'DEU', 'seoseo GmbH, Geschwister-Scholl-Straße 86, 20251 Hamburg', NULL, 276, 'Germany, Federal Republic of', '04', 'Hamburg', '', '', '', '', '', '', '8354626', 'Hamburg-Nord', NULL);
