INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df91134e-f3f9-11e4-910d-080027c336f0', 1111, NULL, 'Dublin 18 @ Rosemont School (CoderDojoRosemont)', 'df76fde8-f3f9-11e4-910d-080027c336f0', '2014-12-05 14:56:08+00', '2014-12-05 17:06:39+00', '4124', 1, 0, 3, 0, 'Saturdays 11am - 1pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Stepaside","geonameId":"2961364"}', '53.26094896457079,-6.226759941162072', '{"lat":53.26094896457079,"lon":-6.226759941162072}', '<p>At Dojos, young people learn a super power.&nbsp; They learn how to code, develop websites, apps, programs, games and more.</p><p><strong>At our first Dojo we are working with SCRATCH v1.4</strong></p><p>&nbsp;</p><p><strong>Registering: (sorry our current sessions are full)</strong></p><p>We need to issue tickets as currently we can only accommodate 20 young people. &nbsp;So please ensure each person who wants to participate is registered through the booking system at Eventbrite (see our Facebook page or the Eventbrite link below)</p><p>&nbsp;</p><p><strong>What to bring:</strong></p><p>Sessions run from 11am - 1pm, so young people should bring:</p><ul><li>A laptop for each participant with SCRATCH v1.4 running on it.</li><li>A small snack - we take a short break in the middle of the 2 hour session.</li></ul><p>For those 12 or under, you also need to bring:</p><ul><li>A parent or guardian! (Very important) who <em>must stay</em> with you during the session.</li></ul><p>&nbsp;</p><p><strong>CoderDojoRosemont is open to:</strong></p><p>We are open to the public, for young people between the ages of 10 and 17.</p><p>&nbsp;</p>', 'coderdojorosemont@gmail.com', 'http://CoderDojoRosemont.com', 'CoderD_Rosemont', NULL, '14802854737', NULL, 0, NULL, NULL, 0, 'ie/leinster/stepaside/dublin-18-rosemont-school-coderdojorosemont', 'EU', 'IE', 'IRL', 'Rosemont School, Enniskerry Road, Sandyford, D18', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2961364', 'Stepaside', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ef470-f3f9-11e4-910d-080027c336f0', 174, NULL, 'Alencon', 'df748826-f3f9-11e4-910d-080027c336f0', '2012-07-20 19:57:23+00', NULL, NULL, 2, 1, 2, 0, 'Times and days can vary', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Bring a laptop if possible. We have a limited number of desktops<em><br></em></li><li>If you do not have a laptop, bring a USB stick to take home examples and programs.<em><br></em></li></ul>', 'connorsml@gmail.com', NULL, NULL, 'https://groups.google.com/d/forum/coder-dojo-alencon', NULL, NULL, 1, NULL, NULL, 0, 'fr/alencon', 'EU', 'FR', 'FRA', '6 Place Auguste Poulet Malassis, 61000 Alenon, France At Bij Orne, http://www.facebook.com/BIJ.Orne', NULL, 250, 'France, French Republic', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f85a7-f3f9-11e4-910d-080027c336f0', 493, NULL, 'Cambridge, MA', 'df75646e-f3f9-11e4-910d-080027c336f0', '2013-10-15 23:06:15+00', '2013-12-01 14:25:25+00', '3006', 1, 1, 4, 0, 'May 10, 2014, 12PM - 3PM ET', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Middlesex County"}', '{"toponymName":"Massachusetts"}', '{}', '{"name":"East Cambridge","geonameId":"4935352"}', '42.36594600000001,-71.08257300000002', '{"lat":42.36594600000001,"lon":-71.08257300000002}', '<p><strong>​Attention Teens</strong></p><div><strong>And Parents:</strong><br /><br />*LEARN TO CODE *<br /><br /><strong>SATURDAY, MAY 10th, 2014</strong><br /><br /><strong>hack/reduce is...&nbsp;</strong><br />Boston&#39;s big data hacker space. The hack/reduce mission is to help Boston&nbsp;create the talent and the technologies that will shape our future in a big&nbsp;data- driven economy.</div><div>&nbsp;</div><p>Oracle is..&nbsp;</p><p>Oracle Academy provides a complete portfolio of software, curriculum,&nbsp;hosted technology, faculty training, support, and certification resources&nbsp;to secondary and higher education institutions for teaching use. Faculty&nbsp;can insert these resources into computer science and business programs,&nbsp;ensuring that students gain industry-relevant skills prior to entering the&nbsp;workforce. Oracle Academy supports over 2.5 million students in 102&nbsp;countries. To learn more, visit&nbsp;<a target="_blank" href="http://oracle.com/academy">http://oracle.com/academy</a></p><div><br />&nbsp;</div><div><strong>What:</strong> Introduction to Coding with Alice<br />&nbsp;</div><p><strong>Who:</strong> This Oracle Academy is recommended for ages12-18. Please register to attend&nbsp;<a target="_blank" href="http://learntocodeforteens.eventbrite.com/">learntocodeforteens.eventbrite.com</a></p><div>&nbsp;</div><p><strong>When: </strong>Saturday, May 10th, 2014,12:00pm - 3:00pm</p><div>&nbsp;</div><p><strong>Where:</strong> hack/reduce (at the historic Boiler and Tank&nbsp;Building in Kendall Square)</p><div>275 3rd St., Cambridge, MA, 02142<br />&nbsp;</div><p><strong>Other:</strong>&nbsp;</p><ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'info@hackreduce.org', 'http://www.hackreduce.org/', 'hackreduce', NULL, '11315961345', NULL, 0, NULL, NULL, 0, 'us/massachusetts/east-cambridge/cambridge-ma', 'NA', 'US', 'USA', '275 3rd St., Cambridge, MA', NULL, 840, 'United States of America', 'MA', 'Massachusetts', '', '', '', '', '', '', '4935352', 'East Cambridge', NULL);
