INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fd93b-f3f9-11e4-910d-080027c336f0', 637, NULL, 'Linköping', 'df75c05c-f3f9-11e4-910d-080027c336f0', '2014-01-24 20:14:00+00', '2014-01-28 17:28:32+00', '3006', 1, 0, 2, 0, 'Odd week wednesdays, 6pm - 8pm', '{"countryName":"Sweden","geonameId":"2661886","alpha2":"SE"}', '{"toponymName":"Linköpings Kommun"}', '{"toponymName":"Östergötland"}', '{"toponymName":"Slaka"}', '{"name":"Valla","geonameId":"2665577"}', '58.39422308981142,15.56263777448271', '{"lat":58.39422308981142,"lon":15.56263777448271}', '<h4>Vilka f&aring;r vara med?</h4><p>Barn och ungdomar 7-17 &aring;r. Barn under 12 b&ouml;r ha s&auml;llskap av en vuxen.</p><p>&nbsp;</p><h4>Vilka h&aring;ller i tr&auml;ffarna?</h4><p>Det g&ouml;r intresserade mentorer med kunskap om programmering.</p><h4>&Auml;r det en kurs?</h4><p>Nej, det &auml;r inte en vanlig kurs d&auml;r du m&aring;ste delta varje g&aring;ng. Anm&auml;l dig s&aring; att vi vet hur mycket fika som kommer att g&aring; &aring;t.</p><h4>Vad h&auml;nder under de tv&aring; timmarna?</h4><p>Mentorerna ger n&aring;gra f&ouml;rslag p&aring; hur du kan komma ig&aring;ng med programmering. V&auml;lj n&aring;got du tycker &auml;r kul, s&auml;tt dig vid en dator och f&ouml;rs&ouml;k l&ouml;sa uppgiften. Man beh&ouml;ver inte utg&aring; fr&aring;n f&ouml;rslagen utan det g&aring;r utm&auml;rkt att g&ouml;ra n&aring;got utifr&aring;n egna id&eacute;er. Du beh&ouml;ver ta med dig en egen b&auml;rbar dator. Beh&ouml;ver du hj&auml;lp s&aring; finns mentorerna d&auml;r f&ouml;r din skull.</p><p><em>Coderdojo kommer att h&aring;llas udda veckor, p&aring; onsdagar mellan kl 18.00-20.00. N&aring;gra veckor kommer vi dock bli tvungna att byta till dag. Vi informerar d&aring; extra via social medier. Vi h&aring;ller till p&aring; creActive i Mj&auml;rdevi. Teknikringen 7. ( <a href="http://www.creactive-mjardevi.se">http://www.creactive-mjardevi.se/</a> )&nbsp;</em></p>', 'linkoping.se@coderdojo.com', NULL, 'CoderDojoLkpg', 'https://groups.google.com/forum/#!forum/coderdojo-lkpg', '10339502731', NULL, 0, NULL, NULL, 0, 'se/ostergotland/valla/linkoping', 'EU', 'SE', 'SWE', 'Teknikringen 7, 58330 Linköping', NULL, 752, 'Sweden, Kingdom of', '16', 'Östergötland', '', '', '', '', '', '', '2665577', 'Valla', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fe890-f3f9-11e4-910d-080027c336f0', 681, NULL, 'Dublin 1 @ NCI-ELI', 'df75c9d2-f3f9-11e4-910d-080027c336f0', '2014-02-13 10:37:37+00', '2014-02-13 13:13:08+00', '3006', 1, 0, 3, 0, 'Every Tuesday, 5-6.30pm (see dates below)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Mountjoy","geonameId":"2962486"}', '53.3486339,-6.2431828', '{"lat":53.3486339,"lon":-6.2431828}', '<p>This 6 week programme at the college is for students between 4th class and 1st year (10-14 years old)*. Parents are welcome to accompany and participate or observe. This programme is free of charge. Starts Tuesday 25th February 2014 and finishes Tuesday 1st April 2014. Please take note that parents/guardians are required to drop off children at the college at 5pm and arrange for them to be collected at 6.30pm.</p><p>Students are not required to bring a laptop as they will be supplied with log-in details to access computers in the college.</p><p>Registration is required, please contact via email address provided.</p><p><em>*The NCI dojo is targeted at families and schools in the four parishes surrounding the National College of Ireland - St Laurence O&#39;Toole&#39;s (Sheriff Street Parish), St Joseph&#39;s (East Wall Parish), St Mary&#39;s (City Quay Parish) and St Patrick&#39;s (Ringsend Parish).</em></p><p><strong><em>Our next Coder Dojo will take place in November 2014 (dates TBC). If you wish to reserve a place on our next dojo, please contact via email address provided. We will take note of your details and send a reminder to you in advance of the next NCI Coder Dojo.</em></strong></p>', 'coderdojonci@gmail.com', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/leinster/mountjoy/dublin-1-nci-eli', 'EU', 'IE', 'IRL', 'National College of Ireland, Mayor Street, IFSC, Dublin 1', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2962486', 'Mountjoy', NULL);
