INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f8ddd-f3f9-11e4-910d-080027c336f0', 525, NULL, 'Castleblayney', 'df756bd7-f3f9-11e4-910d-080027c336f0', '2013-11-03 14:53:00+00', NULL, NULL, 0, 1, 0, 0, 'Every saturday 10-1', NULL, NULL, NULL, NULL, NULL, '42.5,-36.19999999999999', '{"lat":42.5,"lon":-36.19999999999999}', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'smallkniferonan@hotmail.com', NULL, NULL, NULL, NULL, NULL, 1, '3006', '2014-02-07 14:18:17+00', 0, 'ie/castleblayney', 'EU', 'IE', 'IRL', 'None comfirmed', NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ef187-f3f9-11e4-910d-080027c336f0', 163, NULL, 'Euskal Herriko Dojo', 'df74860c-f3f9-11e4-910d-080027c336f0', '2012-07-04 09:54:54+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 4, 0, 'Seguruenik larunbatetan (10:00etatik 13:00ak arte)', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Biscay"}', '{"toponymName":"Basque Country"}', '{"toponymName":"Gorliz"}', '{"name":"Elexalde","geonameId":"3121286"}', '43.412569,-2.929135', '{"lat":43.412569,"lon":-2.929135}', '<p><strong>Ekarri behar duzuna:</strong></p><ul><li>Bokata (oso garrantzitsua).</li><li>Ordenagailu eramangarria (baldin eta badaukazu).</li><li>Guraso bat (12 urte baino gutxiagoko bazara).</li></ul><p><strong>Zeintzuk parte hartu ahal dute:</strong></p><ul><li>Edonork partu ahal du.</li><li>Gazteak 12 urte ez baditu heldu baten laguntza eskatzen dugu alde batetik materiala zaintzeko eta zergatik ez! seme-alabarekin batera <em>programazioa</em> ikasteko.</li><li>Oso gazte diren umeek ez dute ehuneko ehunean etekinik aterako, baina askotan ikusi ditugu 8 urteko umeak programazio-arraizoiketa garatzen ordenagailuekin jolasten duten bitartean.</li></ul><p><strong>Doan!</strong></p><ul><li>Lekua eta zerbitzuak doan dira. Baita ere aholkulariek beraien denbora musu-truk eskaintzen dute, beraz umeentzako aukera hau dohainik da!</li></ul><p><strong>Momentuz gaiak hauxek dira:</strong></p><ul><li>HTML/CSS/Javascript (web frontend).</li><li>Gai gehiago aholkularien arabera.</li></ul>', 'otsarri@gmail.com', NULL, 'otsarri', NULL, NULL, NULL, 0, NULL, NULL, 0, 'es/basque-country/elexalde/euskal-herriko-dojo', 'EU', 'ES', 'ESP', 'Uribe Kostan. Oraingoz leku egoki baten bila......', NULL, 724, 'Spain, Kingdom of', '59', 'Basque Country', '', '', '', '', '', '', '3121286', 'Elexalde', NULL);
