INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f1680-f3f9-11e4-910d-080027c336f0', 187, NULL, 'Lund', 'df748b1f-f3f9-11e4-910d-080027c336f0', '2012-08-27 08:23:34+00', '2013-12-01 14:25:28+00', '3006', 1, 1, 1, 0, '4.30pm--6.45pm alternating Mondays and Tuesday', '{"countryName":"Sweden","geonameId":"2661886","alpha2":"SE"}', '{"toponymName":"Lund Municipality"}', '{"toponymName":"Skåne"}', '{"toponymName":"Lunds domkyrkoförs."}', '{"name":"Lund","geonameId":"2693678"}', '55.71190104378349,13.214497288360576', '{"lat":55.71190104378349,"lon":13.214497288360576}', '<p>Our partners are Ideon Agora, Tunaskolan and Sony Mobile Communications, Lund. Scratch and ScriptCraft (Minecraft) are recurring themes, though we are always seeking new challenges. More mentors wanted! Food sponsor: ICA Kvantum Malmborgs Tuna.</p>', 'robert.storlind@gmail.com', 'http://lund.coderdojo.se', NULL, 'https://groups.google.com/group/coderdojo-lund', '10004871841', NULL, 0, NULL, NULL, 0, 'se/skane/lund/lund', 'EU', 'SE', 'SWE', 'Ideon Agora, Scheelevägen 15, Lund, Sweden', NULL, 752, 'Sweden, Kingdom of', '27', 'Skåne', '', '', '', '', '', '', '2693678', 'Lund', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90bb56-f3f9-11e4-910d-080027c336f0', 944, NULL, 'Donabate, Dublin', 'df76a1c8-f3f9-11e4-910d-080027c336f0', '2014-09-11 12:32:02+00', '2014-09-15 15:46:11+00', '4124', 1, 0, 2, 0, 'Every second Saturday 2pm-4pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Ballisk","geonameId":"2966693"}', '53.489662517243346,-6.142697499475162', '{"lat":53.489662517243346,"lon":-6.142697499475162}', '<ul><li>A snack and a drink, preferrably water and not fizzy sugarry drinks.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>This location is temporary and a more permanent location is under negotiations currently.</li><li>Events will take place every second Saturday. Each event subsequent to this first one&nbsp;will be listed on <a href="http://www.eventbrite.com">www.eventbrite.com</a> the Tuesday beforehand. This will be notified via our Twitter feed so get following.</li><li>A basic group will cover Scratch projects while advanced will work on Python.</li></ul>', 'team@donabatedojo.com', 'http://www.donabatedojo.com', 'donabatedojo', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/leinster/ballisk/donabate-dublin', 'EU', 'IE', 'IRL', 'Donabate/Portrane Community Centre', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2966693', 'Ballisk', NULL);
