INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fe978-f3f9-11e4-910d-080027c336f0', 685, NULL, 'Sigillo', 'df75cc9e-f3f9-11e4-910d-080027c336f0', '2014-02-18 06:43:12+00', '2014-02-24 10:21:40+00', '3006', 1, 1, 2, 0, '2th Saturday of the month, 3.30pm-6.30pm', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Perugia"}', '{"toponymName":"Umbria"}', '{"toponymName":"Sigillo"}', '{"name":"Sigillo","geonameId":"3166541"}', '43.331303649672606,12.740781505279529', '{"lat":43.331303649672606,"lon":12.740781505279529}', '<p>Porta con te&nbsp;</p><ul><li>Merenda</li><li>Un computer</li><li>Un genitore. Se hai meno di 12 anni, il genitore rimarr&agrave; durante il Dojo.</li></ul>', 'coderdojosigillo@gmail.com', 'http://coderdojosigillopg.tumblr.com/', 'CdojoSigillo', 'https://groups.google.com/forum/?hl=it#!forum/coderdojosigillo', 'http://www.eventbrite.it/', NULL, 0, NULL, NULL, 0, 'it/umbria/sigillo/sigillo', 'EU', 'IT', 'ITA', 'Aula Magna Scuola Infanzia, via D.A. Brunozzi, Sigillo 06028, Perugia Italy', NULL, 380, 'Italy, Italian Republic', '18', 'Umbria', '', '', '', '', '', '', '3166541', 'Sigillo', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fedae-f3f9-11e4-910d-080027c336f0', 699, NULL, 'Söderköping', 'df75cf04-f3f9-11e4-910d-080027c336f0', '2014-02-26 18:14:28+00', '2014-02-27 14:41:39+00', '3006', 1, 1, 4, 0, 'Odd week wednesday, 5.00pm - 7.00pm', '{"countryName":"Sweden","geonameId":"2661886","alpha2":"SE"}', '{"toponymName":"Söderköpings Kommun"}', '{"toponymName":"Östergötland"}', '{"toponymName":"Söderköping"}', '{"name":"Söderköping","geonameId":"2676215"}', '58.4759013,16.323430700000017', '{"lat":58.4759013,"lon":16.323430700000017}', '<div><h4>Vilka f&aring;r vara med?</h4><p>Barn och ungdomar 7-17 &aring;r. Barn under 12 ska ha s&auml;llskap av en vuxen.</p><h4>Vilka h&aring;ller i tr&auml;ffarna?</h4><p>Det g&ouml;r intresserade mentorer med kunskap om programmering.</p><h4>&Auml;r det en kurs?</h4><p>Nej, det &auml;r inte en vanlig kurs d&auml;r du m&aring;ste delta varje g&aring;ng. Anm&auml;l dig s&aring; att vi vet hur mycket fika som kommer att g&aring; &aring;t.</p><h4>Vad h&auml;nder under de tv&aring; timmarna?</h4><p>Mentorerna ger n&aring;gra f&ouml;rslag p&aring; hur du kan komma ig&aring;ng med programmering. V&auml;lj n&aring;got du tycker &auml;r kul, s&auml;tt dig vid en dator och f&ouml;rs&ouml;k l&ouml;sa uppgiften. Man beh&ouml;ver inte utg&aring; fr&aring;n f&ouml;rslagen utan det g&aring;r utm&auml;rkt att g&ouml;ra n&aring;got utifr&aring;n egna id&eacute;er. Har du egen dator s&aring; kan du ta med den, annars finns det datorer att tillg&aring; i datorsalarna. Beh&ouml;ver du hj&auml;lp s&aring; finns mentorerna d&auml;r f&ouml;r din skull.</p><p>Coderdojo kommer att h&aring;llas udda veckor, p&aring; onsdagar mellan kl 17.00-19.00. Vi h&aring;ller till p&aring; Ramunderskolan, datasalen, ing&aring;ng via Fokus.</p></div>', 'soderkoping.se@coderdojo.com', NULL, 'CoderDojoSkp', 'https://groups.google.com/forum/#!forum/coderdojo-skp', '11366875631', NULL, 0, NULL, NULL, 0, 'se/ostergotland/soderkoping/soderkoping', 'EU', 'SE', 'SWE', 'Ramunderskolan, Söderköping', NULL, 752, 'Sweden, Kingdom of', '16', 'Östergötland', '', '', '', '', '', '', '2676215', 'Söderköping', NULL);
