INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f68a3-f3f9-11e4-910d-080027c336f0', 418, NULL, 'Ibague, Tolima', 'df753f1b-f3f9-11e4-910d-080027c336f0', '2013-08-09 20:15:31+00', '2013-12-01 14:25:26+00', '3006', 1, 1, 2, 0, 'Todos los Sabados de 08:00am a 12:00pm', '{"countryName":"Colombia","geonameId":"3686110","alpha2":"CO"}', '{"toponymName":"Ibagué"}', '{"toponymName":"Tolima"}', '{}', '{"name":"Ibagué","geonameId":"3680656"}', '4.436116535689377,-75.21389113087463', '{"lat":4.436116535689377,"lon":-75.21389113087463}', '<h3>A quien esta dirigido este CoderDojo ?</h3><ul><li>A estudiantes de Noveno, Decimo o Undecimo grado que deseen aprender el bello arte de la programacion y el desarrollo de software.</li></ul><h3>Que vas a aprender ?</h3><ul><li>Historia de los Computadores</li><li>Sistemas Numericos</li><li>Algebra de Boole</li><li>Compuertas Logicas</li><li>Variables</li><li>Condicionales</li><li>Funciones</li><li>Ciclos</li><li>Recursividad</li><li>Vectores</li><li>A leer y escribir en diferentes lenguajes de programacion como C, PHP, Ruby, JavaScript</li><li>Y muchas otras cosas mas igualmente divertidas que estan relacionadas con el mundo de la programacion y el desarrollo de software</li></ul><h3>Quieres ser parte de este CoderDojo ?</h3><ul><li>Envianos un email comentandonos porque quieres ser parte de este Dojo y porque estas interesado en aprender a programas y/o a desarrollar software.</li></ul>', 'glendelfyne@coderdojo.com.co', 'http://coderdojo.com.co/', 'CoderDojoColomb', NULL, NULL, 'http://wssinternational.net/WSS_CoderDojo.png', 0, NULL, NULL, 0, 'co/tolima/ibague/ibague-tolima', 'SA', 'CO', 'COL', 'Carrera 5 # 39A-34 Ibagué, Tolima, Colombia', NULL, 170, 'Colombia, Republic of', '28', 'Tolima', '', '', '', '', '', '', '3680656', 'Ibagué', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fc678-f3f9-11e4-910d-080027c336f0', 588, NULL, 'Fort Wayne', 'df757c9c-f3f9-11e4-910d-080027c336f0', '2013-12-27 13:48:30+00', '2014-01-15 20:37:41+00', '3006', 1, 1, 1, 0, 'Gathering in March 2015 on the 7th and the 21st (1st and 3rd Saturday) from 1-3 p.m.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Allen County"}', '{"toponymName":"Indiana"}', '{}', '{"name":"Dwenger Field","geonameId":"4919818"}', '41.07710566288502,-85.11747313967282', '{"lat":41.07710566288502,"lon":-85.11747313967282}', '<ul><li>&quot;Above All: Be Cool&quot;</li><li><strong>Bring your laptop.</strong></li><li><strong>Bring a parent! (Very important... If you are 12 or under, your parent must stay with you during the session.)</strong></li><li><strong>Be a mentor.</strong></li><li><strong>See (and Like) Fort Wayne Coder Dojo on Facebook.</strong></li><li>Call Noel Knox at 260.418.9150 with questions.</li></ul>', 'fortwayne.us@coderdojo.com', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'us/indiana/dwenger-field/fort-wayne', 'NA', 'US', 'USA', 'Indiana Tech, Zollner Engineering Center, 1600 E. Washington Blvd., Fort Wayne, Indiana, 46803 (Zollner Engineering Center, Building 10 on the campus map at http://www.indianatech.edu/ in Room Z103).', NULL, 840, 'United States of America', 'IN', 'Indiana', '', '', '', '', '', '', '4919818', 'Dwenger Field', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90e300-f3f9-11e4-910d-080027c336f0', 1055, NULL, 'Valencia', 'df76eca4-f3f9-11e4-910d-080027c336f0', '2014-11-06 18:12:09+00', '2014-11-10 11:13:31+00', '4124', 1, 1, 1, 0, 'Mensual, Sábados de 11 a 13', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Valencia"}', '{"toponymName":"Valencia"}', '{"toponymName":"Valencia"}', '{"name":"Valencia","geonameId":"2509954"}', '39.476880808364555,-0.3769394278526761', '{"lat":39.476880808364555,"lon":-0.3769394278526761}', '<ul><li>Para ser un &quot;coder&quot; s&oacute;lo necesitas asociarte al CodeDojo Valencia en el formulario de la web.</li><li>Es un club de programadores, ni un taller, ni un curso...queremos crear una comunidad de ni&ntilde;os, y que entiendan por que es importante colaborar.</li><li>Trata de llevar tu propio portatil. Tener un entorno de trabajo controlado es la mejor manera de programar. Si no puedes acceder a uno, avisanos con tiempo y trataremos de solucionarlo.</li><li>El equipo de mentores/as son personas voluntarias con diferentes habilidades, experiencia y formaci&oacute;n; ellos y ellas no son profesores al uso pero s&iacute; est&aacute;n para guiarte.</li><li>Es recomendable que un adulto acompa&ntilde;e durante la actividad a las personas menores de 12 a&ntilde;os.</li><li>Todos los eventos ser&aacute;n publicados a traves de nuestra pagina web y conviene que reserves plaza previamente por cuesti&oacute;n de aforo.</li></ul>', 'coderdojovalencia@gmail.com', 'http://www.bylinedu.es/formacion/coderdojovalencia', 'CoderDojoVLC', 'https://groups.google.com/d/forum/coderdojovalencia', '14230514853', NULL, 0, NULL, NULL, 0, 'es/valencia/valencia/valencia', 'EU', 'ES', 'ESP', 'Pza de Manises, 2, Valencia', NULL, 724, 'Spain, Kingdom of', '60', 'Valencia', '', '', '', '', '', '', '2509954', 'Valencia', NULL);
