INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ff78d-f3f9-11e4-910d-080027c336f0', 737, NULL, 'Gravesend', 'df75d709-f3f9-11e4-910d-080027c336f0', '2014-03-19 13:37:57+00', '2014-03-20 10:06:20+00', '3006', 1, 1, 4, 0, '1st Saturday of each month', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Kent"}', '{"toponymName":"England"}', '{"toponymName":"Gravesham"}', '{"name":"Gravesend","geonameId":"2648187"}', '51.4404286,0.37445439999999053', '{"lat":51.4404286,"lon":0.37445439999999053}', '<p>We are currently in planning so dates and times are subject to change.</p><p>If you are coming to the Gravesend Dojo you will need</p><ul><li><strong>A laptop. We have a limited amount of PCs so bring your laptop if you have one.</strong></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay on the premises during the session. </strong></li></ul>', 'gravesend.uk@coderdojo.com', NULL, 'CoderDojoGravesend', NULL, NULL, NULL, 0, NULL, NULL, 0, 'gb/england/gravesend/gravesend', 'EU', 'GB', 'GBR', '143 Wellington St, Gravesend DA12 1JF', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2648187', 'Gravesend', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fed73-f3f9-11e4-910d-080027c336f0', 698, NULL, 'Shailer Park, Logan, @Logan Hyperdome Library (Logan City Council)', 'df75cc95-f3f9-11e4-910d-080027c336f0', '2014-02-26 04:46:11+00', '2014-05-27 11:39:09+00', '3006', 1, 1, 2, 0, 'Saturday, 1pm - 3pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Logan"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Shailer Park","geonameId":"8347715"}', '-27.6557979,153.17141709999999', '{"lat":-27.6557979,"lon":153.17141709999999}', '<p>Like to code and want some help or want to know where to start?&nbsp; Do you like &#39;LEGO&#39; Robotics - &#39;WeDo&#39; or &#39;.EV3?&nbsp; If you do, then join volunteer tutors in eight weeks of coding support and fun.&nbsp; Get some help with your own project or learn about simple programming with kid-friendly software and &#39;LEGO&#39; robotics.</p><p>&nbsp;</p><p>Places are limited so bookings are essential. Please register at&nbsp;http://www.logan.qld.gov.au/about-logan/calendar (search for CoderDojo) for upcoming events.&nbsp;</p><p>Participants should bring -</p><p>- a laptop if you have one or use one of the libraries PCs</p><p>- a parent/carer if under 15</p><p>- a snack</p><p>If parents/carers or other interested people would like to volunteer to become a CoderDojo Logan mentor while attending with their child please let us know.&nbsp; (to enquire about registering to become a mentor please phone: 3412 4163)</p>', 'logan.au@coderdojo.com', 'http://www.logan.qld.gov.au/about-logan/calendar', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'au/queensland/shailer-park/shailer-park-logan-logan-hyperdome-library-logan-city-council', 'OC', 'AU', 'AUS', 'Logan Hyperdome Library, Mandew Street, Shailer Park, Qld', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '8347715', 'Shailer Park', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90dc7b-f3f9-11e4-910d-080027c336f0', 1044, NULL, 'Geekulcha', 'df76e993-f3f9-11e4-910d-080027c336f0', '2014-10-29 14:45:43+00', NULL, NULL, 0, 0, 1, 0, 'Vacation, 09:00 - 16:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'info@geekulcha.com', NULL, NULL, NULL, NULL, 'http://future.geekulcha.com', 0, NULL, NULL, 0, 'za/geekulcha', 'AF', 'ZA', 'ZAF', 'Pretoria', NULL, 710, 'South Africa, Republic of', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df915bfd-f3f9-11e4-910d-080027c336f0', 1253, NULL, 'Ocala, Florida @ Marion County Public Library', 'df7716e1-f3f9-11e4-910d-080027c336f0', '2015-02-06 16:50:16+00', '2015-02-16 14:03:24+00', '4124', 1, 0, 0, 0, 'Spring Session: Tuesdays March 10 - April 14. 3 p.m. - 4 p.m.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Marion County"}', '{"toponymName":"Florida"}', '{}', '{"name":"Twin Oaks Mobile Home Park","geonameId":"7192257"}', '29.1873925,-82.09974160000001', '{"lat":29.1873925,"lon":-82.09974160000002}', '<p>CAUTION: Dear Parents - When you register, please only use your name for sign-up.&nbsp; We will know the seats you requested based on the number of tickets reserved by you.&nbsp; Please DO NOT&nbsp;write your&nbsp;child&#39;s name on this form.</p><p>The session will be hour-long, but not in a classroom format.&nbsp; Instead, the sessions will be more like jam-sessions.&nbsp;&nbsp;IT volunteers&nbsp;will use the &ldquo;Grandmother method&rdquo; instead of teaching a curriculum, by focusing on admiring the productive stuff the&nbsp;kids do and achieve. CoderDojo&#39;s philosophy is that admiration and acknowledgement are the key to inspiration and creation of a learning context that is positive.</p><div>IT volunteers will encourage kids to ask each other for assistance and to google for answers.</div><p>Here&#39;s a checklist for participation.&nbsp; All children must be accompanied by</p><ul><li>A print-out of the ticket</li><li>A username and password for MIT&#39;s Scratch Website (scratch.mit.edu).</li><li><strong>A parent! (Very important).&nbsp; Your parent must stay with you during the session.</strong></li></ul>', 'ocala.us@coderdojo.com', NULL, NULL, NULL, '15672516920', NULL, 0, NULL, NULL, 0, 'us/florida/twin-oaks-mobile-home-park/ocala-florida-marion-county-public-library', 'NA', 'US', 'USA', 'Marion County Public Library. 2720 E Silver Springs Blvd. Ocala FL 34470', NULL, 840, 'United States of America', 'FL', 'Florida', '', '', '', '', '', '', '7192257', 'Twin Oaks Mobile Home Park', NULL);
