i', NULL, 380, 'Italy, Italian Republic', '04', 'Campania', '', '', '', '', '', '', '3163948', 'Vomero', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ff631-f3f9-11e4-910d-080027c336f0', 731, NULL, 'Wicklow Town, @EGS', 'df75d64d-f3f9-11e4-910d-080027c336f0', '2014-03-16 19:40:11+00', '2014-03-18 16:07:08+00', '3006', 1, 0, 2, 0, 'Every Saturday 11:00 am (closed for Holiday, restarting on the 17th of January 2015)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Wicklow","geonameId":"2960936"}', '52.98734444641354,-6.054448800338719', '{"lat":52.98734444641354,"lon":-6.054448800338719}', '<ul><li>Have eaten lunch or have snacks that are non-messy as the School does not appreciate mess!</li><li>A laptop. Borrow one from someone if needs be. &nbsp;If you contact Matthew before the meeting by email we might be able to arrange something.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session. &nbsp;The lower age limit is 10 years old for the moment.</strong></li></ul>', 'EGSCoderDojo@gmail.com', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/leinster/wicklow/wicklow-town-egs', 'EU', 'IE', 'IRL', 'EGS School, Wicklow Town', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2960936', 'Wicklow', NULL);
