eco', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fd737-f3f9-11e4-910d-080027c336f0', 628, NULL, 'Skerries Dojo', 'df75bdad-f3f9-11e4-910d-080027c336f0', '2014-01-22 18:17:01+00', NULL, NULL, 0, 1, 0, 0, 'Every Saturday 11 to 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'bash@branagan.ie', NULL, NULL, NULL, NULL, NULL, 1, '3042', '2014-01-22 18:17:27+00', 0, 'ie/skerries-dojo', 'EU', 'IE', 'IRL', 'Falcarragh Holmpatrick Skerries', NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90aa75-f3f9-11e4-910d-080027c336f0', 888, NULL, 'Ham Richmond', 'df76b2c9-f3f9-11e4-910d-080027c336f0', '2014-07-29 16:58:53+00', '2014-08-18 10:54:52+00', '3006', 1, 0, 2, 0, 'Saturday 21 March 2015 at 1.30pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Richmond upon Thames"}', '{"name":"Ham","geonameId":"6949212"}', '51.43814247975755,-0.31514847613527763', '{"lat":51.43814247975755,"lon":-0.31514847613527763}', '<p><strong>Free event open to children aged 8 to 14 accompanied by a parent or carer. When you have chosen your preferred activity please ensure you pick the appropriate ticket type.</strong></p><p><strong>Newcomers and beginners are welcome!</strong></p><div><p><strong>Raspberry Pi Jam:&nbsp;</strong>Explore the amazing ways to assemble, connect and configure the Raspberry Pi for coding and to control simple electronic circuits. Whether you&#39;re a newcomer to the Pi or have some prior experience, there&#39;ll be lots of fun stuff to see and try out.<strong> Session uses Club Pis</strong></p><p><strong>Scratch</strong>: As well as learning to make some classic video games, over the next sessions we&rsquo;re going to explore other ways of using the powerful features of Scratch: Create amazing coloured patterns automatically and see them drawn with a wireless robot; learn how computers sort numbers and other information; and see how Scratch can control or respond to real-world sensors and other devices. <strong>Session uses club PCs.</strong></p><p><strong>Python:</strong> Over the coming sessions, develop your coding skills in this powerful grown-up scripting language (and have fun too!) by creating guessing games, interactive jokes, fantasy games, noughts &amp; crosses and lots more. You will be placed in a Python group on arrival depending on how many Python sessions you have attended in the past. This helps us make sure you get the best out of the afternoon.&nbsp; <strong>You will need to bring your own laptop. A Windows laptop will work best for getting Python up and running. However, we do have a mac expert who can help install the Python software on a mac.</strong></p><p><strong>If in doubt about which ticket type or activity to choose, feel free to email us for advice :-)</strong></p><p><strong>Terms of participation:</strong></p><p><strong>We are no longer issuing &#39;parent/carer&#39; tickets</strong> but it is still a condition of participation that a parent or carer must accompany their child/children throughout the session and take responsibility for them and for their belongings while on Ham &amp; Petersham Youth Centre premises. Being cool means no bullying, lying or wasting people&#39;s time. Please show respect for the Centre&#39;s equipment and building; and have consideration for others at all times.</p></div><p>&nbsp;</p><p>General information:</p><p>This is the local CoderDojo for kids aged 8 to 14 in Ham, Richmond, North Kingston and surrounding areas. &nbsp; We aim to run our Dojo at least monthly, so join our mailing list by emailing <a href="mailto:hamrichmond.uk@coderdojo.com">hamrichmond.uk@coderdojo.com</a> and follow us on Twitter <a href="http://mce_host/@CoderDojoHam">@CoderDojoHam</a>.</p><p>&nbsp;</p><p>&lt;!--[if gte mso 9]>&lt;xml&gt;
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fc3ca-f3f9-11e4-910d-080027c336f0', 576, NULL, 'Portlaoise, Co. Laois', 'df748075-f3f9-11e4-910d-080027c336f0', '2013-12-17 22:28:44+00', '2014-01-02 15:13:44+00', '3006', 1, 0, 0, 0, 'TBC', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojoportlaoise@gmail.com', 'http://www.coderdojoportlaoise.com', 'coderdojolaois', NULL, NULL, NULL, 1, '3006', '2014-03-26 16:40:29+00', 0, 'ie/portlaoise-co-laois', 'EU', 'IE', 'IRL', 'TBC', NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ed3ef-f3f9-11e4-910d-080027c336f0', 64, NULL, 'Ennistymon', 'df740375-f3f9-11e4-910d-080027c336f0', '2012-03-14 15:14:16+00', '2013-12-01 14:25:30+00', '3006', 1, 1, 2, 0, '7:00 - 9:00 pm every Friday', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p ><strong><u><span>What is <span class=SpellE>CoderDojo</span>?</span></u></strong><span><br> <span class=SpellE>CoderDojo</span> is a movement of free coding clubs for young people. At a <span class=SpellE>CoderDojo</span>, young people learn how to code,develop websites, apps, programs, games and more. Dojos are set up, run by and taught at by volunteers</span><o:p></o:p></p> <p class=MsoNormal><strong><u><span>Cost</span></u></strong><span><br> <span class=SpellE>Cost</span> is absolutely free!<o:p></o:p></span></p> <p class=MsoNormal><b><u><span>Laptops<o:p></o:p></span></u></b></p> <p class=MsoNormal><span>We do have some Laptops available but we are now running <span class=GramE>out ! The kids that have access to them could they please bring them along.</span></p> <p class=MsoNormal><b><u><span>Topics covered<o:p></o:p></span></u></b></p> <p class=MsoNormal><span> The sessions will focus on a choice of: its pretty varied but we start from Scratch ! Creating your own games with Scratch, Lego Mindstorm (Robotics), Website development with HTML and JavaScript, Game Studio (more advanced game creation), Mobile Apps, Microsoft Small Basic, Flash Games, Python, Raspberry PI and Arduino (Sensors) </span></p> <p class=MsoNormal><b><u><span>VERY IMPORTANT:<o:p></o:p></span></u></b></p> <p class=MsoNormal><span> A parent/guardian must stay with all children 12 years old or younger for the entire duration of the session. As well as keeping an eye on their children and equipment, parents/guardians will also be able to learn along with them. </span></p> <p class=MsoNormal><b><u><span>Contact:<o:p></o:p></span></u></b></p> <p class=MsoNormal><span> Contact: Mike Linnane (087) 2393077 or Eddie Crowe (085) 7279768 for more info. </span></p>', 'coderdojoennistymon@gmail.com', NULL, 'CDojoEnnistymon', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/ennistymon', 'EU', 'IE', 'IRL', 'Ennistymon Enterprise Centre, Ennistymon, Co. Clare', NULL, 372, 'Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8feb5d-f3f9-11e4-910d-080027c336f0', 693, NULL, 'Norrköping', 'df75ce58-f3f9-11e4-910d-080027c336f0', '2014-02-22 23:30:00+00', '2014-02-26 11:04:57+00', '3006', 1, 1, 2, 0, 'Varannan lördag, kl. 11-13', '{"countryName":"Sweden","geonameId":"2661886","alpha2":"SE"}', '{"toponymName":"Norrköpings Kommun"}', '{"toponymName":"Östergötland"}', '{"toponymName":"Norrköpings Hedvig"}', '{"name":"Norrköping","geonameId":"2688368"}', '58.5890578,16.177324399999975', '{"lat":58.5890578,"lon":16.177324399999975}', '<p>All information finns p&aring; v&aring;r hemsida <a href="http://coderdojonkpg.se">http://coderdojonkpg.se</a>. Hoppas vi ses!</p>', 'norrkoping.se@coderdojo.com', 'http://coderdojonkpg.se', 'CoderDojoNkpg', 'https://groups.google.com/forum/#!forum/coderdojo-norrkoping', NULL, NULL, 0, NULL, NULL, 0, 'se/ostergotland/norrkoping/norrkoping', 'EU', 'SE', 'SWE', 'Visualiseringscenter C, Kungsgatan 54, 602 33 Norrköping', NULL, 752, 'Sweden, Kingdom of', '16', 'Östergötland', '', '', '', '', '', '', '2688368', 'Norrköping', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ee77f-f3f9-11e4-910d-080027c336f0', 129, NULL, 'Sardegna', 'df746da2-f3f9-11e4-910d-080027c336f0', '2012-05-08 01:41:44+00', '2013-10-14 08:35:45+00', '21', 2, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Grazie a tutti per le vostre emails, oggi ho trovato decine di emails da voi di coderdojo, io mi chiamo Domenico ho incominciato a promuovere coderdojo piu'' di un anno fa quando e'' cominciato ed e'' stato difficile trovare dei partecipanti, al momento mi trovo in Florida dall''altra parte del pianeta e l''entusiasmo che sento dalle vostre emails e'' incredibile , finalmente si puo'' cominciare, ora io sto organizzando con dei volontari in sardegna che sono disposti a contribuire, il coderdojo per definizione e'' un luogo dove persone da 4 a 400 anni si incontrano per imparare qualcosa, e'' rivolto ai bambini dai 4 in su ma anche a chi si sente ancora bambino nei confronti della tecnologia e vuole diventare parte attiva dell''innovazione, questo progetto necessita di uno spazio in cui i partecipanti si incontrino e condividono informazioni e interessi, il principale obiettivo dell''iniziativa e'' far avvicinare i nostri figli alla tecnologia, dare loro la possibilita'' di imparare a programmare , di cominciare subito a sviluppare il loro talento! programmare e scrivere codice e'' una attivita'' creativa come dipingere o scrivere un romanzo, e'' questo che impareranno frequentando il dojo, miglioreranno il loro inglese, perche'' si programma in inglese , i linguaggi di programmazione non sono altro che matematica tradotta in inglese, cominceremo subito con un linguaggio di programmazione che si chiama scratch in cui loro creeranno il loro primo videogame, fino ad arrivare alla completa conoscienza di quanto sia importante ai nostri giorni che qualcuno sia in grado di creare strumenti capaci di rendere la vita delle persone migliore.Sto cercando una soluzione veloce per cominciare subito e online in modo tale che i primi incontri possano essere fatti direttamente sul web da casa vostra, nel frattempo organizzero'' un luogo e dei volontari e continuero'' ad essere presente agli incontri online. Vi aggiornero'' presto riguardo l''iniziativa, per il momento vi ringrazio per il vostro interesse ed entusiasmo.', 'domenicomelis@gmail.com', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'it/sardegna', 'EU', 'IT', 'ITA', NULL, NULL, 380, 'Italy, Italian Republic', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
