INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8edfee-f3f9-11e4-910d-080027c336f0', 107, NULL, 'Charleston, SC @ Jack Russell Software', 'df745b6b-f3f9-11e4-910d-080027c336f0', '2012-04-12 19:00:46+00', '2013-12-01 14:25:29+00', '3006', 1, 0, 2, 0, 'Second Wednesday of every month, 6 - 8 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Charleston County"}', '{"toponymName":"South Carolina"}', '{}', '{"name":"Snowden","geonameId":"4596191"}', '32.841231,-79.867948', '{"lat":32.841231,"lon":-79.867948}', '<p>Join this google plus community <a href="https://plus.google.com/u/0/communities/101378504202902416735">For News and Updates</a></p><h3>Questions</h3><p>What to expect?</p><p>A Charleston coder dojo is a monthly meetup where kids from 6 - 17 can gather and learn to code together. There is plenty of resources available on the coder dojo website and there will be a few mentors available for questions and direction. This meetup will always be free.</p><p>What should I bring to the dojo?</p><ul><li>A laptop. Borrow one from someone if needs be!</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><h3>Things to do</h3><p>There will be several mentors around to help, also here are some fun projects/kits to work with:</p><ul><li>Codecadamy</li><li>Makey Makey</li><li>Arduino and Inventors Kit</li><li>RasberryPi</li><li>NodeCopter</li><li>VoxelJs</li></ul><p>Programming can be a lot of fun, and these tools/kits enable kids to experience programming in fun and different ways.</p>', 'charleston.us@coderdojo.com', 'https://coderdojochs.github.io', 'coderdojochs', 'https://plus.google.com/u/0/communities/101378504202902416735', '11693640995', NULL, 0, NULL, NULL, 0, 'us/south-carolina/snowden/charleston-sc-jack-russell-software', 'NA', 'US', 'USA', '494 C Wando Park Blvd, Mount Pleasant, SC 29466', NULL, 840, 'United States of America', 'SC', 'South Carolina', '', '', '', '', '', '', '4596191', 'Snowden', NULL);
