8', 'Villafontana', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df916f1a-f3f9-11e4-910d-080027c336f0', 1334, NULL, 'St Stephen''s School', 'df772111-f3f9-11e4-910d-080027c336f0', '2015-03-05 01:29:42+00', NULL, NULL, 0, 1, 1, 0, 'Every Wednesday 3:30pm-5pm during school time', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Joondalup"}', '{"toponymName":"Western Australia"}', '{}', '{"name":"Duncraig","geonameId":"8349052"}', '-31.8199806,115.7812348', '{"lat":-31.8199806,"lon":115.7812348}', '<ul><li>Bring snacks to share</li><li>Bring a laptop, or borrow one from someone if needs be - open wifi for all people coming (including parents)</li><li>Please meet in the Duncraig Secondary Library at 3:30pm</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'tegan.ambrosa@ststephens.wa.edu.au', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'au/western-australia/duncraig/st-stephens-school', 'OC', 'AU', 'AUS', '100 Doveridge Dr Duncraig', NULL, 36, 'Australia, Commonwealth of', '08', 'Western Australia', '', '', '', '', '', '', '8349052', 'Duncraig', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f8d2d-f3f9-11e4-910d-080027c336f0', 522, NULL, 'Berlin', 'df756b51-f3f9-11e4-910d-080027c336f0', '2013-10-31 13:41:09+00', '2013-12-01 14:25:25+00', '3006', 1, 1, 2, 0, 'Next one: Saturday March 14, from 14:00 to 17:00', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{"toponymName":""}', '{"toponymName":"Berlin"}', '{"toponymName":"Berlin, Stadt"}', '{"name":"Gesundbrunnen","geonameId":"2920789"}', '52.53698356796671,13.394929999999931', '{"lat":52.53698356796671,"lon":13.394929999999931}', '<p>Schick eine Email an <a href="mailto:coderdojoberlin@tif.ca">coderdojoberlin@tif.ca</a> und wir setzen dich auf den Verteiler f&uuml;r Erinnerungen und Neuigkeiten.</p><p>Send an email to <a href="mailto:coderdojoberlin@tif.ca">coderdojoberlin@tif.ca</a> and we will add you to the mailing list for reminders and updates.</p><p>&nbsp;</p><p><strong>Wo / Where?</strong></p><p>SoundCloud HQ, <strong>Rheinsberger Str 76/77</strong>, 10115 Berlin.</p><p>&nbsp;</p><p>CoderDojo ist ein Club fuer Kinder und Jugendliche im Alter von 5 bis 17 Jahren, die programmieren lernen und Spass haben wollen.&nbsp;Hier findest du mehr Informationen: http://coderdojo.com/about</p><ul><li>Laptop mitbringen. Falls du keinen hast, leih dir einen oder frag uns.</li><li><strong>Einen Elternteil! Wenn du 12 Jahre alt oder juenger bist, muss ein Erwachener die ganze Zeit ueber dabei sein.</strong></li></ul><p>CoderDojo is a club for kids aged 5 to 17 to learn to code and have fun. Read more about it here: http://coderdojo.com/about<br /><br />Bring:</p><ul><li>A laptop. Borrow one from someone, or contact us if you need one</li><li><strong>A parent! If you are 12 or under, an adult must stay with you during the session.</strong></li></ul><p><strong>Mentors</strong></p><p>If you want to help children learn how to code by becoming a mentor plese see our <a target="_blank" href="http://www.meetup.com/CoderDojo-Berlin/">Mentor Meetup Group</a> where we coordinate mentorship for every dojo.</p>', 'coderdojoberlin@tif.ca', NULL, 'CoderDojoBerlin', 'https://groups.google.com/forum/#!forum/coderdojo-berlin', '15877781873', NULL, 0, NULL, NULL, 0, 'de/berlin/gesundbrunnen/berlin', 'EU', 'DE', 'DEU', 'SoundCloud HQ, Rheinsberger Str 76/77, 10115 Berlin', NULL, 276, 'Germany, Federal Republic of', '16', 'Berlin', '', '', '', '', '', '', '2920789', 'Gesundbrunnen', NULL);
