INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90adc0-f3f9-11e4-910d-080027c336f0', 895, NULL, 'hamburg @ lug-hh', 'df76b5e3-f3f9-11e4-910d-080027c336f0', '2014-08-05 06:42:28+00', '2014-08-05 11:03:41+00', '3006', 1, 1, 0, 0, 'Jeden Montag, 20 - 22.30 uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Hamburg"}', '{}', '{"name":"Barmbek-Nord","geonameId":"7932342"}', '53.6017999,10.044189200000005', '{"lat":53.6017999,"lon":10.044189200000005}', '<p><strong>FINDET NICHT STATT</strong></p><p>Hallo, lieber Besucher!</p><p>Sch&ouml;n, dass du Interesse hast am CoderDojo teilzunehmen.</p><p>Was genau ist eigentlich CoderDojo?[0]</p><p>CoderDojo ist ein internationaler und lose organisierter Verein von ehrenamtlichen Helfer/innen, die Kindern von 5 bis 17 Jahren einen Raum bieten, um sich zu treffen und mit ganz viel Spa&szlig; Programmieren zu lernen. Was genau sie lernen und wie oft sie sich treffen, liegt dabei ganz im Ermessen der Ehrenamtlichen vor Ort.</p><p>Hier eine kurze Erkl&auml;rung, was dich erwartet.</p><p>Wenn du 12 Jahre alt oder j&uuml;nger bist, muss ein Erwachsener die ganze Zeit &uuml;ber dabei sein.</p><p>Der CoderDojo geht drei Stunden mit selbst&auml;ndigen Pausen.</p><p>Bitte bringe mit einen Laptop, mit dem du hier und zu Hause arbeiten kannst. Das Betriebssystem ist dir &uuml;berlassen. F&uuml;r die Scratch[1] Programmierung gibt es die Software, du kannst es auch erst im Browser[2] nutzen. Eine deutsche Wiki Seite[3] findest du hier.</p><p>Tutorials / &Uuml;bungen :[4]</p><p>HTML Tutorials</p><p>Scratch Tutorials</p><p>MINECRAFT Tutorials</p><p>Collective Resources</p><p>Web Servers Tutorials</p><p>[0] http://kleinerdrei.org/2013/11/coderdojo-berlin-ist-da-der-programmier-club-fur-kids-fand-erstmals-in-berlin-statt/</p><p>[1] http://scratch.mit.edu/</p><p>[2] http://scratch.mit.edu/projects/editor/?tip_bar=getStarted</p><p>[3] http://scratch-dach.info/wiki/Hauptseite</p><p>[4] http://kata.coderdojo.com/wiki/Tutorials</p>', 'hamburg.de@coderdojo.com', NULL, 'coderdojoathh', NULL, '12443630233', NULL, 0, NULL, NULL, 0, 'de/hamburg/barmbek-nord/hamburg-lug-hh', 'EU', 'DE', 'DEU', 'LUG-Balista Hamburg e.V.  c/o Bürgerhaus in Barmbek Lorichsstr. 28a 22307 Hamburg', NULL, 276, 'Germany, Federal Republic of', '04', 'Hamburg', '', '', '', '', '', '', '7932342', 'Barmbek-Nord', NULL);
