a session.</p>', 'yesdrc@gmail.com', 'http://cg.gew.co', 'yesdrc', NULL, '14115201949', NULL, 0, NULL, NULL, 0, 'cd/western-region/kashangura/bukavudojo', 'AF', 'CD', 'COD', 'A l''hotel des postes, Avenue Kibombo, Ibanda, Bukavu, South Kivu', NULL, 180, 'Congo, Democratic Republic of the', 'W', 'Western Region', '', '', '', '', '', '', '8617862', 'Kashangura', NULL);
