INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90ba6e-f3f9-11e4-910d-080027c336f0', 940, NULL, 'Hobart Tasmania @HobHackerspace', 'df76c7dd-f3f9-11e4-910d-080027c336f0', '2014-09-07 10:24:41+00', '2014-09-10 08:22:21+00', '4124', 1, 0, 1, 0, 'One Saturday a month 1.30pm-3.00pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Hobart"}', '{"toponymName":"Tasmania"}', '{}', '{"name":"Moonah","geonameId":"2157090"}', '-42.853241,147.29952400000002', '{"lat":-42.853241,"lon":147.29952400000002}', '<ul><li>All parents are asked to register their children please, age 7-17 for the Hobart Coder Dojo event next Saturday as numbers are limited, thanks<br /><a target="_blank" href="https://www.eventbrite.com.au/e/coder-dojo-tickets-12947388989">https://www.eventbrite.com.au/e/coder-dojo-tickets-12947388989</a></li><li>A snack and drink bottle.&nbsp;</li><li>A laptop. Borrow one from someone if needs be. Download Scratch software.&nbsp;<a target="_blank" href="http://scratch.mit.edu/scratch2download/">http://scratch.mit.edu/scratch2download/</a>&nbsp;</li><li>Make sure you know your Scratch login details please.&nbsp;</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session. This is a peer to peer social learning model where children and adults learn alongside and from each other.&nbsp;</strong></li></ul>', 'coderdojo@hobarthackerspace.org.au', 'http://hobarthackerspace.com/node/27', 'HobHackerspace', NULL, '12947388989', 'http://hobarthackerspace.com/', 0, NULL, NULL, 0, 'au/tasmania/moonah/hobart-tasmania-hobhackerspace', 'OC', 'AU', 'AUS', 'Hackerspace at 2 St Johns Avenue New Town 7008 Hobart', NULL, 36, 'Australia, Commonwealth of', '06', 'Tasmania', '', '', '', '', '', '', '2157090', 'Moonah', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90d185-f3f9-11e4-910d-080027c336f0', 1015, NULL, 'Melvindale, Michigan', 'df76db27-f3f9-11e4-910d-080027c336f0', '2014-10-14 00:03:00+00', '2014-10-15 08:58:11+00', '4124', 1, 1, 1, 0, 'On the second Wednesday of the month, 5-7pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Wayne County"}', '{"toponymName":"Michigan"}', '{}', '{"name":"Melvindale","geonameId":"5001634"}', '42.279412755502506,-83.189270780426', '{"lat":42.279412755502506,"lon":-83.189270780426}', '<p>Participants should bring:</p><ul><li>A laptop. Borrow one from someone if need be.</li><li>A pair of headphones.</li><li>An email address.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>If you have issues with bringing any of the list, feel free to contact us about it.</p><p>There are a few laptops available for use, but they will go on a first-come, first-serve basis so bring one if you can!<br /><br />No registration is required. We will be using whatever space is available as regular visitors, so just show up and extend the one rule of &quot;Be cool!&quot; to other visitors of the library as well.</p>', 'melcoderdojo@gmx.com', 'http://melcoderdojo.com', 'MelCoderDojo', NULL, NULL, NULL, 0, NULL, NULL, 0, 'us/michigan/melvindale/melvindale-michigan', 'NA', 'US', 'USA', 'Study &amp; Magazine Room at the Melvindale Public Library, 18650 Allen Road, Melvindale, MI 48122', NULL, 840, 'United States of America', 'MI', 'Michigan', '', '', '', '', '', '', '5001634', 'Melvindale', NULL);
