INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df91316a-f3f9-11e4-910d-080027c336f0', 1163, NULL, 'Waltham @ Lumira', 'df77069a-f3f9-11e4-910d-080027c336f0', '2014-12-22 16:28:23+00', '2014-12-23 14:03:24+00', '3006', 1, 0, 2, 0, 'February 10, 2015 3:30pm-5:30pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Middlesex County"}', '{"toponymName":"Massachusetts"}', '{}', '{"name":"Riverview","geonameId":"4948776"}', '42.3666583,-71.24347219999999', '{"lat":42.3666583,"lon":-71.24347219999999}', '<p>Did you ever want to learn how to make a video game? Build a website? Or create an app?</p><div>&nbsp;</div><div>Come join us for a Coderdojo, a fun interactive event where you learn to code in a relaxed environment with mentors...and it&rsquo;s just for kids! No previous coding experience is necessary. Suitable for kids ages 10-17.</div><div>&nbsp;</div><div>Parents are encouraged to attend or volunteer! Light snacks and refreshments will be provided</div><div>&nbsp;</div><div>When? February 10th 2015 3:30pm-5:30pm, <strong>This is a one time event</strong></div><div>Where: The Lumira Office located at the Waltham Watch Factory</div><div>221 Crescent Street, Suite 502</div><div>Waltham, MA 02453</div><div>*Parking is available in lot outside of building&nbsp;</div><div>&nbsp;</div><div>Contact:&nbsp;<a href="mailto:natalie.pietrzak@lumira.com">natalie.pietrzak@lumira.com</a>&nbsp;to sign up for the event or to learn about volunteering.</div><ul><li>A laptop is encouraged but not required, we are able to provide one if needed.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'nataliecoderdojo@gmail.com', 'https://www.eventbrite.com/e/coderdojo-for-kids-tickets-14945317848', NULL, NULL, '14945317848', NULL, 0, NULL, NULL, 0, 'us/massachusetts/riverview/waltham-lumira', 'NA', 'US', 'USA', 'Old Watch Tower, 221 Crescent Street, Suite 502 Waltham, MA 02453', NULL, 840, 'United States of America', 'MA', 'Massachusetts', '', '', '', '', '', '', '4948776', 'Riverview', NULL);
