INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ffabb-f3f9-11e4-910d-080027c336f0', 746, NULL, 'Birmingham', 'df75da09-f3f9-11e4-910d-080027c336f0', '2014-03-24 13:45:35+00', '2014-04-01 12:39:01+00', '3006', 1, 1, 2, 0, '17:30-18:30 every  Monday', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Birmingham"}', '{"toponymName":"England"}', '{}', '{"name":"Moseley","geonameId":"2642149"}', '52.4371216,-1.8928685999999288', '{"lat":52.4371216,"lon":-1.8928685999999288}', '<div>Are you between 6-17? Did you always want to make a game or an app but did not know where to start?</div><div>Join us at &nbsp;Birmingham CoderDojo. No prior experience necessary.&nbsp;</div><div>Every Monday 5-6:30 at the&nbsp;Loco Lounge , Kings heath, B14 7JT<br />All meetings are FREE!<br />What to bring?<ul><li>A laptop/tablet/smartphone. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Good attitude.</li></ul><p>Please register bellow as we are trying to keep the numbers small to start with. You only need a ticket per child, the adults are extra.</p></div>', 'birmingham.uk@coderdojo.com', 'https://sites.google.com/a/coderdojo.com/coderdojobirmingham/', 'CoderDojoBham', 'https://groups.google.com/forum/#!forum/coderdojobirmingham', '11822283769', 'http://allsaintsyouthproject.org.uk/wp-content/themes/allsaints/assets/images/logo.png', 0, NULL, NULL, 0, 'gb/england/moseley/birmingham', 'EU', 'GB', 'GBR', 'Loco Lounge, Kings heath, B14 7JT', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2642149', 'Moseley', NULL);
