INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fce41-f3f9-11e4-910d-080027c336f0', 617, NULL, 'Kennett Square, PA, @ Chatham', 'df75b738-f3f9-11e4-910d-080027c336f0', '2014-01-16 01:51:58+00', '2014-02-20 09:59:45+00', '3006', 1, 1, 0, 0, 'Second Tuesday of Every Month, 6pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Chester County"}', '{"toponymName":"Pennsylvania"}', '{}', '{"name":"Kennett Square","geonameId":"4558942"}', '39.8494401,-75.69372479999998', '{"lat":39.8494401,"lon":-75.69372479999998}', '<p>We are launching a Coder Dojo right here in Kennett Square, PA! Our mission is to introduce people of all ages to programming. Basic computer knowledge and operation are recommended, but a desire to learn is a must!&nbsp;</p><p>Please consider the guidelines below:</p><ul><li>A laptop. Borrow one from someone if needs be. If you are unable to obtain access to a laptop, please contact the Dojo so we can arrange one for you to use in the classroom.</li><li>Beverages will be provided.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'ksqdojo@gmail.com', NULL, 'CoderDojoKSQ', NULL, NULL, 'https://extranet.chathamfinancial.com/img/CHF-global-logo-252x63.gif', 0, NULL, NULL, 0, 'us/pennsylvania/kennett-square/kennett-square-pa-chatham', 'NA', 'US', 'USA', '235 Whitehorse Ln, Kennett Square, PA 19348', NULL, 840, 'United States of America', 'PA', 'Pennsylvania', '', '', '', '', '', '', '4558942', 'Kennett Square', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ed025-f3f9-11e4-910d-080027c336f0', 57, NULL, 'Tokyo', 'df740660-f3f9-11e4-910d-080027c336f0', '2012-03-12 00:11:05+00', '2013-12-01 14:25:30+00', '3006', 1, 1, 1, 0, 'Every Sunday, 13:30 - 14:30', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{"toponymName":"Setagaya-ku"}', '{"toponymName":"Tōkyō"}', '{}', '{"name":"Sasazuka","geonameId":"8573531"}', '35.66551195124144,139.66343879699707', '{"lat":35.66551195124144,"lon":139.66343879699707}', '<p>CoderDojo Tokyo is now open. Please visit our web page at <a href="http://tokyo.coderdojo.jp/">http://tokyo.coderdojo.jp/</a>(Japanese).</p><p>If you are interested and want to attend, please reserve at <a href="https://www.facebook.com/coderdojo.tokyo/events">https://www.facebook.com/coderdojo.tokyo/events</a>.</p><p>English speakers are welcome!!</p><p>Below is the list of what we do:</p><ul><li>Create Games with Scratch</li><li>Create Home Pages with HTML/CSS/Javascript</li><li>Create Games with Javascript</li></ul>', 'tokyo@coderdojo.com', NULL, 'CoderDojoTokyo', 'http://groups.google.com/group/coderdojo-tokyo', NULL, NULL, 0, NULL, NULL, 0, 'jp/tky/sasazuka/tokyo', 'AS', 'JP', 'JPN', 'Shimokitazawa OSS Cafe', NULL, 392, 'Japan', '40', 'Tōkyō', '', '', '', '', '', '', '8573531', 'Sasazuka', NULL);
