http://www.fruktarbo.com/wp-content/uploads/2011/01/logo.png', 0, NULL, NULL, 0, 'it/veneto/guazzi/padova', 'EU', 'IT', 'ITA', 'Via Monselice 15a Padova', NULL, 380, 'Italy, Italian Republic', '20', 'Veneto', '', '', '', '', '', '', '8954001', 'Guazzi', NULL);
