er-CoderDojo/', 'CoderDojoCRiver', NULL, NULL, 'http://a1.awsstatic.com/images/open-graph/opengraph.gif', 0, NULL, NULL, 0, 'us/massachusetts/east-cambridge/charles-river-coderdojo', 'NA', 'US', 'USA', 'Microsoft NERD Center, 1 Memorial Drive, Cambridge MA 02142', NULL, 840, 'United States of America', 'MA', 'Massachusetts', '', '', '', '', '', '', '4935352', 'East Cambridge', NULL);
