takadanobaba/shinjuku', 'AS', 'JP', 'JPN', 'CASE Shinjuku, Takadanobaba 1-28-10, Shinjuku-ku, Tokyo', NULL, 392, 'Japan', '40', 'Tōkyō', '', '', '', '', '', '', '8693237', 'Takadanobaba', NULL);
