INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df914f19-f3f9-11e4-910d-080027c336f0', 1239, NULL, 'Geel', 'df771544-f3f9-11e4-910d-080027c336f0', '2015-02-02 14:45:48+00', '2015-02-02 14:49:57+00', '4124', 1, 0, 3, 0, 'Iedere maand', '{"countryName":"Belgium","geonameId":"2802361","alpha2":"BE"}', '{"toponymName":"Antwerp Province"}', '{"toponymName":"Flemish"}', '{}', '{"name":"Poijel","geonameId":"2788813"}', '51.1608366,4.962115499999982', '{"lat":51.1608366,"lon":4.962115499999982}', '<p>CoderDojo &nbsp;organiseert evenementen, de zogenaamde &quot;Dojo&#39;s&quot;. Op die Dojo&#39;s leren jongens en meisjes programmeren, websites maken, apps en spelletjes ontwikkelen enzovoort. Ze ontmoeten gelijkgestemde deelnemers en laten elkaar zien waaraan ze gewerkt hebben. CoderDojo maakt van ontwikkelen en programmeren&nbsp;een superleuke, keigezellige en megatoffe leerervaring.</p><p>Dojo&#39;s worden op vrijwillige basis opgezet en gerund door mentors met voldoende ICT-kennis en de juiste drive om jongeren te coachen. CoderDojo legt sterk de nadruk op open source en vrije software. De beweging heeft een snel groeiend netwerk van leden en vrijwilligers wereldwijd.&nbsp;</p><p>CoderDojo heeft maar &eacute;&eacute;n regel:&nbsp;&quot;Above all: be cool!&quot;.</p><p><br /><br /><strong>Trajecten</strong></p><p>Er zijn verschillende trajecten waaraan kan deelgenomen worden. Dit kan u steeds zelf bepalen, maar zorg ervoor dat u zich heeft ingeschreven.<br /><br /><strong>1) Scratch:</strong><br />Op een visuele manier het logisch denken aanleren om te leren programmeren. Dit is ideaal voor iedereen die wilt leren programmeren.<br /><br /><em>&nbsp;Voorlopig bieden wij nog geen andere trajecten aan.</em></p><p>&nbsp;</p><p><strong>Praktisch informatie</strong></p><p>-&nbsp;Deelnemers tussen 7 en 18 jaar zijn toegelaten.&nbsp;Deelnemers jonger dan 12 worden het best begeleid door een ouder. De ouders hoeven niet de hele tijd aanwezig te zijn, maar moeten wel in de buurt blijven zodat we&nbsp;hen kunnen contacteren.</p><p>- Indien zou blijken dat de deelnemer niet aanwezig zou kunnen zijn, dan kan u dat melden via <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>, waarna&nbsp;het ticket geannuleerd zal worden.</p><p>- We vragen bij de inschrijving wel aan alle deelnemers om een e-mailadres en telefoonnummer van de ouders of voogd op te geven. Indien nodig&nbsp;zal CoderDojo&nbsp;| Geel&nbsp;rechtstreeks contact opnemen met de ouders of voogd.</p><p>- De deelnemer dient te beschikken over een draagbare computer. De coaches zullen ervoor zorgen dat alle benodigde software ge&iuml;nstalleerd zal worden. Indien dit niet het gaval is, dan zal CoderDojo | Geel een draagbare computer voorzien.</p><p>&nbsp;</p><p><strong>Vragen </strong></p><p>Contacteer ons via <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>! See you soon!<br /><br />Door inschrijving en deelname aan de CoderDojo- activiteiten, gaat u als ouder of voogd ermee akkoord dat er beeldmateriaal kan genomen worden van uw kinderen en dat dit beeldmateriaal kan gebruikt worden voor publicatie in het kader van bekendmaking/marketing van CoderDojo. Indien u hiermee niet akkoord bent, kan u dit laten weten via: <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>.</p>', 'geel@coderdojobelgium.be', 'http://www.coderdojobelgium.be', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'be/flemish/poijel/geel', 'EU', 'BE', 'BEL', 'Kleinhoefstraat 4, 2440 GEEL, BELGIUM', NULL, 56, 'Belgium, Kingdom of', 'VLG', 'Flemish', '', '', '', '', '', '', '2788813', 'Poijel', NULL);
