dojo.prato">https://www.facebook.com/coderdojo.prato</a></p>', 'prato@coderdojo.it', 'http://prato.coderdojo.it', 'CoderDojoPo', NULL, '15863981596', NULL, 0, NULL, NULL, 0, 'it/tuscany/prato/prato', 'EU', 'IT', 'ITA', 'Via Dell''Accademia 42 59100 - Prato (PO)', NULL, 380, 'Italy, Italian Republic', '16', 'Tuscany', '', '', '', '', '', '', '3169921', 'Prato', NULL);
