INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90d232-f3f9-11e4-910d-080027c336f0', 1018, NULL, 'San Jose, CA @ Indigo School', 'df76dbd7-f3f9-11e4-910d-080027c336f0', '2014-10-16 04:56:56+00', '2014-10-17 10:03:19+00', '4124', 1, 0, 2, 0, 'See Monthly Schedule at School', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Santa Clara County"}', '{"toponymName":"California"}', '{}', '{"name":"Edenvale","geonameId":"5345358"}', '37.2476104,-121.8369086', '{"lat":37.2476104,"lon":-121.8369086}', '<p>Registration for monthly sessions will be handled via at-school sign-up process.</p><ul><li><strong>Sign up for a free account</strong>&nbsp;at the&nbsp;<a target="_blank" href="http://scratch.mit.edu/"><strong>Scratch</strong></a>&nbsp;website (<a target="_blank" href="http://scratch.mit.edu/">http://scratch.mit.edu/</a>) and&nbsp;<strong>bring your login</strong>! This will allow you to save your projects so that you can continue working from home and in later sessions.</li><li>Students must bring a&nbsp;<strong>fully-charged WiFi-capable laptop</strong>.</li><li>Students can bring water, but should be fed before-hand.</li><li>Students must be accompanied by an adult during full session&nbsp;(<em>No siblings, please</em>).</li></ul>', 'IndigoCoderDojo@gmail.com', 'http://kflores.github.io/coderdojo-indigo/', NULL, 'https://groups.google.com/forum/#!forum/indigo-coderdojo', NULL, NULL, 0, NULL, NULL, 1, 'us/california/edenvale/san-jose-ca-indigo-school', 'NA', 'US', 'USA', '530 Gettysburg Dr. San Jose, CA. 95123', NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '5345358', 'Edenvale', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9146a6-f3f9-11e4-910d-080027c336f0', 1208, NULL, 'Sydney @ Balmain Library', 'df770fa9-f3f9-11e4-910d-080027c336f0', '2015-01-20 12:44:49+00', '2015-01-28 10:01:41+00', '4124', 1, 1, 3, 0, 'Every Saturday for 6 weeks from late February', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Leichhardt"}', '{"toponymName":"New South Wales"}', '{}', '{"name":"Balmain","geonameId":"2177052"}', '-33.8562829,151.17674069999998', '{"lat":-33.8562829,"lon":151.17674069999998}', '<p><strong>Book your place with the EventBrite</strong><br />We ask you to commit to the sessions you will attend so that everyone can get a chance to come along.&nbsp;</p><p><strong>You will need to bring:</strong></p><ul><li>your imagination and enthusiasm</li><li>your laptop (Borrow one from someone if need be)</li><li><strong>your parent or guardian&nbsp;(Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>As a tip, bring along a&nbsp;snack and something to drink - being creative will make you hungry</p><p>We need volunteers! We hope to offer future sessions, beyond this one, so if you&#39;re keen to volunteer, just ask us!</p>', 'balmain.au@coderdojo.com', 'https://coderdojosydney.org/leichhardt/', 'CoDo_Balmain', NULL, '15511024893', NULL, 0, NULL, NULL, 0, 'au/new-south-wales/balmain/sydney-balmain-library', 'OC', 'AU', 'AUS', '370 Darl