bane.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', NULL, NULL, NULL, 0, NULL, NULL, 0, 'au/queensland/chermside/brisbane-chermside-library', 'OC', 'AU', 'AUS', 'Chermside Library, 375 Hamilton Rd, Chermside QLD 4032', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '6943582', 'Chermside', NULL);
