INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df916454-f3f9-11e4-910d-080027c336f0', 1283, NULL, 'Murdoch', 'df771a1e-f3f9-11e4-910d-080027c336f0', '2015-02-13 08:23:48+00', '2015-02-16 12:16:49+00', '4124', 1, 1, 2, 0, 'Every Sunday 12:30pm - 2:30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Melville"}', '{"toponymName":"Western Australia"}', '{}', '{"name":"Murdoch","geonameId":"8349091"}', '-32.066932, 115.835334', '{"lat":-32.066932,"lon":115.835334}', '<p>Location: GCL1 Computing Labs. Next to the Nexus Theatre/ Kim Beazley Lecture Theatre. A large &quot;GCL&quot; sign should be found on the wall next to the stairs.</p><p><strong>Registration via&nbsp;</strong><strong><a target="_blank" href="http://coderdojowa.wa.org.au/">coderdojowa.wa.org.au</a></strong><strong>&nbsp;is required to attend as spaces are limited!</strong></p><p><strong>Requirements</strong><strong> for </strong><strong>Ninjas</strong><strong>:</strong></p><ul><li><p>A pack lunch.</p></li><li><p>A laptop. (Campus Computers may be accessible. To be confirmed)</p></li><li><p><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></p><ul><li><p><strong>​</strong><strong>Parents please be aware that parking should be free on weekends. Carpark 3 (</strong><strong>Entrance</strong><strong> via South St) is </strong><strong>recommended.</strong></p></li></ul></li></ul><p><strong>​</strong><strong>Requirements for </strong><strong>Volunteers</strong><strong>:</strong></p><ul><li><p>A valid working with children&rsquo;s (WWC) card. A WWC Check receipt will be credit as a temporary card until a response is received</p></li><li><p>Food and/or drink. Normal campus facilities in the refractory wont be open. (Caf&eacute; Kadjininy located in the Library is open from12.00noon &ndash; 3:00pm if you want to get a drink or snack)</p></li></ul><p>&nbsp;</p>', 'murdoch.au@coderdojo.com', 'http://coderdojowa.org.au', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'au/western-australia/murdoch/murdoch', 'OC', 'AU', 'AUS', '90 South St, Murdoch WA 6150', NULL, 36, 'Australia, Commonwealth of', '08', 'Western Australia', '', '', '', '', '', '', '8349091', 'Murdoch', NULL);
