INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ffaf9-f3f9-11e4-910d-080027c336f0', 747, NULL, 'Vienna', 'df75da51-f3f9-11e4-910d-080027c336f0', '2014-03-24 18:07:14+00', '2014-03-27 15:36:36+00', '3006', 1, 0, 1, 0, 'Jeden zweiten Freitag im Monat, 15-18 Uhr', '{"countryName":"Austria","geonameId":"2782113","alpha2":"AT"}', '{"toponymName":"Vienna"}', '{"toponymName":"Vienna"}', '{"toponymName":"Gemeindebezirk Innere Stadt"}', '{"name":"Vindobona","geonameId":"8378568"}', '48.20939449999999,16.37414369999999', '{"lat":48.20939449999999,"lon":16.37414369999999}', '<p>Unser CoderDojo ist ein Treffpunkt f&uuml;r Kinder und Jugendliche im Alter von 5 bis 17 Jahren, die auf spielerisch-kreative Art und Weise die Welt des CODING (Programmierung, Webseite erstellen, etc.) kennenlernen wollen.&nbsp;</p><p>Weitere Informationen finden sich hier: <a target="_blank" href="http://coderdojo.com/about">http://coderdojo.com/about</a></p><p>Eigene Notebooks (bzw. Raspberry Pis) k&ouml;nnen mitgebracht werden, sind aber nicht unbedingt erforderlich.&nbsp;</p><p>Kinder unter 12 Jahren m&uuml;ssen von Erwachsenen begleitet werden, die die Verantwortung &uuml;bernehmen und w&auml;hrend der gesamten Zeit anwesend sein m&uuml;ssen. Eine erwachsene Person kann mit dem Einverst&auml;ndnis der Eltern bis zu drei Kinder begleiten.&nbsp;</p><p>Die Teilnahme ist kostenlos, eine vorherige Anmeldung ist jedoch erforderlich!</p><p>Weitere Informationen finden Sie in unserem Blog:<br />http://www.coding4you.at/coderdojo/</p><p>&nbsp;</p>', 'coderdojo@ikt-trends.at', 'http://www.coding4you.at/coderdojo/', 'Dojo_Vienna', NULL, '11083929331', NULL, 0, NULL, NULL, 0, 'at/vienna/vindobona/vienna', 'EU', 'AT', 'AUT', 'OCG, Wollzeile 1, 1010 Wien', NULL, 40, 'Austria, Republic of', '09', 'Vienna', '', '', '', '', '', '', '8378568', 'Vindobona', NULL);
