INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8eeb27-f3f9-11e4-910d-080027c336f0', 144, NULL, 'Bandon', 'df747cdf-f3f9-11e4-910d-080027c336f0', '2012-05-29 10:15:22+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 2, 0, 'Active', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Bandon","geonameId":"2966370"}', '51.7336025,-8.749398499999983', '{"lat":51.7336025,"lon":-8.749398499999984}', '<p>Email us @ bandoncoderdojo@gmail.com to register. You should bring (if you can):<br />&nbsp;</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If under 18, your parent must stay with you during the session otherwise you will not be able to attend.</strong></li></ul><p><br />To start out, we&#39;ll be working on the following:</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>HTML &amp; CSS to set up your own webpage, using <a href="http://notepad-plus-plus.org/" target="_blank">Notepad ++</a> for Windows or <a href="http://www.barebones.com/products/textwrangler/" target="_blank">Text Wrangler for Mac.</a></li><li><a href="http://scratch.mit.edu/" target="_blank">Scratch</a>, a programme designed for children to create their own games without knowing advanced coding, a great start to learning how coding a game works.</li></ul><p><br />The following websites are helpful to get some additional knowledge on these areas:</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ul><li><a href="http://w3schools.com/" target="_blank">W3Schools</a>, easy online tutorials for HTML and CSS</li><li><a href="http://www.codecademy.com" target="_blank">Codecademy</a> an online, interactive, way to learn to code.</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 'bandoncoderdojo@gmail.com', NULL, 'bandoncoderdojo', 'https://groups.google.com/forum/?fromgroups&hl=en#!forum/bandon-coderdojo', NULL, 'http://www.arkutech.ie/', 0, NULL, NULL, 0, 'ie/munster/bandon/bandon', 'EU', 'IE', 'IRL', 'Bandon Grammar School, Bandon, Co. Cork', NULL, 372, 'Ireland', 'M', 'Munster', '', '', '', '', '', '', '2966370', 'Bandon', NULL);
