INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ffcfe-f3f9-11e4-910d-080027c336f0', 756, NULL, 'Parma', 'df75605f-f3f9-11e4-910d-080027c336f0', '2014-03-27 22:04:14+00', '2014-03-28 11:06:53+00', '3006', 1, 1, 3, 0, 'Sabato 28 Febbraio, 15:00 alle 18:00', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Parma"}', '{"toponymName":"Emilia-Romagna"}', '{"toponymName":"Salsomaggiore Terme"}', '{"name":"Salsomaggiore Terme","geonameId":"3168627"}', '44.81311820000001,9.985554399999955', '{"lat":44.81311820000001,"lon":9.985554399999955}', '<p><strong>Che cos&#39;&egrave; CoderDojo?</strong></p><p>I CoderDojo sono laboratori / club di programmazione gratuiti e aperti a bambini e ragazzi, dedicati, in questa occasione ai ragiazzi di fascia d&#39;et&agrave; 7-14 anni.</p><p>Gli eventi si tengono con cadenza periodica, cominceremo con uno al mese. Indicativamente fisseremo gli incontri il sabato pomeriggio, ma potremmo decidere di spostarli la mattina in base alle esigenze dei ragazzi.</p><h2><strong>Cosa si fa durante un evento?</strong></h2><p>Impareremo a utilizzare&nbsp;<a href="http://scratch.mit.edu/">Scratch</a>&nbsp;per creare i nostri primi programmi e semplici videogiochi.</p><p>Impareremeo a sviluppare una pagina web attraverso l&#39;HTML5 come inizio per un sito.</p><p>L&#39;evento dura circa 3 ore, nella prima parte uno dei mentor spiegher&agrave; a tutti il funzionamento di Scratch attraverso un esempio che i bambini riprodurranno sui propri computer, supportati dagli altri mentor. Nella seconda parte, dopo la merenda, i ragazzi saranno liberi di continuare a personalizzare il proprio gioco o crearne un altro sulla base di quello che hanno imparato.</p><h2><strong>Che cosa bisogna portare?</strong></h2><p>Un portatile per ogni bambino (windows, mac, ubuntu), possibilmente con&nbsp;<a href="http://scratch.mit.edu/download">Scratch</a>&nbsp;gi&agrave; installato</p><p>Una merenda</p><p>Un genitore/accompagnatore</p><h2><strong>Come ci si iscrive?</strong></h2><p>E&#39; possibile effettuare la registrazione tramite Eventbrite a questo indirizzo:&nbsp;<a href="https://www.eventbrite.it/e/registrazione-coderdojo-parma-salsomaggiore-terme-28-febbraio-2015-15827551633">https://www.eventbrite.it/e/registrazione-coderdojo-parma-salsomaggiore-terme-28-febbraio-2015-15827551633</a></p><p>News: <strong>Evento chiuso!</strong></p><p><strong>Centro Polivalente Casa nel Parco, Officina OnOff</strong><br />Italia</p><h2><strong>Hai bisogno di altre informazioni?</strong></h2><p>Contattaci su info@coderdojoparma.com, cercheremo di risponderti al pi&ugrave; presto!</p><h3>Above all, be cool! ;)</h3><p>&nbsp;</p>', 'info@coderdojoparma.it', 'http://www.coderdojoparma.it/', 'CoderDojoParma', 'https://groups.google.com/forum/#!forum/coderdojo-parma', '14422200189', 'http://www.coderdojoparma.it/wp-content/uploads/2013/11/logo.png', 0, NULL, NULL, 0, 'it/emilia-romagna/salsomaggiore-terme/parma', 'EU', 'IT', 'ITA', 'Viale Giandomenico Romagnosi, 7 43039 Salsomaggiore Terme PR Italia', NULL, 380, 'Italy, Italian Republic', '05', 'Emilia-Romagna', '', '', '', '', '', '', '3168627', 'Salsomaggiore Terme', NULL);
