INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ed843-f3f9-11e4-910d-080027c336f0', 80, NULL, 'Fredericksburg Area, Virginia', 'df7408e7-f3f9-11e4-910d-080027c336f0', '2012-03-19 16:12:41+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 2, 0, 'November 9th, 2013', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Stafford County"}', '{"toponymName":"Virginia"}', '{}', '{"name":"Peach Lawn","geonameId":"7198419"}', '38.37119259367978,-77.5308024406433', '{"lat":38.37119259367978,"lon":-77.5308024406433}', 'Prior to Coming, visit our website at: <a href="http://www.FredXCoders.com">www.FredXCoders.com</a><br> And Download Setup Files Here: <a href="http://www.fredxcoders.com/dojo/?p=46">Get Your Machines Code Ready</a><br><br> <ul></li>Bring With You:</ul><ol><li>A laptop. Borrow one from someone if need be.</li><li><strong>If under 18, a Parent must stay onsite during session.</strong></li><li>Self-Serve Snacks</li></ol><br> We are exploring any and all topics of interest among members, including programming for the web, game making, robotics, Minecraft Mod-making, arduino, etc. Bring your interests, share your skills.<br><br><br> Thank you to our Awesome Dojo Supporters!', 'cdva@noizivy.org', 'http://www.fredxcoders.com', 'CoderDojoVA', 'http://groups.google.com/group/coderdojoVA', '8913457391', 'http://www.fredxcoders.com/dojo/wp-content/uploads/2013/05/CDVA_DojoSupportedBy.jpg', 0, NULL, NULL, 0, 'us/virginia/peach-lawn/fredericksburg-area-virginia', 'NA', 'US', 'USA', 'UMW - Stafford Campus - Learner Space - 125 University Blvd. Fredericksburg, VA 22406-7239, Room B122', NULL, 840, 'United States of America', 'VA', 'Virginia', '', '', '', '', '', '', '7198419', 'Peach Lawn', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df909702-f3f9-11e4-910d-080027c336f0', 865, NULL, 'Palermo', 'df769bec-f3f9-11e4-910d-080027c336f0', '2014-06-26 17:18:38+00', '2014-06-27 10:28:42+00', '3006', 1, 0, 2, 0, 'Di sabato pomeriggio, una volta alla settimana', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Palermo"}', '{"toponymName":"Sicily"}', '{"toponymName":"Palermo"}', '{"name":"Noce","geonameId":"2524002"}', '38.114392315496886,13.345256849598627', '{"lat":38.114392315496886,"lon":13.345256849598627}', '<h3><strong>Che cos&#39;&egrave; CoderDojo?</strong></h3><p>I CoderDojo sono laboratori / club di programmazione gratuiti e aperti a bambini e ragazzi, qui a Palermo partiremo dedicandoci alla fascia d&#39;et&agrave; 7-13.</p><p>Gli eventi si tengono con cadenza periodica, cominceremo con uno alla settimana. Indicativamente fisseremo gli incontri il sabato mattina, ma potremmo decidere di spostarli nel pomeriggio in base alle esigenze dei ragazzi.</p><h3><strong>Cosa si fa durante un evento?</strong></h3><p>Impareremo a utilizzare&nbsp;<a href="http://scratch.mit.edu/">Scratch</a>&nbsp;per creare i nostri primi programmi e semplici videogiochi.</p><p>L&#39;evento dura circa 3 ore, nella prima parte uno dei mentor spiegher&agrave; a tutti il funzionamento di Scratch attraverso un esempio che i bambini riprodurranno sui propri computer, supportati dagli altri mentor. Nella seconda parte, dopo la merenda, i ragazzi saranno liberi di continuare a personalizzare il proprio gioco o crearne un altro sulla base di quello che hanno imparato.</p><h3><strong>Quando e dove cominciamo?</strong></h3><p>Inizieremo con l&#39;anno scolastico 2013/2014. Data la capienza dello spazio e trattandosi del primo esperimento, potremo ospitare al massimo 15 bambini.</p><h3><strong>Che cosa bisogna portare?</strong></h3><ul><li>Un portatile con batteria carica, per ogni bambino (windows, mac, ubuntu), possibilmente con&nbsp;<a href="http://scratch.mit.edu/download">Scratch</a>&nbsp;gi&agrave; installato</li><li>Una merenda</li><li>Un genitore</li></ul><h3><strong>Come ci si iscrive?</strong></h3><p>Scrivete a&nbsp;<a href="mailto:coderdojo.palermo@gmail.com?subject=CoderDojo Palermo">coderdojo.palermo@gmail.com</a>&nbsp;per essere inseriti nelle liste di attesa.</p><h3><strong>Hai bisogno di altre informazioni?</strong></h3><p>Contattaci su <a href="mailto:coderdojo.palermo@gmail.com?subject=CoderDojo Palermo">coderdojo.palermo@gmail.com</a>, cercheremo di risponderti al pi&ugrave; presto!</p><p>&nbsp;</p>', 'coderdojo.palermo@gmail.com', 'http://coderdojopalermo.wordpress.com/', 'coderdojopa', 'https://groups.google.com/forum/#!forum/coderdojo-palermo', NULL, NULL, 0, NULL, NULL, 0, 'it/sicily/noce/palermo', 'EU', 'IT', 'ITA', 'Centro TAU - Via Cipressi, 9 - Palermo', NULL, 380, 'Italy, Italian Republic', '15', 'Sicily', '', '', '', '', '', '', '2524002', 'Noce', NULL);
