INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90f0db-f3f9-11e4-910d-080027c336f0', 1070, NULL, 'Santa Monica @ The Learning Path', 'df76f113-f3f9-11e4-910d-080027c336f0', '2014-11-13 19:12:16+00', NULL, NULL, 0, 0, 2, 0, 'Every Wednesday 5:00PM-6:30 PM', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Los Angeles County"}', '{"toponymName":"California"}', '{}', '{"name":"Santa Monica","geonameId":"5393212"}', '34.0193269,-118.497229', '{"lat":34.0193269,"lon":-118.497229}', '<p>We need help with the following:</p><ul><li>Please bring a laptop if you can. It must be able to run Flash.</li><li>Students must register in advance by emailing us at info@thelearningpath.us . Currently this Dojo is limited to Learning Path students and their friends as space and resources are very limited. </li><li>You must be at least 8 years old. </li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'sm@thelearningpath.us', 'http://www.thelearningpath.us', NULL, 'http://www.thelearningpath.us/learn-code-coderdojo-santa-monica/', NULL, 'http://www.thelearningpath.us/wp-content/themes/LP/images/logo_the_learning_path.png', 0, NULL, NULL, 1, 'us/california/santa-monica/santa-monica-the-learning-path', 'NA', 'US', 'USA', 'The Learning Path - 1212 5th St., Suite 100, Santa Monica, CA. 90401', NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '5393212', 'Santa Monica', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f51bb-f3f9-11e4-910d-080027c336f0', 336, NULL, 'Coding Dojo SP @ iMasters', 'df750f2e-f3f9-11e4-910d-080027c336f0', '2013-04-19 14:47:02+00', NULL, NULL, 0, 1, 1, 0, 'Toda primeira terÁa feira, 19:30h', '{"countryName":"Brazil","geonameId":"3469034","alpha2":"BR"}', '{"toponymName":"São Paulo"}', '{"toponymName":"São Paulo"}', '{}', '{"name":"Consolação","geonameId":"7521912"}', '-23.557726,-46.662933', '{"lat":-23.557726,"lon":-46.662933}', '<p><b>O Coding Dojo tem algumas regras b·sicas:</p></b> <p><b>Desenvolvimento guiado por testes:</p></b> <p>Antes de fazer qualquer implementaÁ?o, deve ser escrito um teste, que ao passar indica que a implementaÁ?o est· correta.</p> <p><b>ìPassos de bebÍî:</b> Se um teste n?o est· passando, vocÍ deve escrever o cÛdigo mais simples possÌvel que faÁa o teste passar. Quando for escrever um novo teste para o mesmo mÈtodo, escreva um teste que teste sÛ um pouquinho a mais da funcionalidade desejada.</p> <p><b>Pair programming:</b> A programaÁ?o È feita em duplas. Cada dupla tem um piloto e um co-piloto. Ambos pensam em como passar no teste atual, mas sÛ o piloto digita. Cada par tem por volta de 5 a 10 minutos no seu turno. </p> <p>Quando esse tempo acaba:</p> <p>O piloto volta para a platÈia O co-piloto assume o lugar do piloto Um novo co-piloto vem da platÈia</p> <p><b>Todos devem entender:</b> O piloto e o co-piloto devem sempre explicar em voz alta o que est?o tentando fazer para solucionar o problema. Qualquer um na platÈia pode pedir explicaÁ?es se n?o entender algum raciocÌnio.</p> <p><b>TrÍs fases:</b> Um Coding Dojo sempre est· em alguma dessas 3 fases, dependendo do estado dos testes:</p> <p><b>Vermelha:</b> Pelo menos um teste n?o est· passando. A dupla da vez deve se concentrar em fazer o teste passar. A platÈia n?o deve falar nessa fase, para n?o atrapalhar piloto e co-piloto.</p> <p><b>Verde:</b> Os testes acabaram de ser rodados e todos est?o passando. Essa È a hora de quem est· na platÈia dar sugest?es para melhorar o cÛdigo.</p> <p><b>Cinza:</b> O cÛdigo foi modificado de acordo com as sugest?es, mas a bateria de testes ainda n?o foi rodada. Deve-se evitar fazer grandes modificaÁ?es no cÛdigo nessa fase.</p> <br /> <p><b>Fonte: http://pet.inf.ufsc.br/dojo/o-que-eh-dojo/</b></p>', 'ale.alvesborba@gmail.com', NULL, NULL, 'http://groups.google.com/group/dojo_sp?hl=pt-BR', NULL, 'http://static.imasters.com.br/imasters/img/portal/header-logo.png', 1, '1537', '2013-12-20 17:54:34+00', 0, 'br/sao-paulo/consolacao/coding-dojo-sp-imasters', 'SA', 'BR', 'BRA', 'iMasters Lab, Al. Santos, 2395 - 1o. Andar - S?o Paulo - SP', NULL, 76, 'Brazil, Federative Republic of', '27', 'São Paulo', '', '', '', '', '', '', '7521912', 'Consolação', NULL);
