INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f7509-f3f9-11e4-910d-080027c336f0', 439, NULL, 'Rathfarnham', 'df7550b2-f3f9-11e4-910d-080027c336f0', '2013-09-12 10:52:08+00', '2013-12-01 14:25:26+00', '3006', 1, 1, 2, 0, 'Wednesdays, 6pm - 8pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Templeogue","geonameId":"3315404"}', '53.290705725835735,-6.299334657861664', '{"lat":53.290705725835736,"lon":-6.299334657861664}', '<p><strong>PLEASE NOTE: THERE WILL BE FILMING OF THE CODERDOJO HAPPENING THIS WEEK (4th March) AS WE ARE BEING FEATURED AS PART OF THE LIBRARY2020 PROJECT. PERMISSION SLIPS WILL NEED TO BE SIGNED BY ADULTS ON THE WAY INTO THE DOJO.<br /><br />Coder Dojo will resume on Wednesday 14th&nbsp;January from 6pm - 8pm and will run until summer break.<br /><br />As of 23rd October, the ticketing system has slightly changed. There will be two types of children&#39;s tickets - Child&#39;s PC ticket (using one of our PCs) and Child&#39;s Laptop ticket (you must bring a laptop of your own). Due to logistics, and making sure everyone has a space, these will be strictly enforced. </strong></p><p>CoderDojo is a global collaboration providing free and open learning to young people ages 7 - 17, especially in programming technology.</p><p><strong>NB: Children aged 12 or under MUST be accompanied for the&nbsp;ENTIRE session&nbsp;by a Parent/Guardian. </strong></p><p>Following our very successful first three batches of sessions (from 23/10/13 - 11/12/13, 15/01/14 - 28/05/14 and 17/09/14-10/12/14 2014),&nbsp;<strong>our next batch of session begins on Weds 14th January and runs until mid-May 2015.</strong>&nbsp;In the interests of fairness to the amount of people who have enquired, participants are required to book in for each event&nbsp;<strong>weekly</strong>.&nbsp;<strong>The EventBrite booking page will go live&nbsp;<em>every </em>Thursday morning at 9.45 a.m., allowing booking for the following Wednesday.</strong>&nbsp;The new link will posted on our Dojo listing on Zen&nbsp;<a href="http://zen.coderdojo.com/dojo/439">here</a>.</p><p><strong>As well as booking a child&#39;s ticket, children who are 12 or under MUST be accompanied by a parent, who must also have booked an accompanying parents ticket.</strong></p><p>In the event of most/all of our attendees being 12 or under, we have put up the corresponding number of Parent&#39;s tickets, however, if your child is 13+, you do not need to book a parent&#39;s ticket.&nbsp;<strong>Also, if all of the children&#39;s tickets are sold out, please do NOT book a parent&#39;s ticket</strong>,&nbsp;<strong>as it is primarily your child that needs a&nbsp;ticket and they will not be admitted to the dojo without a</strong>&nbsp;<strong>child&#39;s ticket.</strong></p><p>&nbsp;</p><p><strong>Frequently Asked Questions</strong></p><p><strong><em>What should I bring to the Dojo?</em></strong></p><p>If you have a laptop, please bring it along (along with, if necessary, your charger for the laptop, although given the limited plug outlets, we would ask that the laptop would be charged enough for the duration of the dojo). The dojo is designed to be led by the children and their questions and interests; the mentors will aid them in their learning, trying their best to answer any questions&nbsp;they may have, showing them any languages they may be interested in&nbsp;and helping them with any coding&nbsp;projects they may be working on. Having their own laptop with them will enable them to continue their pursuits in between attending the dojo.</p><p>There are computers in the library to use, in the event that a laptop is not available to you. We would ask that you bring some sort of storage device to save your work onto, like a USB key. If necessary, Ballyroan Library have 1GB USB keys on sale for &euro;10.</p><p><strong><em>Do I/Does my child&nbsp;have to be a member?</em></strong></p><p>Yes. Since internet access will be required, attendees are asked to bring their South Dublin Libraries&#39; library card, so they can log into our free wi-fi. If any attendees are not currently members, they will be required to join (Proof of address - like a household bill or a driver&#39;s licence -&nbsp;is required. To speed up the process, you can fill out your details online&nbsp;<a href="https://library.sdublincoco.ie/06_SelfRegistration/06_001_YourDetails.aspx">here</a>. You can also join at our in-library terminals on the day. Once your details have been filled out, please show your proof of address to a member of staff at the library desk. Children will need to have their parents with them to get a library card).</p><p><strong><em>Why do I have to book in each week?</em></strong></p><p>Due to huge demand, and in the interests of fairness, booking is on a first-come, first-served basis and will be done on a weekly basis to give those who miss out initially a chance to attend. You can attend each week, provided you book in each week. Some people also might prefer not to attend weekly for a multitude of reasons which could include working on coding projects in between dojos.</p><p>Every Thursday morning there will be a new EventBrite event like this one posted on our&nbsp;<a href="http://zen.coderdojo.com/dojo/439">Dojo&#39;s listing on Zen</a>&nbsp;which will enable you to book for the following Wednesday&#39;s Dojo.</p><p><strong><em>I attended last week&#39;s dojo. Can I come to this one too?&nbsp;</em></strong><br /><br />Yes. Booking is on a weekly basis out of fairness, and because everybody may not be able to attend every week. If you have previously attended and want to attend another dojo, we&#39;d love to have you. Bookings are on a first-come, first-served basis.</p><p><strong><em>I/My child is under 7 or 18 +, can they attend?</em></strong></p><p>Unfortuneatly,&nbsp;we&nbsp;cannot accomodate children under&nbsp;7. As for older teenagers (18+), this iniative is designed for children, and there are numerous alternative avenues for&nbsp;adults wishing to enhance their coding skills.</p><p><strong><em>Who will be facilitating the event?</em></strong></p><p>The event is organised by Ballyroan Library and will be facilitated by various external mentors who have a vast range of experience with programming, coding and the computer industry. All of the mentors are volunteering their time for the CoderDojo.</p><p><strong><em>Do I have to bring my printed ticket to the event?</em></strong></p><p>No. Booking is sufficient.</p><p><strong><em>Where is the best place to keep up-to-date on information about the Dojo?</em></strong></p><p>The primary website for CoderDojo Rathfarnham is our&nbsp;<a href="http://zen.coderdojo.com/dojo/439">Dojo listing</a>&nbsp;on CoderDojo&#39;s Zen website. We would also suggest that you like Ballyroan Library&#39;s&nbsp;<a href="https://www.facebook.com/pages/Ballyroan-Library/122303261113806">Facebook page&nbsp;</a>and follow&nbsp;<a href="https://twitter.com/CoDoRathfarnham">CoderDojo Rathfarnham&#39;s twitter feed</a>&nbsp;to keep up-to-date.</p><p><strong><em>I have a query that I haven&#39;t seen the answer to. How I can contact you?</em></strong></p><p>Whilst the dojo is organised by Ballyroan Library, we would ask, that if you need to,&nbsp;please&nbsp;contact us directly&nbsp;at&nbsp;<a href="mailto:coderdojorathfarnham@gmail.com">coderdojorathfarnham@gmail.com</a>&nbsp;and we will get back to you as soon as possible.</p>', 'coderdojorathfarnham@gmail.com', NULL, 'CoDoRathfarnham', NULL, '16033430422', 'http://www.southdublinlibraries.ie/sites/www.southdublinlibraries.ie/themes/libs/images/SDCC_logo_header.png', 0, NULL, NULL, 0, 'ie/leinster/templeogue/rathfarnham', 'EU', 'IE', 'IRL', 'Ballyroan Library, Orchardstown Avenue, Rathfarnham, Dublin 14', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '3315404', 'Templeogue', NULL);
