INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ff7c6-f3f9-11e4-910d-080027c336f0', 738, NULL, 'Abbeyleix', 'df75d71c-f3f9-11e4-910d-080027c336f0', '2014-03-19 18:24:17+00', '2014-03-21 10:29:54+00', '3006', 1, 1, 4, 0, 'Thursday 5.30pm - 6.30pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Abbeyleix","geonameId":"2967092"}', '52.9143242,-7.348785499999963', '{"lat":52.9143242,"lon":-7.348785499999963}', '<ul><li>Attendance is registration based.</li><li>There are some desktops available, but bring a laptop if you can - it doesn&#39;t have to be new or fancy!</li><li><strong>(Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojoabbeyleix@gmail.com', 'https://www.facebook.com/coderdojoabbeyleix', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/leinster/abbeyleix/abbeyleix', 'EU', 'IE', 'IRL', 'Abbeyleix Library, Market Square, Abbeyleix, Co. Laois', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2967092', 'Abbeyleix', NULL);
