INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f5996-f3f9-11e4-910d-080027c336f0', 364, NULL, 'UT Highland', 'df7518b8-f3f9-11e4-910d-080027c336f0', '2013-05-15 03:50:49+00', '2013-12-01 14:25:27+00', '3006', 1, 1, 4, 0, 'Every Tuesday 7-9pm - First mtg Jun 4', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Utah County"}', '{"toponymName":"Utah"}', '{}', '{"name":"Alpine","geonameId":"5770732"}', '40.460856,-111.79957200000001', '{"lat":40.460856,"lon":-111.79957200000001}', '<p>The Highland Utah dojo has been meeting since June of 2013. During the summer months we have upwards of 20 youth show up to code.</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'brent.groom@live.com', 'http://coderdojoutah.com', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'us/utah/alpine/ut-highland', 'NA', 'US', 'USA', '5886 Timber Ridge Ln, Highland', NULL, 840, 'United States of America', 'UT', 'Utah', '', '', '', '', '', '', '5770732', 'Alpine', NULL);
