INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90d065-f3f9-11e4-910d-080027c336f0', 1010, NULL, 'Ballsbridge, Dublin @ Marian College', 'df76da76-f3f9-11e4-910d-080027c336f0', '2014-10-10 16:04:20+00', '2014-10-13 09:46:51+00', '4124', 1, 0, 2, 0, 'Every Saturday 2.30pm - 4:30pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Ballsbridge","geonameId":"2966685"}', '53.33308299999999,-6.226967', '{"lat":53.33308299999999,"lon":-6.226967}', '<h2>CoderDojo Class in Marian College</h2><h3>Age Group 11-16</h3><h3>Required for all members</h3><p>All Parents must attend their first child&#39;s first class to sign the partental permission. Parents of under 12 must stay on the premises at all times. Please make sure to fill out the parental permission form available here. Print, sign and take it with you on your childs first visit. We will have some forms available on the day but it will save time and expense if you can print and bring them along.</p><p>Please be advised, places will be limited to ticket holders only: <strong>One Ticket Per Child</strong>. &nbsp;</p><p>Coderdojo is run completely by volunteers. If you can help in anyway please let us know.</p><p><em>*CoderDojo is FREE for kids, If a parent would like to become a mentor please get in touch, experience is not necessary! We&#39;d like to encourage the children to help &amp; work with each other. &nbsp;</em></p><p><strong>Marian College is located on Lansdowne Road, Ballsbridge, Dublin 4. Next to the Aviva Stadium.</strong></p><h3><br />What to Bring&nbsp;</h3><ul><li>All children must have their ticket and be accompanied by their parent/guardian who has a signed consent form.</li><li>If possible we are asking children to bring their own laptop so they may continue what they have learnt at home however we will have a number of PC&#39;s available.</li></ul>', 'mcc.dojo@gmail.com', 'https://sites.google.com/site/mccdojo/', 'mcc_Dojo', 'https://plus.google.com/118280598058435380042', '13526687687', NULL, 0, NULL, NULL, 0, 'ie/leinster/ballsbridge/ballsbridge-dublin-marian-college', 'EU', 'IE', 'IRL', 'Marian College, Lansdowne Road, Ballsbridge, Dublin 4', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2966685', 'Ballsbridge', NULL);
