INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f694f-f3f9-11e4-910d-080027c336f0', 421, NULL, 'Selr8r / NSC2', 'df753dbc-f3f9-11e4-910d-080027c336f0', '2013-08-14 17:07:30+00', '2013-12-01 14:25:26+00', '3006', 1, 0, 1, 0, 'Every Saturdays between 12 noon and 3pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Fort Cross Roads","geonameId":"3294179"}', '51.8506222,-8.4794068', '{"lat":51.8506222,"lon":-8.4794068}', '<em>If you just want to talk to someone, show up toward the end of the session about 2pm as things are winding down. Other parents and mentors will be there with their kids and can talk to you about it. At the beginning of the session we will be very busy getting organised.</em></p> <p><strong>What you need to bring:</strong></p> <ul> <li>A pack lunch, there are no shops open nearby.</li> <li>YOU MUST BRING A LAPTOP.<em><br /> </em></li> <li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li> </ul> <p><strong>Who can attend:</strong></p> <ul> <li>We accept people all the time, so if you want to start just turn up on the day!</li> <li>We require a parent or guardian to accompany 12s and under partially to keep an eye on their equipment, partially to keep an eye on their charges and partially to learn along with them. Parents and students can eventually become mentors (heck, the kids have come up with far more elegant solutions for some problems).</li> <li>Very young kids may not get much out of it, but we regularly have 8 year olds. They would need to be able to handle medium strength English words and some mathematics to get much out of it. Its thought programming should be done in schools, or at least programmatic thinking, just after long division as its the first abstract algorithm most kids encounter. We do often have younger siblings of kids in the dojo who watch on or play on other computer devices, in preparation for future coding genius.</li> </ul> <p><strong>Cost: Free!</strong><br /> <em>The venue and utilities are provided to us at no charge and mentors donate their time so that we can provide this opportunity for kids at no charge.</em></p> <p><strong>Topics we cover at the moment include:</strong></p> <ul> <li>HTML/CSS/Javascript (Web Frontend).</li> <li>Other topics will be presented depending on what mentors are around on the day. If there is anything in particular that you or the kids would like to cover, let us know.</li> </ul> <br />', 'will@willknott.ie', NULL, 'CoderDojoCork', 'https://groups.google.com/forum/?fromgroups#!forum/coderdojonsc', NULL, NULL, 0, NULL, NULL, 0, 'ie/munster/fort-cross-roads/selr8r-nsc2', 'EU', 'IE', 'IRL', 'Selr8r, Building 4100, Avenue 4000, Cork Airport Business Park', NULL, 372, 'Ireland', 'M', 'Munster', '', '', '', '', '', '', '3294179', 'Fort Cross Roads', NULL);
