/ps/233/223/2332230_300.jpg', 1, '3006', '2014-03-13 14:22:38+00', 0, 'gb/england/saint-pancras/forward-technology-london-nw1-0du', 'EU', 'GB', 'GBR', 'Forward Technology, Floor 2, Centro 3, 19 Mandela Street, London NW1 0DU', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2638707', 'Saint Pancras', NULL);
