INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df909b2d-f3f9-11e4-910d-080027c336f0', 876, NULL, 'Köthen', 'df76b29b-f3f9-11e4-910d-080027c336f0', '2014-07-17 11:38:50+00', NULL, NULL, 0, 1, 0, 0, 'Freitag, 01.08.2014, 17 - 20 Uhr', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Saxony-Anhalt"}', '{}', '{"name":"Großwülknitz","geonameId":"2914819"}', '51.721975, 11.928057', '{"lat":51.721975,"lon":11.928057}', '<p><strong>Das erste K&ouml;thener CoderDojo findet am 1. August 2014 von 14 bis 17 Uhr im Sportlerheim Gro&szlig;w&uuml;lknitz statt.</strong></p><ul><li><p>CoderDojo ist ein Club f&uuml;r Kinder und Jugendliche im Alter von 8 bis 17 Jahren, die sich f&uuml;r das Programmieren von Computern interessieren.</p></li><li><p>Sowohl Teilnehmer mit als auch ohne Vorkenntnisse sind willkommen. Hier findest du mehr Informationen: <a href="http://coderdojo.com/about">http://coderdojo.com/about</a></p></li><li><p>Die Teilnahme ist kostenlos, eine vorherige Anmeldung ist jedoch erforderlich. Wir k&ouml;nnen f&uuml;r eine begrenzte Zahl von Teilnehmern Rechner zur Verf&uuml;gung stellen, alle anderen arbeiten auf eigenen mitgebrachten Laptops - notwendige Software halten wir zur Installation bereit.</p></li><li><p>Schicke eine Email an <a href="mailto:coderdojo@wiesenfeld.org?subject=CoderDojo">coderdojo@wiesenfeld.org</a> und wir setzen dich auf den Verteiler f&uuml;r Erinnerungen und Neuigkeiten.</p></li></ul><p>&nbsp;</p><p><strong>Wenn du 12 Jahre alt oder j&uuml;nger bist, mu&szlig; eine Aufsichtsperson die ganze Zeit &uuml;ber dabei sein.</strong></p>', 'coderdojo@wiesenfeld.org', NULL, NULL, NULL, NULL, NULL, 1, '4038', '2014-08-29 18:27:24+00', 0, 'de/saxony-anhalt/grosswulknitz/kothen', 'EU', 'DE', 'DEU', 'Sportlerheim Großwülknitz', NULL, 276, 'Germany, Federal Republic of', '14', 'Saxony-Anhalt', '', '', '', '', '', '', '2914819', 'Großwülknitz', NULL);
