INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ee060-f3f9-11e4-910d-080027c336f0', 109, NULL, 'Sligo', 'df745d85-f3f9-11e4-910d-080027c336f0', '2012-04-16 13:50:27+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 3, 0, 'Most Saturdays, 10.30am - 12 noon', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Connaught"}', '{}', '{"name":"Sligo","geonameId":"2961423"}', '54.2766709,-8.46162849999996', '{"lat":54.2766709,"lon":-8.46162849999996}', '<p><strong>CoderDojo Sligo is full at present. &nbsp;Please complete the waiting list form at&nbsp;<a href="http://bit.ly/1v9uTRI">http://bit.ly/1v9uTRI</a> and we will contact you as soon as space becomes available.</strong></p><p>&nbsp;</p><p>Registered ninjas you must bring:</p><ul><li>A snack and drink, pen and paper if you like to keep notes.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Please label all of your belongings with your name, as things are often left behind or mixed up.</li></ul><p>Due to space limitations, you <strong>must</strong> register in order to attend, contact us via email for details regarding registration.</p><p>Registered ninjas, you must <strong>book your space</strong> each week via <a href="http://www.coderdojosligoirl.eventbrite.ie"> Eventbrite. </a></p><p>Booking for each week will open Monday and will close at 3pm Friday afternoon. You cannot block book and you will need to book your space every week. We do hate to restrict numbers, but due to space and mentors available it&#39;s best for everyone.</p><p>Find us on <a href="https://www.facebook.com/CoderDojoSligo_"> Facebook </a>or Follow us on <a href="http://www.twitter.com/CoderDojoSligo">Twitter</a></p><p>We are very grateful to <a href="http://www.itsligo.ie"> IT Sligo</a> for supplying the venue.</p>', 'sligodojo@gmail.com', 'http://www.coderdojosligo.wordpress.com', 'Coderdojosligo', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/connaught/sligo/sligo', 'EU', 'IE', 'IRL', 'Institute of Technology, Sligo', NULL, 372, 'Ireland', 'C', 'Connaught', '', '', '', '', '', '', '2961423', 'Sligo', NULL);
