INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90ee56-f3f9-11e4-910d-080027c336f0', 1063, NULL, 'Vienna @ UPC', 'df76ebb5-f3f9-11e4-910d-080027c336f0', '2014-11-10 11:19:48+00', '2014-11-10 16:11:43+00', '4124', 1, 1, 2, 0, 'Die nächsten Termine sind - jeweils freitags von 15.00 bis 17.30 Uhr - am 20. März und am 10. April.', '{"countryName":"Austria","geonameId":"2782113","alpha2":"AT"}', '{"toponymName":"Vienna"}', '{"toponymName":"Vienna"}', '{"toponymName":"Gemeindebezirk Meidling"}', '{"name":"Meidling","geonameId":"2771706"}', '48.17859654615826,16.345590441802983', '{"lat":48.17859654615826,"lon":16.345590441802983}', '<p>UPC l&auml;dt Kinder im Alter von 7 bis 12 Jahren, die programmieren lernen und Spass haben wollen, zum CoderDojo &quot;Vienna @ UPC&quot; ein.&nbsp;Hier findest du mehr Informationen &uuml;ber CoderDojos (Englisch): http://coderdojo.com/about.</p><p>Deine Teilnahme ist kostenlos und du ben&ouml;tigst keinerlei Vorkenntnisse!</p><p>Hier bekommst du einen ersten Eindruck: <a href="https://www.youtube.com/watch?v=3gjLIBqGGCQ">https://www.youtube.com/watch?v=3gjLIBqGGCQ</a></p><p>Du brauchst:</p><p>- einen aufgeladenen&nbsp;Laptop mit Maus und Netzkabel. Falls Du keinen hast, leih Dir einen aus oder frag uns. Auf dem Laptop soll bitte Adobe Air installiert sein.</p><p><strong>- eine erwachsene Begleitperson (Eltern, anderer Erziehungsberechtigter oder sonstige Begleitperson)! Falls du 12 Jahre alt oder j&uuml;nger bist, muss ein Erwachsener die ganze Zeit anwesend sein.</strong> <strong>Er/sie wird auch Spass beim CoderDojo haben.</strong></p><p>Nimm deine <strong>Freunde und Freundinnen&nbsp;</strong>mit!</p><p>Bitte deine <strong>Eltern</strong>, dich f&uuml;r das CoderDojo anzumelden.</p><p>- Schicken Sie bitte ein E-Mail an CoderDojo@upc.at mit Ihrem Namen und&nbsp;Ihrer Kontakttelefonnummer sowie den Namen und den Geburtsdaten der Kinder, die Sie beaufsichtigen werden. Bitte geben Sie auch den Termin an, zu dem Sie sich anmelden.</p><p>- Mit der Anmeldung stimmen Sie auch den <strong>Teilnahmebedingungen</strong> (siehe unten) zu. Sie erhalten ein Best&auml;tigungs-E.Mail.</p><p>- Die Platzzahl ist auf 30 Kinder beschr&auml;nkt, es gilt die Reihenfolge der Anmeldung.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <strong>Teilnahmebedingungen</strong></p><p>- CoderDojo &quot;Vienna @ UPC&quot; ist ein Programmierklub, bei dem spielerisches Lernen im Vordergrund steht. UPC Austria l&auml;dt Kinder im Alter von 7 bis 12 Jahren dazu ein.</p><p>- Jedes Kind muss von einem Elternteil, einer/m Erziehungsberechtigten oder einer anderen bevollm&auml;chtigten Aufsichtsperson begleitet und w&auml;hrend der Veranstaltung&nbsp;beaufsichtigt werden.</p><p>- UPC haftet nicht f&uuml;r Verm&ouml;genssch&auml;den, welche dem Teilnehmer durch die Teilnahme an der Veranstaltung entstehen, es sei denn, diese wurden durch zumindest grob fahrl&auml;ssiges Verhalten von UPC verursacht. Die Haftung von Verm&ouml;genssch&auml;den ist in jedem Fall mit &euro; 500 pro Schadensfall begrenzt.</p><p>- Insbesondere haften weder UPC noch die freiwilligen Helfer oder Helferinnen, wenn der mitgebrachte Computer auf Grund von aus dem Internet geladener oder zur Verf&uuml;gung gestellter Software abst&uuml;rzt oder anderen Schaden nimmt.</p><p>- Teilnehmende Eltern bzw. Erziehungsberechtigte stimmen zu, die Haftung f&uuml;r etwaige Sch&auml;den, die durch ihre Kinder verursacht wurden, zu &uuml;bernehmen.</p><p>-&nbsp; Von Ihnen oder Ihren Kindern im Zusammenhang mit der Teilnahme an der Veranstaltung gemachte Fotos, Filmaufnahmen und Interviews d&uuml;rfen von UPC ohne Anspruch auf Verg&uuml;tung in Medien wie z.B. Rundfunk, Fernsehen, Printmedien und Sozialen Medien verbreitet und ver&ouml;ffentlicht werden. Falls Sie damit nicht einverstanden sind, teilen Sie uns das bitte im Anmeldungs-Mail mit.</p><p>- Die Anmeldung ist verbindlich. Es bestehen keine Haftungsanspr&uuml;che f&uuml;r eine abgesagte Veranstaltung.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Ende der Teilnahmebedingungen</strong> (Version Dezember 2014)</p>', 'CoderDojo@UPC.at', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'at/vienna/meidling/vienna-upc', 'EU', 'AT', 'AUT', 'UPC Austria, Wolfganggasse 58-60, 1120 Wien', NULL, 40, 'Austria, Republic of', '09', 'Vienna', '', '', '', '', '', '', '2771706', 'Meidling', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90b5c2-f3f9-11e4-910d-080027c336f0', 926, NULL, 'Brisbane Square Library - Web Development', 'df76bab4-f3f9-11e4-910d-080027c336f0', '2014-08-29 04:26:20+00', '2014-09-01 10:02:16+00', '4124', 1, 1, 0, 0, 'Saturday''s 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Brisbane","geonameId":"2174003"}', '-27.4708417,153.0227213', '{"lat":-27.4708417,"lon":153.0227213}', '<p>Over the 6 week program,&nbsp;<strong>kids aged 10 - 17</strong>&nbsp;will learn what they need to know in HTML, CSS, and, if time permits, Javacript, to build their very own website. During the course, kids will learn:</p><ul><li>Basic HTML</li><li>Understanding CSS</li><li>Responsive Design</li><li>Navigation</li></ul><p>And this will all culminate with the kids building their very own 3 page website in the last session. This is all with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop with either Notepad ++ (<a href="http://notepad-plus-plus.org/download/v6.6.8.html">Windows</a>) or TextMate (<a href="http://macromates.com/download">MAC</a>) installed</li><li>snack or lunch</li></ul><p><em><strong>Please Note: a parent is to supervise if a participant is aged under 15 years.</strong></em></p>', 'info@coderdojobrisbane.com.au', 'http://coderdojobrisbane.com.au', 'CoderDojoBNE', NULL, NULL, NULL, 0, NULL, NULL, 0, 'au/queensland/brisbane/brisbane-square-library-web-development', 'OC', 'AU', 'AUS', 'Brisbane Square Library, 266 George Street, Brisbane City QLD 4000', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '2174003', 'Brisbane', NULL);
