INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fce7b-f3f9-11e4-910d-080027c336f0', 618, NULL, 'Cesena, @Wizards of Python', 'df75b87c-f3f9-11e4-910d-080027c336f0', '2014-01-16 13:59:16+00', '2014-01-22 13:47:19+00', '3006', 1, 0, 2, 0, '26 Gennaio 2015, orario: 15-17', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Forlì-Cesena"}', '{"toponymName":"Emilia-Romagna"}', '{"toponymName":"Cesena"}', '{"name":"Cesena","geonameId":"3178957"}', '44.13967,12.24036000000001', '{"lat":44.13967,"lon":12.24036000000001}', '<h4>A chi si rivolge</h4><ul><li>A tutti i ragazzi e ragazze che desiderino imparare a programmare utilizzando il linguaggio di programmazione Python (il migliore!) per scrivere programmi, compresi semplici (per ora!) videogiochi e realizzare progetti basati sull&#39;uso della scheda Raspberry PI</li><br /><li>L&#39;et&agrave; di riferimento &egrave; compresa fra i 9-12 anni, senza escludere la possibilit&agrave; che ragazzi e ragazze di 8 oppure 13 anni possano comunque partecipare ad alcune attivit&agrave; (chiedere per informazioni)</li></ul><h4>Svolgimento delle attivit&agrave;</h4><ul><li>Le attivit&agrave; si svolgeranno presso la sede di <strong>Cesenalab - idee per crescere</strong></li><br /><li>Ad ogni incontro, oltre al docente di riferimento dell&#39;attivit&agrave;, sar&agrave; presente un gruppo di mentor che avranno la funzione di tutor nei confronti dei ragazzi e ragazze partecipanti</li><br /><li>La parte principale delle attivit&agrave; sar&agrave; basata sull&#39;intoduzione al linguaggio di programmazione Python, con il quale contiamo di sviluppare semplici videogiochi basati sulla libreria grafica pygame.</li><br /><li>Successivamente passeremo ad utilizzare la scheda Raspberry PI per realizzare semplici progetti per leggere i valori registrati da alcuni sensori (es: temperatura, umidit&agrave;, distanza di un oggetto, ecc) e scrivere programmi in grado di elaborarli</li></ul><h4>Cosa portare</h4><ul><li>ogni partecipante dovr&agrave; portare con s&eacute; <strong>il proprio portatile</strong>. Viste le risorse minime necessarie per utilizzare Python e Pygame non &egrave; richiesto un portatile particolarmente veloce e dotato delle ultime versioni dei sistemi operativi pi&ugrave; diffusi.</li><li><strong>NOTA</strong>: nella sezione <strong><a target="_blank" href="http://wizardsofpython.it/installazioni/">Installazioni</a></strong> del sito &egrave; possibile seguire un semplice tutorial per installare i programmi necessari anche da soli.</li><br /><li>un quaderno (qualunque formato) e penna/matita/gomma</li><br /><li><strong>Un genitore</strong> che dovr&agrave; essere presente per tutto il tempo. Nel caso si formino piccoli gruppi di 2/3 ragazzi e ragazze che per motivi organizzativi provengono da localit&agrave; vicine, &egrave; prevista la possibilit&agrave; per il genitore accompagnatore di supervisionare l&#39;attivit&agrave; del gruppo cos&Iuml; formato.</li></ul><h4>Come iscriversi</h4><ul><li>Le iscrizioni si possono effettuare utilizzando il modulo <a target="_blank" href="http://wizardsofpython.it/iscrizioni/"><strong>Iscrizioni</strong></a> (in alternativa &egrave; possibile utilizzare il modulo <strong><a target="_blank" href="http://wizardsofpython.it/richiesta-di-informazioni/">Contatti</a></strong> per qualsiasi richiesta di informazioni)</li></ul><p>&nbsp;</p>', 'info@wizardsofpython.it', 'http://www.wizardsofpython.it', 'WizardsOfPython', NULL, NULL, 'http://www.cesenalab.it/Public/CesenaLab/PhotoGallery/b215ee7f-8509-4e5f-b417-3693f6da6f3b/blog-pronti-per-l-inaugurazione_5.jpg', 0, NULL, NULL, 0, 'it/emilia-romagna/cesena/cesena-wizards-of-python', 'EU', 'IT', 'ITA', 'Cesenalab - Via Martiri della Libertà 14/c, Cesena', NULL, 380, 'Italy, Italian Republic', '05', 'Emilia-Romagna', '', '', '', '', '', '', '3178957', 'Cesena', NULL);
