INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f199e-f3f9-11e4-910d-080027c336f0', 199, NULL, 'CoderDojo Cebu', 'df748ff6-f3f9-11e4-910d-080027c336f0', '2012-09-20 01:30:09+00', NULL, NULL, 0, 0, 0, 0, 'Saturday, Sept 22, 1pm to 5pm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>A laptop with Linux. Borrow one from someone if needs be. A few will be provided, first come, first serve.</li><li>Positive, open-minded and ready-to-learn self.</li></ul>', 'coderdojo@markjeee.com', NULL, 'CoderDojoCebu', 'https://groups.google.com/group/coderdojocebu', NULL, NULL, 1, NULL, NULL, 0, 'ph/coderdojo-cebu', 'AS', 'PH', 'PHL', 'UP TBI Training Room, UP Cebu, Lahug', NULL, 608, 'Philippines, Republic of the', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9072ca-f3f9-11e4-910d-080027c336f0', 836, NULL, 'TinkerMill', 'df769164-f3f9-11e4-910d-080027c336f0', '2014-06-04 18:30:10+00', NULL, NULL, 0, 0, 0, 0, 'Wednesdays at 7p', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Bring a laptop (if you have one) and any questions or ideas you have. &nbsp;</li><li><p>Have a problem you want to write a program to solve? Bring it and we can work over it.</p></li><li><p><span>Have a a task at work you want to automate? Bring it in (you might be amazed at what you can do with power Shell or Unix shell scripting).</span></p></li><li><p><span>Have an idea, and don&#39;t know where to start? great, bring that too.</span></p></li></ul>', 'info@tinkermill.org', 'http://www.tinkermill.org', 'tinkermill', 'http://www.meetup.com/LongmontHackerSpace/', NULL, NULL, 0, NULL, NULL, 0, 'us/tinkermill', 'NA', 'US', 'USA', 'TinkerMill', NULL, 840, 'United States of America', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fb8a7-f3f9-11e4-910d-080027c336f0', 552, NULL, 'Brugge', 'df75757f-f3f9-11e4-910d-080027c336f0', '2013-11-26 18:51:10+00', '2013-12-20 12:29:31+00', '3006', 1, 0, 2, 0, 'monthly, Saturday, 10am-1pm', '{"countryName":"Belgium","geonameId":"2802361","alpha2":"BE"}', '{"toponymName":"West Flanders Province"}', '{"toponymName":"Flemish"}', '{}', '{"name":"Sint-Pieters op de Dijk","geonameId":"2786558"}', '51.2299337,3.202841600000056', '{"lat":51.2299337,"lon":3.202841600000056}', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'brugge@coderdojobelgium.be', 'http://www.coderdojobelgium.be', 'coderdojobe', NULL, '7679512629', NULL, 0, NULL, NULL, 0, 'be/flemish/sint-pieters-op-de-dijk/brugge', 'EU', 'BE', 'BEL', 'vdab werkwinkel, Sint-Michiels (Brugge) 1 Koning Albert I-laan 8000 Brugge', NULL, 56, 'Belgium, Kingdom of', 'VLG', 'Flemish', '', '', '', '', '', '', '2786558', 'Sint-Pieters op de Dijk', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90752a-f3f9-11e4-910d-080027c336f0', 843, NULL, 'Leon', 'df769269-f3f9-11e4-910d-080027c336f0', '2014-06-10 15:45:37+00', '2014-06-23 13:57:23+00', '3006', 1, 1, 2, 0, 'Viernes 18-20h', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Leon"}', '{"toponymName":"Castille and León"}', '{"toponymName":"Santovenia de la Valdoncina"}', '{"name":"Ribaseca","geonameId":"3111814"}', '42.54279495546807,-5.586188983917282', '{"lat":42.54279495546807,"lon":-5.586188983917282}', '<ul><li>Es un club de programadores, ni un taller, ni un curso...queremos crear una comunidad de ni&ntilde;os, y que entiendan por que es importante colaborar.</li><li>Los eventos de CoderDojo Leon seran itinerantes, tratando de implicar a varios lugares en la ciudad de Leon.</li><li>Trata de llevar tu propio portatil. Tener un entorno de trabajo controlado es la mejor manera de codificar. Si no puedes acceder a uno, comentanoslo y trataremos de solucionarlo.</li><li>Debes venir acompa&ntilde;ado de un adulto si eres menor de 12 a&ntilde;os. En ni&ntilde;os mayores ser&aacute; necesaria una autorizaci&oacute;n para permanecer durante lo que dure el evento.</li><li>Todos los eventos ser&aacute;n publicados a traves de nuestra pagina web.</li></ul>', 'coderdojoleon@gmail.com', 'http://coderdojoleon.wordpress.com', 'coderdojoleon', NULL, NULL, NULL, 0, NULL, NULL, 0, 'es/castille-and-leon/ribaseca/leon', 'EU', 'ES', 'ESP', 'Varios lugares, mira en nuestra web.', NULL, 724, 'Spain, Kingdom of', '55', 'Castille and León', '', '', '', '', '', '', '3111814', 'Ribaseca', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f67a0-f3f9-11e4-910d-080027c336f0', 414, NULL, 'Pavia', 'df752f3a-f3f9-11e4-910d-080027c336f0', '2013-07-26 07:38:36+00', '2013-12-01 14:25:26+00', '3006', 1, 1, 1, 0, 'Sabato mattina, quindicinalmente http//coderdojo.compvter.it', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Pavia"}', '{"toponymName":"Lombardy"}', '{"toponymName":"San Martino Siccomario"}', '{"name":"Bivio Cava Manara","geonameId":"9036155"}', '45.143183,9.119725', '{"lat":45.143183,"lon":9.119725}', '<p>Ti sono piaciuti i <a href="http://compvter.blogspot.it/search/label/kids">comPVter KIDS?</a><br />Bene, adesso andiamo oltre: hai voglia di imparare a programmare con i tuoi amici?<br />Conoscere cosa puoi fare con <strong>Scratch</strong>, come fare una <strong>App </strong>per il tuo telefono o come creare un sito?<br />Ti aspettiamo!!<br />Porta con te:</p><ul><li>un genitore (molto importante!)</li><li>un computer portatile</li><li>una merenda<br />Nel caso tu non avessi un computer faccelo sapere: se possibile te ne presteremo uno, oppure potrai lavorare assieme ad un altro coder!<br /><br />Happy coding! ;)<br /><br />Per maggiori informazioni visita il <a href="http://coderdojo.compvter.it">nostro sito</a>.</li></ul>', 'coderdojopv@compvter.it', 'http://coderdojo.compvter.it', 'CoderDojoPavia', NULL, '7638834961', 'https://dl.dropboxusercontent.com/u/383533/Sede risistemazione 2013/CoderDojo2.jpg', 0, NULL, NULL, 0, 'it/lombardy/bivio-cava-manara/pavia', 'EU', 'IT', 'ITA', 'presso comPVter (www.compvter.it), via gramsci 30, San Martino Siccomario (PV)', NULL, 380, 'Italy, Italian Republic', '09', 'Lombardy', '', '', '', '', '', '', '9036155', 'Bivio Cava Manara', NULL);
