roma', '16099236249', 'http://codeweekeu.s3.amazonaws.com/event_picture/HP_DOJO_Roma.png', 0, NULL, NULL, 0, 'it/latium/cecchignola/eur-roma-hp', 'EU', 'IT', 'ITA', 'Via Achille Campanile, 85 00143 - Roma, ITALY', NULL, 380, 'Italy, Italian Republic', '07', 'Latium', '', '', '', '', '', '', '3179242', 'Cecchignola', NULL);
