cQ_ksI7tYfHdRo1sIY7uFpWiU-kBjpSH7lbMgIQ-uw57n3CBG33', 0, NULL, NULL, 0, 'ro/timis/timisoara/timisoara-aci', 'EU', 'RO', 'ROU', 'Str. Pestalozzi 33, Timisoara', NULL, 642, 'Romania', '36', 'Timiş', '', '', '', '', '', '', '665087', 'Timişoara', NULL);
