INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f306e-f3f9-11e4-910d-080027c336f0', 252, NULL, 'Salzburg', 'df74c93c-f3f9-11e4-910d-080027c336f0', '2013-02-24 10:38:14+00', '2013-12-01 14:25:28+00', '3006', 1, 1, 4, 0, 'Samstag, 6.April 2013', '{"countryName":"Austria","geonameId":"2782113","alpha2":"AT"}', '{"toponymName":"Salzburg Stadt"}', '{"toponymName":"Salzburg"}', '{"toponymName":"Salzburg"}', '{"name":"Itzling","geonameId":"2775164"}', '47.82299045985614,13.040417432785034', '{"lat":47.82299045985614,"lon":13.040417432785034}', '<p>Derzeit sind keine weiteren Veranstaltungen geplant.</p><p>Seit April 2013 machen wir ca. alle 4 Wochen ein CoderDojo. Mentor/innen gesucht! http://blog.coderdojo-salzburg.at/</p>', 'brigitte.jellinek@fh-salzburg.ac.at', 'http://blog.coderdojo-salzburg.at/', NULL, 'https://plus.google.com/communities/114158974240464362369', NULL, 'http://webdevsalzburg.multimediatechnology.at/wp-content/uploads/2013/02/salzburg-web-dev-meetup.png', 0, NULL, NULL, 0, 'at/salzburg/itzling/salzburg', 'EU', 'AT', 'AUT', 'derzeit: Coworkingspace Salzburg', NULL, 40, 'Austria, Republic of', '05', 'Salzburg', '', '', '', '', '', '', '2775164', 'Itzling', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f1b56-f3f9-11e4-910d-080027c336f0', 207, NULL, 'Navan', 'df749c97-f3f9-11e4-910d-080027c336f0', '2012-10-01 16:54:13+00', '2013-12-01 14:25:28+00', '3006', 1, 1, 2, 0, '10:00 - 12:30 and 2:00 - 4:30 second Saturday of each month.', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Navan","geonameId":"2962308"}', '53.669911,-6.698629', '{"lat":53.669911,"lon":-6.698629}', '<a href="http://www.flickr.com/photos/coderdojonavan/8538541361/" title="ZenImage by CoderDojoNavan, on Flickr"><img src="http://farm9.staticflickr.com/8110/8538541361_e3b08ed6e5.jpg" width="491" height="180" alt="ZenImage"></a><br><br> <p> <b><font color=#21610B>CoderDojo Navan</font></font></b> is a cool, free environment where kids can learn how to program, build websites, animated characters and games with different software programs and languages.<br>All the mentors are volunteers who either teach or work in IT and our aim is to help you develop the skills you like.<br> Currently, we are teaching beginners, intermediate and advanced <b>Scratch.</b> We also teach <b>HTML/CSS, JavaScript</b> and <b>App Inventor.</b><br><br> <b><font color=#FF0000>If you are a parent with IT skills, we are always looking for mentors! Please chat with a current mentor to find out more.</font></b><br><br> <b>Some details on our sessions:</b></p> <ul> <li>We meet on second Saturday of each month.</li><br> <li>Booking ahead is essential. Tickets are available at <a href="http://coderdojonavan.eventbrite.ie"><b><font color=#0000FF>Eventbrite</font></b></a></li><br> <li>There are two sessions: Morning 10:00 to 12:30 and Afternoon 2:00 to 4:30</li><br> <li><b>Every child must have a parent or adult in charge!</b></li><br> <li>Person must stay with child during the session (helping if possible)</li><br> <li>CoderDojo Navan is supported by Unity Centre, Navan</li><br> <li>Click here to visit our website for latest information and assignment sheets in advance of the upcoming session: <a href="http://coderdojonavan.wordpress.com"><b><font color=#0000FF>CoderDojo Navan</font></b></a></li><br> <li>Check out our Facebook page: <a href="http://facebook.com/coderdojonavan"><b><font color=#0000FF>CoderDojo Navan on Facebook</font></b></a><br><br> <b><i>What you need to bring:</i></b></li> <ol> <li>Please bring a WIFI enabled laptop, fully charged if possible</li><br> <li>Please install Scratch 2.0 offline editor on your laptop - you can get it <a href="http://scratch.mit.edu/scratch2download"><b><font color="#FF0000">Here</font></b></a></li><br><li>We suggest you bring your own mouse to create graphics as the mouse pad on a laptop can be difficult to use as a drawing device. We suggest you install DrawPlus SE (Starter Edition) which is a free vector drawing and exporting package. You can get it <a href="http://www.freeserifsoftware.com"><b><font color="#FF0000">Here</font></b></a>.</li><br> <li>Also, we think it would be a good idea to bring a USB key to save your work</li><br> <li>Bring a snack and a drink for the interval</li><br> <li>If you are new to CoderDojo Navan, you can pre-register as a member by downloading our registration form <a href="http://coderdojonavan.wordpress.com/2013/01/29/registration-form-for-coderdojo-navan/"><b><font color="#FF0000">Here</font></b></a>, fill out and present it to a mentor<br> when you arrive</li><br> </ol></ul> <p><h4><font color=#21610B>Happy Coding!</font></h4></p>', 'coderdojonavan@gmail.com', 'http://coderdojonavan.wordpress.com', 'CoderDojoNavan', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/leinster/navan/navan', 'EU', 'IE', 'IRL', 'Unity Centre, Windtown, Navan, Co. Meath', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2962308', 'Navan', NULL);
