93715/Formular-De-Inscriere-Coder-Dojo-Mosnita-Noua">www.123contactform.com/form-1093715/Formular-De-Inscriere-Coder-Dojo-Mosnita-Noua</a></p>', 'contact@promosnita.ro', 'https://www.facebook.com/CoderDojoMosnita', NULL, NULL, NULL, 'http://www.promosnita.ro/images/cd_mosnita.jpg', 0, NULL, NULL, 0, 'ro/timis/mosnita-noua/mosnita-noua', 'EU', 'RO', 'ROU', 'Strada Școlii Moșnița Nouă 307285, Romania', NULL, 642, 'Romania', '36', 'Timiş', '', '', '', '', '', '', '672809', 'Moşniţa Nouă', NULL);
