nue.</strong> Feel free to bring a snack/dinner for yourself or to share. &nbsp;Pizza and drinks provided by On-site.com!</p>', 'office@coderdojosv.org', 'http://www.coderdojosv.com', 'coderdojosv', NULL, NULL, 'http://upload.wikimedia.org/wikipedia/en/2/2c/OnSite_logo.png', 0, NULL, NULL, 0, 'us/california/campbell/silicon-valley-campbell', 'NA', 'US', 'USA', 'Orchard City Drive Campbell, CA 95008', NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '5333689', 'Campbell', NULL);
