INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df909901-f3f9-11e4-910d-080027c336f0', 868, NULL, 'South Bay', 'df769e39-f3f9-11e4-910d-080027c336f0', '2014-06-28 05:58:43+00', '2014-07-04 10:11:24+00', '3006', 1, 0, 2, 0, 'One Saturday/Month @ 10am-12pm or 2-4pm.  Please check calendar for exact time/date.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Los Angeles County"}', '{"toponymName":"California"}', '{}', '{"name":"Redondo Beach","geonameId":"5386785"}', '33.8461246,-118.38810319999999', '{"lat":33.8461246,"lon":-118.38810319999999}', '<p><strong>What to Bring:</strong></p><ul><li>A ticket (must pre-register).</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 13 or under, your parent must stay with you at the session.</strong></li></ul><p><strong>Who Can Attend:</strong></p><ul><li>We generally have a maximum limit of 30 beginner kids and 30 advanced programming level kids, so please pre-register to guarantee a place! &nbsp;Occasionally, we may need to limit numbers further depending on the location.&nbsp;</li><li>We require a parent or guardian to accompany 13s and under partially to keep an eye on their equipment, partially to keep an eye on their charges and partially to learn along with them. Parents and students can eventually become mentors (hey, the kids have come up with far more elegant solutions for some problems).</li><li>Very young kids may not get much out of it, but we frequently have 1st Graders, though the majority are 4th &amp; 5th Graders. It&#39;s thought that programming should be done in schools, or at least programmatic thinking, just after long division as it&#39;s the first abstract algorithm most kids encounter. We do often have younger siblings of kids in the dojo who watch on or play on other computer devices, in preparation for future coding genius.</li><li>There will be a lot of typing, and some file management. A LOT of typing and keyboarding skills.</li></ul><p><strong>When &amp; Where Is It?</strong></p><p>One Saturday/Month @ 10am-12pm or 2-4pm. &nbsp;Our main base is at the <a href="http://redondo.org/depts/library/default.asp">Redondo Beach Public Library</a> but we have events hosted at many corporate locations around the South Bay &amp; beyond! Please check <a href="https://sites.google.com/site/coderdojosouthbay/calendar">Website Calendar</a> for exact dates, times &amp; locations or reference the Eventbrite ticket.</p><p><strong>Cost: Free!</strong></p><p>The venue and utilities are provided to us at no charge and mentors donate their time so that we can provide this opportunity for kids at no charge.</p><p><strong>Topics We Cover at the Moment Include:</strong></p><ul><li>Scratch&nbsp;<a href="http://scratch.mit.edu">http://scratch.mit.edu</a></li><li>HTML/CSS/Javascript (Web Frontend).</li><li>Other topics will be presented depending on what mentors are around on the day. If there is anything in particular that you or the kids would like to cover, let us know.</li></ul>', 'info@CoderDojoSouthBay.com', 'http://www.CoderDojoSouthBay.com', 'CoderDojoSB', NULL, NULL, 'http://redondo.org/img/headers/logo.gif', 0, NULL, NULL, 0, 'us/california/redondo-beach/south-bay', 'NA', 'US', 'USA', 'Redondo Beach Public Library; Manhattan Beach and other Los Angeles South Bay locations.  Reference Eventbrite ticket for exact address and building location.', NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '5386785', 'Redondo Beach', NULL);
