INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f48d0-f3f9-11e4-910d-080027c336f0', 296, NULL, 'Zambrów', 'df74e5d0-f3f9-11e4-910d-080027c336f0', '2013-03-25 08:26:07+00', '2013-12-01 14:25:28+00', '3006', 1, 1, 1, 0, '9:00-12:00', '{"countryName":"Poland","geonameId":"798544","alpha2":"PL"}', '{"toponymName":"Powiat zambrowski"}', '{"toponymName":"Podlasie"}', '{"toponymName":"Zambrów"}', '{"name":"Zambrów","geonameId":"753895"}', '52.98605,22.24718', '{"lat":52.98605,"lon":22.24718}', '<p>Spotykamy się w sali konferencyjnej. Na Dojo nie gramy i nie oglądamy film&oacute;w YouTube o ile nie jest to związane z tworzeniem własnej pracy.</p><p>Jeśli możesz - przynieś sw&oacute;j komputer, jeśli nie możesz - przyjdź mimo wszystko, mamy kilka komputer&oacute;w do wypożyczenia.</p>', 'dojo@coderdojo.org.pl', 'http://zambrow.coderdojo.org.pl', 'CoderDojoPL', NULL, NULL, NULL, 0, NULL, NULL, 0, 'pl/podlasie/zambrow/zambrow', 'EU', 'PL', 'POL', 'Zambrow, Miejski Osrodek Kultury, ul. Wyszynskiego 2a', NULL, 616, 'Poland, Republic of', '81', 'Podlasie', '', '', '', '', '', '', '753895', 'Zambrów', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fee8e-f3f9-11e4-910d-080027c336f0', 704, NULL, 'Parma', 'df75605f-f3f9-11e4-910d-080027c336f0', '2014-03-01 11:19:26+00', '2014-03-11 10:06:51+00', '3006', 1, 1, 4, 0, 'Sabato 15 Marzo, 15:00 - 18:00', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Province of Parma"}', '{"toponymName":"Emilia-Romagna"}', '{"toponymName":"Sorbolo"}', '{"name":"Sorbolo","geonameId":"3166374"}', '44.8471391,10.44488720000004', '{"lat":44.8471391,"lon":10.44488720000004}', '<h2><strong>Che cos&#39;&egrave; CoderDojo?</strong></h2><p>I CoderDojo sono laboratori / club di programmazione gratuiti e aperti a bambini e ragazzi, qui a Bologna partiremo dedicandoci alla fascia d&#39;et&agrave; 7-13.</p><p>Gli eventi si tengono con cadenza periodica, cominceremo con uno al mese. Indicativamente fisseremo gli incontri il sabato pomeriggio, ma potremmo decidere di spostarli la mattina in base alle esigenze dei ragazzi.</p><h2><strong>Cosa si fa durante un evento?</strong></h2><p>Impareremo a utilizzare&nbsp;<a href="http://scratch.mit.edu/">Scratch</a>&nbsp;per creare i nostri primi programmi e semplici videogiochi.</p><p>L&#39;evento dura circa 3 ore, nella prima parte uno dei mentor spiegher&agrave; a tutti il funzionamento di Scratch attraverso un esempio che i bambini riprodurranno sui propri computer, supportati dagli altri mentor. Nella seconda parte, dopo la merenda, i ragazzi saranno liberi di continuare a personalizzare il proprio gioco o crearne un altro sulla base di quello che hanno imparato.</p><h2><strong>Che cosa bisogna portare?</strong></h2><p>Un portatile per ogni bambino (windows, mac, ubuntu), possibilmente con&nbsp;<a href="http://scratch.mit.edu/download">Scratch</a>&nbsp;gi&agrave; installato</p><p>Una merenda</p><p>Un genitore/accompagnatore</p><h2><strong>Come ci si iscrive?</strong></h2><p>E&#39; possibile effettuare la registrazione tramite Eventbrite a questo indirizzo:&nbsp;<a href="http://www.eventbrite.it/e/registrazione-coderdojo-parma-sorbolo-15-marzo-10781280099">http://www.eventbrite.it/e/registrazione-coderdojo-parma-sorbolo-15-marzo-10781280099</a></p><p>News:&nbsp;<strong>Per l&#39;evento dell&#39;15 Marzo mancano pochi posti!</strong></p><p>Visto l&#39;entusiasmo, organizzeremo il 5 aprile a Sorbolo un altro evento!</p><h2><strong>Hai bisogno di altre informazioni?</strong></h2><p>Contattaci su coderdojoparma@gmail.com, cercheremo di risponderti al pi&ugrave; presto!</p><h3>Above all, be cool! ;)</h3>', 'info@coderdojoparma.it', 'http://www.coderdojoparma.it', 'CoderDojoParma', 'https://groups.google.com/forum/#!forum/coderdojo-parma', '10781280099', NULL, 1, '2378', '2014-03-27 22:04:06+00', 0, 'it/emilia-romagna/sorbolo/parma', 'EU', 'IT', 'ITA', 'Via Gruppini 4, Sorbolo 43058 Italy', NULL, 380, 'Italy, Italian Republic', '05', 'Emilia-Romagna', '', '', '', '', '', '', '3166374', 'Sorbolo', NULL);
