INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fea5e-f3f9-11e4-910d-080027c336f0', 689, NULL, 'Eastpoint, @FINEOS', 'df75cd48-f3f9-11e4-910d-080027c336f0', '2014-02-19 10:48:05+00', '2014-05-16 13:17:42+00', '3006', 1, 0, 0, 0, 'Saturday, Monthly, 2pm to 4pm (Please email for more information)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"North Strand","geonameId":"6691025"}', '53.35779245478704,-6.227738969867005', '{"lat":53.35779245478704,"lon":-6.227738969867005}', '<p>FINEOS Coderdojo is a fun and open learning environment for kids aged 6 to 17, teaching kids to code through fun projects in Scratch, HTML, PhP etc.</p><p>Please contact via eastpoint.ie@coderdojo.com for information.&nbsp;</p><p>Attendees must observe the following:</p><ul><li>A valid eventbrite ticket for the event is required (will be notified by email when tickets are available)</li><li>A pack lunch or snack. Some refreshments are provided.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). All attendees must have a parent or guardian present</strong></li></ul><p>FINEOS is a Global Technology Leader in the Group Life and Health insurance industry. Six of the top 20 Group Life and Health insurance carriers in the USA use FINEOS, as well as 3 of the top 15 insurance carriers in Canada and 3 of the top 5 Life and Health insurance carriers in Australia.<br />&nbsp;</p>', 'eastpoint.ie@coderdojo.com', NULL, 'CoderdojoFineos', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/north-strand/eastpoint-fineos', 'EU', 'IE', 'IRL', 'Eastpoint Business Park, Dublin 3', NULL, 372, 'Ireland', '', '', '', '', '', '', '', '', '6691025', 'North Strand', NULL);
