trong></li></ul><p><strong>​For further information, please contact us:</strong></p><p>coderdojoadmin@springvalelearning.com</p>', 'CoderDojoAdmin@springvalelearning.com', 'http://www.springvalelearning.com', 'SpringvaleLearn', NULL, '10644703595', NULL, 0, NULL, NULL, 0, 'gb/northern-ireland/springfield/springvale-coderdojo', 'EU', 'GB', 'GBR', 'Springvale, 200 Springfield Road, Belfast. BT12 7DR', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'NIR', 'Northern Ireland', '', '', '', '', '', '', '2637195', 'Springfield', NULL);
