INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ece5f-f3f9-11e4-910d-080027c336f0', 50, NULL, 'Maynooth', 'df740436-f3f9-11e4-910d-080027c336f0', '2012-03-10 02:16:39+00', '2013-12-01 14:25:30+00', '3006', 1, 0, 2, 0, 'Thursdays, 5pm-7pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Maynooth","geonameId":"2962668"}', '53.382790822565,-6.602343320846558', '{"lat":53.382790822565,"lon":-6.602343320846558}', '<p>What to bring:</p><ul><li>We have computers for everyone to use but you can bring your laptop if you wish.</li><li>A parent/guardian over 18 who can stay from 5pm until 7pm (if you are 12 or younger - very important!)</li></ul><p>We have a new Registration process in place and if you wish to attend then you must fill in the online form prior to attending. The form can be found at http://www.cs.nuim.ie/forms/coderdojosignup</p><p>Note: If you registered for the 2013 N.U.I Maynooth CoderDojo you are still required to register online if you wish to attend the 2014 N.U.I Maynooth CoderDojo</p><p><strong>Notes </strong></p><p>If coming by car, note that parking charges and restrictions at NUI Maynooth don&#39;t apply from 5pm so you can park for free in any parking space without needing a ticket or pass. We recommend you park in car park 1, which is the first car park on entering campus from the Kilcock Road. This is just across the road from the Callan Building where CoderDojo is held.</p><p>Chill cafe, adjacent to car park 1, will be open until after 7pm for participants/parents.</p>', 'coderdojo@cs.nuim.ie', NULL, 'coderdojomaynoo', 'http://groups.google.com/group/coderdojo-maynooth', NULL, 'http://www.cs.nuim.ie/sites/default/files/styles/large/public/NUIMsentenial-IE6.jpg', 0, NULL, NULL, 0, 'ie/leinster/maynooth/maynooth', 'EU', 'IE', 'IRL', 'Place: Computer Science Software Lab 4 at NUI Maynooth (ground floor, Callan Building, North Campus, Kilcock Road, Maynooth)', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2962668', 'Maynooth', NULL);
