INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fcc3a-f3f9-11e4-910d-080027c336f0', 608, NULL, 'Milton Keynes', 'df7582f9-f3f9-11e4-910d-080027c336f0', '2014-01-13 15:20:42+00', '2014-05-16 12:40:28+00', '3006', 1, 0, 0, 0, 'Due to begin in September/October 2014', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Milton Keynes"}', '{"toponymName":"England"}', '{"toponymName":"Shenley Church End"}', '{"name":"Shenley Church End","geonameId":"2638049"}', '52.019,-0.811', '{"lat":52.019,"lon":-0.811}', '<ul><li><strong>PARENTS: please remember that your childs safety is paramount. All those teachers and mentors will have been CRB checked prior to starting.</strong></li><li><strong>A laptop or Raspberry Pi (10 Pi&#39;s supplied by Google). If you don&#39;t have one don&#39;t worry..</strong></li><li><strong>Parents are most welcome in helping of the running of the CoderDojo! &nbsp;If you are 11 or under and not from The Hazeley Academy, your parent must introduce you and collect you for each session.</strong></li><li><strong>We are always looking out for mentors who can code! Particularly from the business sector of the local cummunity - so if you can code (even a little!) please join in.</strong></li></ul>', 'miltonkeynes.gb@coderdojo.com', 'http://t.b.c.', 'MKCoderDojo', 'http://t.b.c.', 'watch this space', NULL, 0, NULL, NULL, 0, 'gb/england/shenley-church-end/milton-keynes', 'EU', 'GB', 'GBR', 'The Hazeley Academy, Emporor Drive, Grange Farm, MILTON KEYNES. Bucks. MK8 0PT', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2638049', 'Shenley Church End', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90e56e-f3f9-11e4-910d-080027c336f0', 1061, NULL, 'Villari''s Martial Arts Center - Newington', 'df76ef3a-f3f9-11e4-910d-080027c336f0', '2014-11-09 20:29:39+00', NULL, NULL, 0, 0, 0, 0, 'Mon 2pm - 9pm, Tue 12pm - 9pm, Wed 2pm - 9pm, Thu 12pm - 9pm, Fri 3pm - 8pm, Sat 9am - 2 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Hartford County"}', '{"toponymName":"Connecticut"}', '{}', '{"name":"Newington","geonameId":"4839497"}', '41.6885973,-72.70712850000001', '{"lat":41.6885973,"lon":-72.70712850000001}', '<div>Our Mission - To help every individual we teach, reach their personal goals, realize their full potential, and achieve Black Belt excellence.</div><div><div><strong>Description</strong></div><div>At Villari&#39;s of Newington, our professional martial arts instructors help develop self-confidence, self-esteem, and respect for students of all ages and abilities.&nbsp;<br /><br />Whether we&rsquo;re helping your child develop coordination and self-discipline or helping you manage your health and relieve stress, Villari&rsquo;s opens our arms to students of all skill levels! We use our Shaolin Kempo Karate system to incorporate mind, body, and spirit as we strengthen students.&nbsp;<br /><br />Villari&rsquo;s believes that effective self-defense requires not only good physical technique, but confidence as well. That&rsquo;s why we use positive reinforcement techniques and goal setting to help our students develop a strong self-image.&nbsp;<br /><br />Our classes are grouped based on age and ability with varied focuses at all levels. Students as young as three years old are taught coordination and discipline by professional martial arts instructors while adult group classes concentrate on physical fitness in a positive and fun atmosphere!<br /><br />Whatever your age or skill level, Villari&rsquo;s of Newington can help you master good health and confidence!</div></div><div><div><strong>General Information</strong></div>Villari&#39;s of Newington is a full time, professional Martial Arts school with over 20 years of service to the Newington area. We specialize in separate classes for all age groups and ability levels with an emphasis on self defense and character development through self discipline, respect and self control.</div>', 'NewingtonCt@VillariStudios.com', 'http://www.villaristudios.com/newington-ct/', 'Villaris_NCT', 'https://plus.google.com/u/0/b/102348510377939594484/+VillarisMartialArtsCenterNewington/about', NULL, NULL, 0, NULL, NULL, 0, 'us/connecticut/newington/villaris-martial-arts-center-newington', 'NA', 'US', 'USA', '2303 Berlin Turnpike, Newington, CT 06111', NULL, 840, 'United States of America', 'CT', 'Connecticut', '', '', '', '', '', '', '4839497', 'Newington', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90bd99-f3f9-11e4-910d-080027c336f0', 954, NULL, 'Covent Garden London @ Dragon Hall Tech Hub', 'df76ce03-f3f9-11e4-910d-080027c336f0', '2014-09-17 09:42:50+00', '2014-09-26 13:21:10+00', '4124', 1, 0, 2, 0, '14/03/2015 2-5pm every month', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Camden"}', '{"name":"Holborn","geonameId":"2646781"}', '51.516893,-0.12259310000001733', '{"lat":51.516893,"lon":-0.12259310000001733}', '<p><strong>We&#39;re off again! March 14th&nbsp;</strong></p><p>Come along to learn Scratch, HTML/CSS and more. There are no rules. If you&#39;re under 17 and would like some help with learning to code please register to come along. It&#39;s free for all participants.</p><p>We will have some tasks for you to complete although if you have a project you have been working on and would like some help we are here for you.</p><p>We also have the Kano team with us this session and they &nbsp;will be showing you what you can do with a Kano</p><p>Don&rsquo;t worry if you&rsquo;ve never programmed before, come along and have some fun.</p><p><strong>Create an animation or build a game with Scratch&nbsp;<br />&nbsp;</strong><br />If you already can code then improve your skills.<br /><strong>Build cool stuff, from games to websites to animations to apps</strong>. Meet people like you who are interested in the same sort of things.</p><p>We hope to have a few Raspberry Pi&#39;s and other cool stuff to try</p><p><strong>You will need to bring a laptop</strong>,&nbsp;If you don&#39;t have a laptop or can&#39;t borrow one please email techhub@dragonhall.org.uk as we do have a few.</p><p><strong>If you are under 16 you will need to bring an adult!</strong><br />We welcome all ages and abilities (our main audience is 8 -18 years old, but everyone is invited), however all young people must be accompanied by a responsible adult.<br /><br />The event is completely free but numbers are limited and we do ask that you register&nbsp;and get a ticket at least 24 hours before each meetup so that we can plan for the correct numbers.&nbsp;<br /><br /><strong>What you need to bring:</strong><br /><br />A snack<br /><br />A laptop. Borrow one from someone if needs be.<br /><br />A responsible adult! (Very important). If you are under 16, they must stay with you during the session.</p><p>If you have a project you&#39;ve been working on bring it with you.</p><p>We are always looking for mentors so if you fancy sharing your skills please email techhub@dragonhall.org.uk</p>', 'bookings@dragonhall.org.uk', NULL, NULL, 'http://coder-dojo-london-email@googlegroups.com', '15993166993', NULL, 0, NULL, NULL, 0, 'gb/england/holborn/covent-garden-london-dragon-hall-tech-hub', 'EU', 'GB', 'GBR', 'Dragon Hall Tech Hub 17, Stukeley Street, Covent Garden, London WC2B 5LT', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2646781', 'Holborn', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9166db-f3f9-11e4-910d-080027c336f0', 1293, NULL, 'Sandyford @ Salesforce Dublin', 'df76da9d-f3f9-11e4-910d-080027c336f0', '2015-02-18 11:07:33+00', NULL, NULL, 0, 0, 3, 0, 'Every 2nd Thursday 4.30-6pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Galloping Green","geonameId":"3315285"}', '53.277239, -6.208181', '{"lat":53.277239,"lon":-6.208181}', '<p>&nbsp;</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li>&nbsp;</li><li><strong>A parent! (Very important). If you are 16 or under, your parent must stay with you during the session.</strong></li></ul>', 'ctreacy@salesforce.com', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/leinster/galloping-green/sandyford-salesforce-dublin', 'EU', 'IE', 'IRL', 'Sandyford Industrial Estate, Dublin 18, Ireland,', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '3315285', 'Galloping Green', NULL);
