none, via Stazione 2. Palazzo &quot;De Lorenzi - Brinis&quot;, sede del Progetto Giovani', NULL, 380, 'Italy, Italian Republic', '06', 'Friuli Venezia Giulia', '', '', '', '', '', '', '3180045', 'Casarsa della Delizia', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90c24a-f3f9-11e4-910d-080027c336f0', 968, NULL, 'Barking @Barclays #EagleDojo', 'df76d28e-f3f9-11e4-910d-080027c336f0', '2014-09-22 18:21:21+00', '2014-09-23 10:30:37+00', '4124', 1, 1, 2, 0, 'TBC running on a monthly basis', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Barking and Dagenham"}', '{"name":"Barking","geonameId":"2656333"}', '51.536563,0.0757659999999305', '{"lat":51.536563,"lon":0.0757659999999305}', '<p>&nbsp;</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A P</strong><strong>arent/Carer (Very important). For security and safety your parent or carer must stay with you throughout the session.</strong></li><li>To check availability and to book a place email coderdojo@barclays.com</li></ul>', 'coderdojo@barclays.com', NULL, 'digitaleagles', NULL, NULL, 'http://www.barclays.co.uk/images/barclays.gif', 1, '4351', '2015-01-21 09:46:30+00', 0, 'gb/england/barking/barking-barclays-eagledojo', 'EU', 'GB', 'GBR', 'Barclays, Lemonade Building, Barking', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2656333', 'Barking', NULL);
