INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fe1eb-f3f9-11e4-910d-080027c336f0', 656, NULL, 'Cheadle', 'df75da98-f3f9-11e4-910d-080027c336f0', '2014-02-02 19:36:56+00', '2014-03-27 17:43:31+00', '3006', 1, 1, 2, 0, '3rd Saturday of the month 10:30 to 2:30', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Stockport"}', '{"toponymName":"England"}', '{}', '{"name":"Cheadle","geonameId":"2653291"}', '53.3931097,-2.2169344999999794', '{"lat":53.3931097,"lon":-2.2169344999999794}', '<ul><li>A pack lunch, although there is a cafe in the building.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p>The entrance is on the Massey street car park, Cafe One Entrance, next to the Tesco Express Entrance.</p><p>The sessions are held in Bulkley Room on 2nd floor.&nbsp;</p><h3>&nbsp;</h3>', 'cheadle.coderdojo@gmail.com', 'http://cheadlecoderdojo.org.uk/', 'CheadleCoDojo', 'https://groups.google.com/d/forum/cheadlecoderdojo', '15592202698', NULL, 0, NULL, NULL, 0, 'gb/england/cheadle/cheadle', 'EU', 'GB', 'GBR', 'Upper Room, 11, Wilmslow Road, Cheadle, Cheshire. SK8 1DW', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2653291', 'Cheadle', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f615a-f3f9-11e4-910d-080027c336f0', 391, NULL, 'Brianza', 'df751f2d-f3f9-11e4-910d-080027c336f0', '2013-06-07 13:59:13+00', '2013-12-01 14:25:27+00', '3006', 1, 1, 1, 0, 'sei incontri divisi per gruppi di età a partire dal 1 marzo (controlla sul sito!)', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Monza Brianza"}', '{"toponymName":"Lombardy"}', '{"toponymName":"Vimercate"}', '{"name":"Vimercate","geonameId":"3164083"}', '45.6135291,9.36984259999997', '{"lat":45.6135291,"lon":9.36984259999997}', '<p>Quello che dovrete avere con voi:</p><ul><li>Computer predisposto a navigare in wi-fi (verificate prima facendo un giro in biblioteca!)</li><li><strong>Un genitore! (Importante).</strong></li></ul><p>Mentre i ragazzi si esercitano con il coding, i genitori parteciperanno a un momento di scambio e discussione su privacy online, nuove tecnologie e possibili nuovi sviluppi, copyright e copyleft, ecc. ecc.</p><p>&nbsp;</p><p>&nbsp;</p>', 'giovanni@campuslacamilla.it', 'http://www.campuslacamilla.it', 'coderdojobza', NULL, '10579510601', 'https://pbs.twimg.com/profile_images/431015362612576256/Y2ZUvb55_400x400.jpeg', 0, NULL, NULL, 0, 'it/lombardy/vimercate/brianza', 'EU', 'IT', 'ITA', 'Piazza Unita` d''Italia 2g 20871 Vimercate (MB)', NULL, 380, 'Italy, Italian Republic', '09', 'Lombardy', '', '', '', '', '', '', '3164083', 'Vimercate', NULL);
