INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df916837-f3f9-11e4-910d-080027c336f0', 1299, NULL, 'Singleton, W.A.,@Singleton Primary School', 'df771651-f3f9-11e4-910d-080027c336f0', '2015-02-19 03:23:40+00', '2015-03-02 17:27:27+00', '4124', 1, 0, 1, 0, 'Thursdays from 3:15 to 4:15 26 Feb to 26 March', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Rockingham"}', '{"toponymName":"Western Australia"}', '{}', '{"name":"Singleton","geonameId":"8348281"}', '-32.4408403,115.75787579999997', '{"lat":-32.4408403,"lon":115.75787579999997}', '<p>Our Dojo is in start up mode and we will need to monitor interest before actively creating online registration. This will be updated/introduced as required. A Facebook Club Page is in development.</p><p>Activities will be run in the Singleton Primary School Library where there are many spaces in which to work.</p><p>Please bring:</p><ul><li>Your XO from your classroom</li><li>Your drink bottle</li><li>A snack</li><li>Your ideas!</li><li>Your parent - so they get to learn about coding as well!</li></ul>', 'singleton.au@coderdojo.com', 'https://www.facebook.com/groups/370885913036188/', NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 'au/western-australia/singleton/singleton-wasingleton-primary-school', 'OC', 'AU', 'AUS', 'Singleton Primary School, Naval Avenue, Singleton, W.A. 6175', NULL, 36, 'Australia, Commonwealth of', '08', 'Western Australia', '', '', '', '', '', '', '8348281', 'Singleton', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8feb96-f3f9-11e4-910d-080027c336f0', 694, NULL, 'Charlestown', 'df755760-f3f9-11e4-910d-080027c336f0', '2014-02-24 16:14:16+00', '2014-02-24 16:33:58+00', '3006', 1, 1, 2, 0, 'Saturdays, 10:00am - 12:00pm - Check EventBrite For Confirmation', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Connaught"}', '{}', '{"name":"Charlestown","geonameId":"2965518"}', '53.961162234029146,-8.799448561668441', '{"lat":53.961162234029146,"lon":-8.799448561668441}', '<ul><li><strong>We teach short courses, between 1 to 3 sessions. </strong>Check the booking info to see what the next session number is. If you miss the first of those sessions then we advise maybe waiting until the next course starts, you won''t have to wait long, only a couple of weeks. <em>We will run some courses twice if demand is there. So for example if you miss ''Beginners Scratch'' (3 week course) on week 1 then we suggest you wait until week 4 when the course will be run again from the beginning.</em></li><li><strong>Only those attending the Dojo need a ticket</strong> - if you''re a parent supervising your child, you don''t need to book a ticket for you, only for your child.</li><li>Book a ticket for each Dojo session you want to attend, a ticket to one session doesn''t apply to the next one. <strong>Use the EventBrite System at the bottom of this page to do so</strong>. You will only be able to book the ticket when event is published. Until then, sit tight!</li><li>You MUST bring your own laptop/macbook. Give it a full charge before coming, as power outlets may be limited. All software used will be free!<strong> Please install Chrome/Firefox/Safari </strong>browsers on Laptops as Internet Explorer does not work great. If you cannot get  hold of a laptop then let us know and we will do our best to get one for you.</li><li>Tickets to CoderDojo Charlestown are FREE, but if you would like to make a donation on the day, all money collected will go back into supplies, venue hire, lunch, etc. for the kids attending. The money will not be used to pay for organisers and mentors - these are volunteers and give of their time freely.</li><li>We can''t take anyone under 7 years old - sorry!</li><li><strong>Children 10 or under AND Children of any age with little to no experience of using a computer MUST be accompanied by an adult for the entire duration of the class.</strong></li><li>Feel free to bring along a packed lunch and a drink.</li><li>Car parking spaces are limited, but there should be plenty of onstreet parking available as the venue is in the town and only a short walk from the town centre.</li><li>This event is run by volunteers and as such please be nice, patient and if you can help with sponsorship, laptops, mentoring or any other aspect please don''t hesitate to contact us!</li><li>CoderDojo has just one rule: “Above All: Be Cool“, bullying, lying, wasting people’s time and so on is uncool.</li></ul>', 'charlestown.ie@coderdojo.com', 'http://charlestowndojo.wordpress.com/', 'CoderDojoCtown', 'https://groups.google.com/forum/?hl=en-GB#!forum/coderdojo-charlestown', '15992457872', NULL, 0, NULL, NULL, 0, 'ie/connaught/charlestown/charlestown', 'EU', 'IE', 'IRL', 'St. Attracta''s N.S. , Charlestown, Mayo', NULL, 372, 'Ireland', 'C', 'Connaught', '', '', '', '', '', '', '2965518', 'Charlestown', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90c04d-f3f9-11e4-910d-080027c336f0', 959, NULL, 'Nagoya @ Hackerspace Nagoya', 'df76cafe-f3f9-11e4-910d-080027c336f0', '2014-09-20 09:53:15+00', '2014-10-20 15:09:45+00', '4124', 1, 0, 1, 0, 'Once in a month, Saturday or Sunday 2pm-3pm', '{"countryName":"Japan","geonameId":"1861060","alpha2":"JP"}', '{}', '{"toponymName":"Aichi"}', '{}', '{"name":"Minami-sotoborichō","geonameId":"1857133"}', '35.1689254,136.89245219999998', '{"lat":35.1689254,"lon":136.89245219999998}', '<p>ノートパソコン又はiPadを持参してください。（ノートPCを持ってくる場合はマウスもあると操作しやすいです）<br />小学生のお子さんは保護者の方と一緒に参加をお願いします。</p><p>今後の開催予定は <a href="http://coderdojo-nagoya.doorkeeper.jp/">http://coderdojo-nagoya.doorkeeper.jp/</a> をチェックしてください。人数の事前把握のため、参加するお子さんはできる限り申し込みをお願いします。</p><p>&nbsp;</p><p>Requirements:<br />* Laptop with Scratch1.4 or internet access(Scratch2.0). iPad with pyonkee is also fine.<br />* Children under 12 must be accompanied by their parent(s).</p><p>Dates will be announced at <a href="http://coderdojo-nagoya.doorkeeper.jp/">http://coderdojo-nagoya.doorkeeper.jp/</a> .If possible, please register in advance.</p><p>&nbsp;</p><p>&nbsp;</p>', 'coderdojo.nagoya@gmail.com', 'http://coderdojo-nagoya.github.io', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'jp/aichi/minami-sotoborich/nagoya-hackerspace-nagoya', 'AS', 'JP', 'JPN', '愛知県名古屋市中区錦1丁目15-8 HackerSpace Nagoya / HackerSpace Nagoya 15-8, Nishiki 1, Naka-ku, Nagoya, Aichi', NULL, 392, 'Japan', '01', 'Aichi', '', '', '', '', '', '', '1857133', 'Minami-sotoborichō', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90645d-f3f9-11e4-910d-080027c336f0', 822, NULL, 'San Jose, CA', 'df75daac-f3f9-11e4-910d-080027c336f0', '2014-05-19 07:54:04+00', '2014-06-04 09:24:39+00', '3006', 1, 0, 0, 0, 'Every Tuesday, 4:30pm - 5:45pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Santa Clara County"}', '{"toponymName":"California"}', '{}', '{"name":"Rancho Rinconada","geonameId":"5386048"}', '37.302371,-122.01057479999997', '{"lat":37.302371,"lon":-122.01057479999997}', '<ul><li>This will be held in the computer lab.</li><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'sanjose.us@coderdojo.com', NULL, NULL, 'https://groups.google.com/forum/#!forum/coderdojo-san-jose', NULL, NULL, 0, NULL, NULL, 0, 'us/california/rancho-rinconada/san-jose-ca', 'NA', 'US', 'USA', 'Miller Middle School, San Jose, CA', NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '5386048', 'Rancho Rinconada', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f7826-f3f9-11e4-910d-080027c336f0', 451, NULL, 'Lincolnshire, IL (Chicago north suburbs)', 'df755303-f3f9-11e4-910d-080027c336f0', '2013-09-24 21:41:03+00', '2013-12-01 14:25:26+00', '3006', 1, 1, 2, 0, 'Saturdays', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Lake County"}', '{"toponymName":"Illinois"}', '{}', '{"name":"Lincolnshire","geonameId":"4899983"}', '42.1900249,-87.9084039', '{"lat":42.1900249,"lon":-87.9084039}', 'Looking for volunteers, mentors, and a space to host our first Dojo in the Chicago suburbs.<br /> <b>Update:</b> Our first session on Oct 19th was a success. Our second session on Nov 16th was terrific too, with even more participants and two new mentors. Thanks to the Vernon Area Public Library for letting us host two events. But <b>WE NEED A VENUE</b> to host a session in January, do you know of a place? Email us at <a href="mailto:coderdojols@gmail.com">coderdojols@gmail.com</a><br /><br /> We will have a session on Saturday February 1st 2014 1pm - 3pm sponsored by the Vernon Area Library. You must register through the library''s calendar page at <a href="http://www.vapld.info/events/events-calendar">http://www.vapld.info/events/events-calendar</a> What to stay in touch? <a href="http://eepurl.com/F4Q1P">Join our email list</a> to get our newsletter, we''ll let you know about upcoming events, and what we are up to.<br /><br /> If you want to help in any way, please drop us a line at <a href="mailto:coderdojols@gmail.com">coderdojols@gmail.com</a> <br/><br /> Right now on the menu we have: Scratch, html/css/javascript and python. We can add more depending on mentor availability and interest. <br /><br /> <ul><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojols@gmail.com', NULL, 'coderdojoLS', 'https://groups.google.com/forum/#!forum/coderdojo-lincolnshire', NULL, NULL, 1, '2242', '2014-11-08 03:39:36+00', 0, 'us/illinois/lincolnshire/lincolnshire-il-chicago-north-suburbs', 'NA', 'US', 'USA', 'Lincolnshire, IL', NULL, 840, 'United States of America', 'IL', 'Illinois', '', '', '', '', '', '', '4899983', 'Lincolnshire', NULL);
