INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90c77c-f3f9-11e4-910d-080027c336f0', 985, NULL, 'Kingston, Ontario @ Kingston Frontenac Public Library', 'df76d2ea-f3f9-11e4-910d-080027c336f0', '2014-09-23 14:53:08+00', NULL, NULL, 0, 0, 2, 0, 'Every Thursday, Jan 22-Mar 12 2015', NULL, NULL, NULL, NULL, NULL, '42.5,-36.19999999999999', '{"lat":42.5,"lon":-36.19999999999999}', '<p>Must be between the ages of 11 and 18. &nbsp;Bringing your own laptop is recommended. &nbsp;You can register here:&nbsp;<a target="_blank" href="http://goo.gl/Pi8OGF">http://goo.gl/Pi8OGF</a>.</p>', 'coderdojo@kfpl.ca', 'http://www.kfpl.ca/events-and-programs/coderdojo', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'ca/kingston-ontario-kingston-frontenac-public-library', 'NA', 'CA', 'CAN', 'Central Library: 130 Johnson St', NULL, 124, 'Canada', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90caf4-f3f9-11e4-910d-080027c336f0', 994, NULL, 'Blata l-Bajda, Malta@National Council of Women', 'df76d533-f3f9-11e4-910d-080027c336f0', '2014-09-29 09:49:19+00', '2014-10-16 13:50:23+00', '4124', 1, 0, 0, 0, 'Every Monday , 4:00pm - 6:00pm', '{"countryName":"Malta","geonameId":"2562770","alpha2":"MT"}', '{}', '{"toponymName":"Il-Ħamrun"}', '{}', '{"name":"Gwardamanġa","geonameId":"2563018"}', '35.888508, 14.495865', '{"lat":35.888508,"lon":14.495865}', '<p>Kids aged 7 - 17 will be exposed to programming tools such as basic Scratch and HTML, and can then create their own small projects &nbsp;with the assistance of volunteer mentors . The programme will last 12 sessions - one 2-hour session per week for 12 weeks. Available places are limited to 18. Participants may bring a snack if they they wish but no mess will be tolerated.&nbsp;</p><ul><li><strong>PCs are provided courtesy MCA , so no need for children to get their laptops</strong></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojomalta@mca.org.mt', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'mt/tal-pieta/gwardamana/blata-l-bajda-maltanational-council-of-women', 'EU', 'MT', 'MLT', 'National Council of Women, Pope Pius XII Flats, Mountbatten Street, Blata l-Bajda HMR 1579', NULL, 470, 'Malta, Republic of', '41', 'Tal-Pietà', '', '', '', '', '',