INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ee618-f3f9-11e4-910d-080027c336f0', 128, NULL, 'Dundalk', 'df746d3f-f3f9-11e4-910d-080027c336f0', '2012-05-07 14:57:31+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 2, 0, 'Saturday 14th June, 12pm-3pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Gibstown","geonameId":"3310709"}', '53.98178406529173,-6.391961097869853', '{"lat":53.98178406529173,"lon":-6.391961097869853}', '<p><strong>General Dojo Information:</strong></p><p>At CoderDojo Dundalk, we aim to encourage computing from a young age. Not only that, we want to help them be great at it! Computing is a hot area for employment here in Ireland and we believe that it&#39;s here to stay. We want to get young people aged 7 and up involved, primary and secondary school students alike.</p><p>Absolutely no programming experience is required, so if you are interested in checking out computing, come along to a session and try it out!</p><p>Like all Dojos we try to make it relaxed, fun, cool and interesting. There are no lectures or classroom approaches involved. Instead it&#39;s 100% hands-on coding with volunteer mentors available to help, to pass on their knowledge and of course, to keep you challenged!</p><p>Time: Specified Saturdays from 12pm-3pm. See Eventbrite booking link below for further details. <strong>Booking is essential!</strong></p><p><strong>What you need to bring:</strong></p><ul><li>A packed lunch.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul><p><strong>Topics:</strong> We currently cover HTML, CSS (website design &amp; development), Scratch (an introductory programming language developed in MIT), Python, Java (using the Greenfoot development environment), 3D modelling (using Blender) and robotics through Lego Mindstorms (seasonal). As the Dojo develops, we intend to cover a variety of other topics, including Databases, PHP and Mobile Applications.</p><p><strong>Note:</strong> Click here for details on <a href="http://zen.coderdojo.com/dojo/60">CoderDojo Drogheda</a></p>', 'dundalk@coderdojo.com', 'http://www.coderdojodundalk.com', 'CoderDojoDlk', 'https://groups.google.com/d/forum/coderdojo-drogheda-dundalk', '11885755615', 'http://www.dkit.ie/sites/all/themes/dkit/logo.png', 0, NULL, NULL, 0, 'ie/leinster/gibstown/dundalk', 'EU', 'IE', 'IRL', 'PJ Carrolls building, DkIT, Dundalk, Louth, Ireland', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '3310709', 'Gibstown', NULL);
