INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90d7b7-f3f9-11e4-910d-080027c336f0', 1036, NULL, 'Horsham', 'df76e8de-f3f9-11e4-910d-080027c336f0', '2014-10-26 15:50:29+00', '2014-10-29 14:51:48+00', '4124', 1, 0, 0, 0, 'Every Saturday 10am-1pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"West Sussex"}', '{"toponymName":"England"}', '{"toponymName":"Horsham District"}', '{"name":"Horsham","geonameId":"2646557"}', '51.068154,-0.351418', '{"lat":51.068154,"lon":-0.351418}', '<p>Our Dojo is currently marked Private as we are running a small-scale pilot scheme before we open our doors to a wider audience.</p><p>Our Dojo will be open for registration on January 31st 2015.</p><p>Please bring:</p><ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'info@coderdojohorsham.co.uk', 'http://www.coderdojohorsham.co.uk', 'coderdojohorsham', NULL, NULL, NULL, 0, NULL, NULL, 1, 'gb/england/horsham/horsham', 'EU', 'GB', 'GBR', 'Tanbridge School, Horsham, West Sussex', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2646557', 'Horsham', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90cb2f-f3f9-11e4-910d-080027c336f0', 995, NULL, 'Castleknock Dublin @ Castleknock Community College', 'df76d6d2-f3f9-11e4-910d-080027c336f0', '2014-09-30 12:23:54+00', '2014-09-30 13:27:14+00', '4124', 1, 1, 2, 0, 'Every Monday night - 7.30pm to 9pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Annfield","geonameId":"3315335"}', '53.3719948,-6.391057799999999', '{"lat":53.3719948,"lon":-6.391057799999999}', '<ul><li>A few place have come available</li><li><h6>SORRY&nbsp;ALL CLASSES ARE FULL.&nbsp;ADD YOURSELF TO THE WAIT LIST FOR CANCELLATIONS&nbsp;(SEE EVENTBRITE BELOW).</h6></li></ul><p>&nbsp;</p><ul><li>New years term&nbsp;will focus on HTML, Mobile Apps and Electronics</li><li>We are planning to restart Monday&nbsp;Jan&nbsp;19th 2015.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Age Limit is between&nbsp;10 and 18 years old.&nbsp;Please do not book a place for a child under 10. Depending on demand after the initial release we may lower the age limit to 8 years of age. If this is the case we will contact everyone and let them know.</li></ul>', 'coderdojocastleknock@gmail.com', 'http://www.coderdojocastleknock.com', 'coderdojocastle', NULL, '15177226493', NULL, 0, NULL, NULL, 0, 'ie/leinster/annfield/castleknock-dublin-castleknock-community-college', 'EU', 'IE', 'IRL', 'Castleknock Community College', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '3315335', 'Annfield', NULL);
