_logo2.png', 0, NULL, NULL, 0, 'it/tuscany/rifredi/firenze', 'EU', 'IT', 'ITA', 'via panciatichi 14, firenze', NULL, 380, 'Italy, Italian Republic', '16', 'Tuscany', '', '', '', '', '', '', '8469162', 'Rifredi', NULL);
