m/Coder-Dojo-Zurich', 'CoderDojoZH', 'https://groups.google.com/forum/?hl=en#!forum/coderdojozh', NULL, 'http://res.cloudinary.com/hrscywv4p/image/upload/c_thumb,h_64,w_64/haqau7razedi4mpwveca.png', 0, NULL, NULL, 0, 'ch/zurich/zurich-kreis-5-gewerbeschule/zurich', 'EU', 'CH', 'CHE', 'Liip, Limmatstrasse 183 Zürich', NULL, 756, 'Switzerland, Swiss Confederation', 'ZH', 'Zurich', '', '', '', '', '', '', '6295502', 'Zürich (Kreis 5) / Gewerbeschule', NULL);
