ed.', 'limerick@coderdojo.com', 'http://www.coderdojomidwest.com', 'CoderDojoLim', 'http://groups.google.com/group/coder-dojo-limerick', NULL, 'http://upload.wikimedia.org/wikipedia/en/f/f6/LIT_Logo.jpg', 0, NULL, NULL, 0, 'ie/kileely/limerick', 'EU', 'IE', 'IRL', 'LIT Main Campus, Moylish, Limerick', NULL, 372, 'Ireland', '', '', '', '', '', '', '', '', '7870949', 'Kileely', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9001df-f3f9-11e4-910d-080027c336f0', 772, NULL, 'Budapest, @LogMeIn', 'df75e154-f3f9-11e4-910d-080027c336f0', '2014-04-09 10:55:10+00', '2014-04-10 10:51:52+00', '3006', 1, 0, 2, 0, '2014/15 tanév', '{"countryName":"Hungary","geonameId":"719819","alpha2":"HU"}', '{}', '{"toponymName":"Budapest"}', '{}', '{"name":"Budapest V. kerület","geonameId":"7117203"}', '47.50043027012623,19.056522165328943', '{"lat":47.50043027012623,"lon":19.056522165328943}', '<p>Sziasztok! Itt a&nbsp;<strong>CoderDojo Budapest, @LogMeIn&nbsp;</strong>folytat&aacute;sa!</p><p>A 2014/15 tan&eacute;vben t&ouml;bb, h&aacute;romalkalmas Dojo-t rendez&uuml;nk.&nbsp;</p><ul><li><p>A Dojo-sorozatok ez&uacute;ttal h&aacute;rom, egym&aacute;sra &eacute;p&uuml;lő alkalomb&oacute;l &aacute;llnak, amelyeket h&aacute;rom, egym&aacute;st k&ouml;vető h&eacute;ten tartunk meg.</p></li><li><p>Ez&eacute;rt a jelentkez&eacute;sn&eacute;l k&eacute;rj&uuml;k, vegy&eacute;tek figyelembe, hogy mindh&aacute;rom alkalmon r&eacute;szt tudtok-e venni.</p></li><li><p>Az egyes Dojo-k anyaga ugyanaz, &iacute;gy csak egy sorozatra &eacute;rdemes jelentkeznetek.</p></li><li><p>Tal&aacute;lkozzunk minden cs&uuml;t&ouml;rt&ouml;k&ouml;n 18-20 &oacute;r&aacute;ig, h&aacute;rom h&eacute;ten kereszt&uuml;l a LogMeIn R&amp;D k&ouml;zpontj&aacute;ban (Andr&aacute;ssy u. 9, Budapest 1061).</p></li><li><p>Javasolt koroszt&aacute;ly: 9-13 &eacute;v</p></li><li><p>Ha van saj&aacute;t laptopod, nyugodtan elhozhatod &eacute;s azon is k&oacute;dolhatsz.</p></li><li><p>Csak a gyerekeknek sz&uuml;ks&eacute;ges a jelentkez&eacute;s az EventBrite oldal&aacute;n.</p></li><li><p>R&eacute;szleteket a Dojo-r&oacute;l &eacute;s a beiratkoz&aacute;sr&oacute;l itt tal&aacute;lhattok:&nbsp;<a href="https://coderdojolmi.uservoice.com/">https://coderdojolmi.uservoice.com/</a></p></li></ul>', 'tickets@coderdojolmi.uservoice.com', 'http://coderdojolmi.uservoice.com/', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'hu/budapest/budapest-v-kerulet/budapest-logmein', 'EU', 'HU', 'HUN', 'LogMeIn R&amp;D Center, Andrássy út 9, Budapest, Hungary', NULL, 348, 'Hungary, Republic of', '05', 'Budapest', '', '', '', '', '', '', '7117203', 'Budapest V. kerület', NULL);
