INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9073f1-f3f9-11e4-910d-080027c336f0', 841, NULL, 'Chisinau Coderdojo', 'df763e75-f3f9-11e4-910d-080027c336f0', '2014-06-10 08:51:33+00', '2014-06-11 12:50:17+00', '3006', 1, 0, 3, 0, 'Every Saurday 11.00', '{"countryName":"Moldova","geonameId":"617790","alpha2":"MD"}', '{}', '{}', '{}', '{"name":"Rîşcani","geonameId":"617484"}', '47.0596592,28.8483933', '{"lat":47.0596592,"lon":28.8483933}', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>See our Facebook page <a href="https://www.facebook.com/CoderDojo.Chisinau">here!</a></li></ul>', 'info@coderdojo.md', 'http://www.coderdojo.md', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'md/chisinau/riscani/chisinau-coderdojo-1', 'EU', 'MD', 'MDA', 'str. Calea Orheiului 20/1, Chisinau', NULL, 498, 'Moldova, Republic of', '57', 'Chişinău', '', '', '', '', '', '', '617484', 'Rîşcani', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ed284-f3f9-11e4-910d-080027c336f0', 60, NULL, 'Drogheda on the Boyne', 'df7406f4-f3f9-11e4-910d-080027c336f0', '2012-03-13 00:58:45+00', '2013-12-01 14:25:30+00', '3006', 1, 1, 2, 0, '2 Saturdays a month, noon - 3pm (See Eventbrite for next available dates)', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Drogheda","geonameId":"2964661"}', '53.713726,-6.378871', '{"lat":53.713726,"lon":-6.378871}', '<p>&nbsp;</p><p>At CoderDojo Drogheda our aim is to encourage kids to get into computing and to be really good at it! There are lots of jobs and start up opportunities for good programmers and as far as we can see there always will be. We are initially focusing on those in second level aged 13-17 but are also accepting kids at a younger age if accompanied by a parent.</p><p>No prior programming experience is required if you are honestly interested in computing come a long and try it out!</p><p>Like all Dojos we try to make it relaxed, fun, cool and interesting. No lectures or classroom approaches here its 100% hands-on coding with the help of volunteer mentors to pass on their knowledge and keep you challenged!</p><p><strong>Time:</strong> 2 Saturday&#39;s per month between noon and 3pm.</p><h3>Booking Information</h3><p>See <a target="_blank" href="http://coderdojo-drogheda.eventbrite.com">Eventbrite (http://coderdojo-drogheda.eventbrite.com) for further details.</a></p><p><strong>Note: Booking is essential!</strong></p><h3>What you need to bring:</h3><ul><li>We accept donations from parents that allow us to provide pizza and ensure there is a social element to CoderDojo</li><li>If possible, a laptop. If not please indicate this at booking and we have some laptops available</li><li>A parent (* a must if 12 or younger very important!)</li></ul><h3>Topics:</h3><p>Currently we cover HTML/CSS (Web Frontend), Scratch, JavaScript, Databases, PHP (Web backend) and Mobile Apps. &nbsp;We have mentors who are happy to help with Java, Node.js, Unity3D and many other areas too - so just ask!</p><p><strong>Note:</strong>&nbsp;Click here for details on our sister Dojo:&nbsp;<a href="http://zen.coderdojo.com/dojo/128">CoderDojo Dundalk</a></p>', 'drogheda@coderdojo.com', 'http://www.coderdojodrogheda.com', 'coderdojodrog', 'https://groups.google.com/d/forum/coderdojo-drogheda-dundalk', NULL, 'http://www.coderdojodrogheda.com/coderdojo-drogheda/coderdojo-drogheda-supporters.jpg', 0, NULL, NULL, 0, 'ie/leinster/drogheda/drogheda-on-the-boyne', 'EU', 'IE', 'IRL', 'St Oliver''s Community College, Rathmullen Road, Drogheda', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '2964661', 'Drogheda', NULL);
