INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ff801-f3f9-11e4-910d-080027c336f0', 739, NULL, 'Plantation DoJo @ TKAE', 'df75d74a-f3f9-11e4-910d-080027c336f0', '2014-03-20 18:41:15+00', '2014-03-24 10:28:01+00', '3006', 1, 1, 2, 0, 'First DoJo is April 27, 2014 - 12PM to 3PM', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Broward County"}', '{"toponymName":"Florida"}', '{}', '{"name":"Pine Island Ridge","geonameId":"4168506"}', '26.104251,-80.25723900000003', '{"lat":26.104251,"lon":-80.25723900000003}', '<ul><li>Open to children 5-17 yrs of age with parental consent and a signed waiver.&nbsp;</li><li>Please bring your own bagged lunch and snack.</li><li>Please bring your laptop.</li><li>TKAE Sunday school student that have registered will be escorted to the DoJo from their respective religious school class. &nbsp;</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'plantationdojo@tkae.org', 'https://www.facebook.com/PlantationDoJo', 'plantationdojo', NULL, '11212716537', 'http://tkae.org/wp-content/uploads/2014/03/we-banner.jpg', 0, NULL, NULL, 0, 'us/florida/pine-island-ridge/plantation-dojo-tkae', 'NA', 'US', 'USA', 'Temple Kol Ami Emanu-El, 8200 Peters Road, Plantation, FL 33324', NULL, 840, 'United States of America', 'FL', 'Florida', '', '', '', '', '', '', '4168506', 'Pine Island Ridge', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90d40c-f3f9-11e4-910d-080027c336f0', 1025, NULL, 'Szentendre', 'df76e618-f3f9-11e4-910d-080027c336f0', '2014-10-20 11:53:45+00', '2014-10-21 08:59:19+00', '4124', 1, 0, 1, 0, 'Saturdays, 10-12', '{"countryName":"Hungary","geonameId":"719819","alpha2":"HU"}', '{}', '{"toponymName":"Pest"}', '{}', '{"name":"Szentendre","geonameId":"3044681"}', '47.6694659,19.074827000000028', '{"lat":47.6694659,"lon":19.074827000000028}', '<h3>Hogyan műk&ouml;dik?</h3><p>A szentendrei dojo hasonl&oacute;an műk&ouml;dik, mint egy szakk&ouml;r: Heti rendszeress&eacute;ggel tal&aacute;lkozunk. Minden alkalom egy vezetett foglalkoz&aacute;s, mely r&ouml;vid bevezetőből, &eacute;s sok gyakorlatb&oacute;l &aacute;ll. A gyakorlatok programoz&aacute;ssal &eacute;s weboldalak k&eacute;sz&iacute;t&eacute;s&eacute;vel kapcsolatosak. A foglalkoz&aacute;sok k&ouml;z&ouml;tti időben is tartjuk a kapcsolatot on-line f&oacute;rumok seg&iacute;ts&eacute;g&eacute;vel.</p><p>A foglalkoz&aacute;sokra regisztr&aacute;ci&oacute; nem sz&uuml;ks&eacute;ges!</p><h3>Mit kell hozni?</h3><p>J&oacute; lenne, ha mindenki tudna hozni saj&aacute;t laptopot &eacute;s Androidos telefont/tabletet, amin dolgozik majd. Korl&aacute;tozott sz&aacute;mban tudunk ugyan biztos&iacute;tani eszk&ouml;z&ouml;ket, de az nem lesz el&eacute;g mindenki sz&aacute;m&aacute;ra. R&aacute;ad&aacute;sul j&oacute; lenne, ha a foglalkoz&aacute;sok k&ouml;z&ouml;tti időben, otthon is tudn&aacute;tok dolgozni valamin, ehhez pedig mindenk&eacute;ppen saj&aacute;t eszk&ouml;zre lesz sz&uuml;ks&eacute;g.</p>', 'kapcsolat@coderdojo.hu', 'http://szentendre.coderdojo.hu', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'hu/pest/szentendre/szentendre', 'EU', 'HU', 'HUN', 'Pest Megyei Könyvtár, 2000 Szentendre, Pátriárka u. 7.', NULL, 348, 'Hungary, Republic of', '16', 'Pest', '', '', '', '', '', '', '3044681', 'Szentendre', NULL);
