INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f4e93-f3f9-11e4-910d-080027c336f0', 312, NULL, 'Bologna', 'df75061e-f3f9-11e4-910d-080027c336f0', '2013-03-29 16:08:52+00', '2013-12-01 14:25:27+00', '3006', 1, 0, 2, 0, 'Almeno due sabati al mese, registratevi alla newsletter per essere avvisati!', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Bologna"}', '{"toponymName":"Emilia-Romagna"}', '{"toponymName":"Bologna"}', '{"name":"Bologna","geonameId":"3181928"}', '44.494592,11.342396', '{"lat":44.494592,"lon":11.342396}', '<h3>Che cos&#39;&egrave; CoderDojo?</h3><p>I CoderDojo sono laboratori / club di programmazione gratuiti e aperti a bambini e ragazzi, qui a Bologna partiremo dedicandoci alla fascia d&#39;et&agrave; 7-13.</p><p>Gli eventi si tengono con cadenza periodica, cominceremo con uno al mese a partire dall&#39;11 maggio 2013. Indicativamente fisseremo gli incontri il sabato mattina, ma potremmo decidere di spostarli nel pomeriggio in base alle esigenze dei ragazzi.</p><h3>Cosa si fa durante un evento?</h3><p>Impareremo a utilizzare <a href="http://scratch.mit.edu">Scratch</a> per creare i nostri primi programmi e semplici videogiochi.</p><p>L&#39;evento dura circa 3 ore, nella prima parte uno dei mentor spiegher&agrave; a tutti il funzionamento di Scratch attraverso un esempio che i bambini riprodurranno sui propri computer, supportati dagli altri mentor. Nella seconda parte, dopo la merenda, i ragazzi saranno liberi di continuare a personalizzare il proprio gioco o crearne un altro sulla base di quello che hanno imparato.</p><h3>Quando e dove cominciamo?</h3><p>Il primo evento sar&agrave; l&#39;11 maggio 2013 presso l&#39;Urban Center, in Sala Borsa.</p><p>Data la capienza dello spazio e trattandosi del primo esperimento, potremo ospitare al massimo 15 bambini.</p><h3>Che cosa bisogna portare?</h3><p>Un portatile per ogni bambino (windows, mac, ubuntu), possibilmente con <a href="http://scratch.mit.edu/download">Scratch</a> gi&agrave; installato</p><p>Una merenda</p><p>Un genitore</p><h3>Come ci si iscrive?</h3><p>E&#39; possibile effettuare la registrazione tramite smappo a questo indirizzo: <a href="http://coderdojobo.smappo.com">http://coderdojobo.smappo.com</a></p><p>News: <strong>Per l&#39;evento dell&#39;11 maggio i posti sono esauriti!</strong></p><p>Visto l&#39;entusiasmo, organizzeremo al pi&ugrave; presto un altro incontro!</p><h3>Hai bisogno di altre informazioni?</h3><p>Contattaci su coderdojobo@gmail.com, cercheremo di risponderti al pi&ugrave; presto!</p><h3>Above all, be cool! ;)</h3>', 'coderdojobo@gmail.com', 'http://www.coderdojobologna.it', 'coderdojobo', 'http://coderdojo-bo@googlegroups.com', NULL, NULL, 0, NULL, NULL, 0, 'it/emilia-romagna/bologna/bologna', 'EU', 'IT', 'ITA', 'Urban Center - Biblioteca Sala Borsa, Bologna', NULL, 380, 'Italy, Italian Republic', '05', 'Emilia-Romagna', '', '', '', '', '', '', '3181928', 'Bologna', NULL);
