INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ec9da-f3f9-11e4-910d-080027c336f0', 38, NULL, 'Indianapolis', 'df7402e8-f3f9-11e4-910d-080027c336f0', '2012-03-08 13:39:00+00', '2013-12-01 14:25:30+00', '3006', 1, 1, 2, 0, 'Third Saturday of every month 11am-1pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Marion County"}', '{"toponymName":"Indiana"}', '{}', '{"name":"Woodruff Place","geonameId":"4267213"}', '39.7786133,-86.131845', '{"lat":39.7786133,"lon":-86.131845}', '<ul><li><strong>Update:</strong> we will have unstructured time before this meeting starting at 10:30!</li><li>Sign up below: 9yo-12th grade</li><li>The Legacy Center is located on the west end of Arsenal Tech&#39;s campus just south of the football field.</li><li>A laptop. Bring your own if available, but we&#39;ll have extras just in case.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li><li>Want to get a head start? check out the tutorials we&#39;ve been working through <a href="https://docs.google.com/folder/d/0Bxdm1pSYQcbMOHdSTnFGajdBT1U/edit?pli=1">here!: https://docs.google.com/folder/...</a></li><li>If you have a project you&#39;ve been working on, let us know! email info@coderdojoindy.org and we can get it on the site</li></ul><p><a href="https://www.eventbrite.com/e/coderdojo-indy-tickets-14292133155"><strong>Sign up: https://www.eventbrite.com/e/coderdojo-indy-tickets-14292133155</strong></a></p>', 'info@coderdojoindy.org', 'https://www.eventbrite.com/e/coderdojo-indy-tickets-14292133155', 'coderdojoindy', 'http://groups.google.com/group/coderdojo-indy', '14291846297', NULL, 0, NULL, NULL, 0, 'us/indiana/woodruff-place/indianapolis', 'NA', 'US', 'USA', 'Chase Legacy Center Indianapolis, IN', NULL, 840, 'United States of America', 'IN', 'Indiana', '', '', '', '', '', '', '4267213', 'Woodruff Place', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90ac97-f3f9-11e4-910d-080027c336f0', 890, NULL, 'Dublin @BearingPoint', 'df76b314-f3f9-11e4-910d-080027c336f0', '2014-07-30 14:12:34+00', '2014-07-31 16:41:12+00', '3006', 1, 0, 2, 0, 'Saturdays, 2pm - 5pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Portobello","geonameId":"7870000"}', '53.33305559999999,-6.259964599999989', '{"lat":53.33305559999999,"lon":-6.259964599999989}', '<p>This is a Private Dojo for staff of BearingPoint only during trial stage. &nbsp;We wll open to the public in future - dates to follow. &nbsp;Please bring along:</p><ul><li>A&nbsp;<strong>laptop</strong>. Borrow one from someone if needs be. We will have some available however it will be on first come first served basis, please let us know in advance if you wish to use our laptops.</li><li>A&nbsp;<strong>parent!</strong>&nbsp;(Very important). If you are 12 or under, your parent must stay with you during the session.</li></ul>', 'BPt-FMIECoderDojo@bearingpoint.com', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 'ie/portobello/dublin-bearingpoint', 'EU', 'IE', 'IRL', 'BearingPoint, Montague House, Adelaide Road, Dublin 2', NULL, 372, 'Ireland', '', '', '', '', '', '', '', '', '7870000', 'Portobello', NULL);
