nform&aacute;tica</a></li></ul>', 'coderdojo@tecnico.ulisboa.pt', 'http://www.coderdojo-tecnico.org/', NULL, NULL, '15658175023', NULL, 0, NULL, NULL, 0, 'pt/lisbon/areeiro/tecnico-lisboa', 'EU', 'PT', 'PRT', 'Instituto Superior Técnico, 1049-001, Lisboa, Portugal', NULL, 620, 'Portugal, Portuguese Republic', '14', 'Lisbon', '', '', '', '', '', '', '2271547', 'Areeiro', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df911ec3-f3f9-11e4-910d-080027c336f0', 1114, NULL, 'Forritun í einn tíma', 'df76fe49-f3f9-11e4-910d-080027c336f0', '2014-12-06 12:24:58+00', NULL, NULL, 0, 0, 0, 0, 'Föstudaginn 12. desember 2014 kl. 14:30', '{"countryName":"Iceland","geonameId":"2629691","alpha2":"IS"}', '{}', '{"toponymName":"Capital Region"}', '{}', '{"name":"Kopavogur","geonameId":"3415212"}', '64.10459933872025,-21.815141391754196', '{"lat":64.10459933872025,"lon":-21.815141391754196}', '<p>&THORN;&eacute;r er bo&eth;i&eth; upp &aacute; a&eth; taka &thorn;&aacute;tt &iacute; &aacute;takinu &quot;forritun &iacute; klukkustund&quot;</p><ul><li>&THORN;a&eth; &thorn;arf a&eth; m&aelig;ta me&eth; fart&ouml;lvu e&eth;a spjaldt&ouml;lvu. F&aacute;&eth;u l&aacute;na&eth; ef &thorn;&uacute; &thorn;arft &thorn;ess me&eth;.&nbsp;</li><li><strong>Foreldri (nau&eth;synlegt). Ef &thorn;&uacute; ert yngri en 12 &aacute;ra &thorn;arf foreldri a&eth; koma me&eth; og sam&thorn;ykkja a&eth; &thorn;&uacute; megir taka &thorn;&aacute;tt &iacute; &thorn;essu starfi. </strong></li></ul><p><strong>kve&eth;ja,</strong></p><p><strong>&Aacute;sta</strong></p>', 'astaolaf@simnet.is', NULL, NULL, 'https://docs.google.com/document/d/1-AaVBJuycGjl3wls5mWwwC7ugu65FQ8G7BzNRpv00iI/edit?usp=docslist_api', NULL, NULL, 0, NULL, NULL, 0, 'is/capital-region/kopavogur/forritun-i-einn-tima', 'EU', 'IS', 'ISL', 'Reykjavik', NULL, 352, 'Iceland, Republic of', '39', 'Capital Region', '', '', '', '', '', '', '3415212', 'Kopavogur', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f18c2-f3f9-11e4-910d-080027c336f0', 195, NULL, 'London, Code Breaking, Hacking &amp; Spying October 2012', 'df740d21-f3f9-11e4-910d-080027c336f0', '2012-09-08 13:43:55+00', NULL, NULL, 0, 0, 1, 0, 'Saturday 6th October 12pm - 3pm', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Greater London"}', '{"toponymName":"England"}', '{"toponymName":"Camden"}', '{"name":"Camden Town","geonameId":"3345437"}', '51.53800754877571,-0.13668537139892578', '{"lat":51.53800754877571,"lon":-0.13668537139892578}', '<P>Have you ever wanted to learn how to decipher cryptic codes, send secret messages hidden in images, see when a website is tracking you or try your hand at disarming a bomb!</P> <P>We''ll be covering all these topics and more in a 3 hour race to crack the codes before the time runs out. We''ve even got some super cool prizes lined up for those that get there first.</P> <P><STRONG>We welcome all ages and abilities however all young people must be accompanied by a responsible adult.</STRONG></P> <P>The event is completely free but we do ask that you<STRONG>register here and get a ticket at least 24 hours before each meetup</STRONG>so that we can plan for the correct numbers.</P> <P>More information about this and future events can be found at <A HREF="http://coder-dojo-london.org.uk" TARGET="_blank">coder-dojo-london.org.uk</A></P>', 'andy@forward.co.uk', NULL, NULL, NULL, '3637158840', NULL, 0, NULL, NULL, 0, 'gb/england/camden-town/london-code-breaking-hacking-andamp-spying-october-2012', 'EU', 'GB', 'GBR', 'Forward, Camden, London', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '3345437', 'Camden Town', NULL);
