ercoats', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df9063da-f3f9-11e4-910d-080027c336f0', 820, NULL, 'Braunschweig', 'df768ca1-f3f9-11e4-910d-080027c336f0', '2014-05-17 18:51:50+00', '2014-05-23 12:40:20+00', '3006', 1, 1, 1, 0, '28.02.2015, 14:00 - 17:00', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"Lower Saxony"}', '{}', '{"name":"Donnerburgsiedlung","geonameId":"2936224"}', '52.2782844,10.520959500000004', '{"lat":52.2782844,"lon":10.520959500000004}', '<p>(English below)<br /><br />Schicke eine Email an coderdojobs@gmail.com und wir setzen dich auf den Verteiler f&uuml;r Erinnerungen und Neuigkeiten.<br /><br />Das n&auml;chste CoderDojo findet &nbsp;wieder in den R&auml;umen von <a href="https://stratum0.org/wiki/Hauptseite">Stratum0</a>, dem&nbsp;<a href="http://de.wikipedia.org/wiki/Hackerspace">Hackerspace</a>&nbsp;in Braunschweig, Hamburger Stra&szlig;e 273 A, statt.<br /><br />CoderDojo ist ein Club fuer Kinder und Jugendliche im Alter von 5 bis 17 Jahren, die programmieren lernen und Spass haben wollen.<br /><br />Hier findest du mehr Informationen: <a href="http://coderdojo.com/about">http://coderdojo.com/about</a></p><p>&nbsp;</p><p>Mitzubringen:<br /><br />Einen Laptop! Falls du keinen hast, leih dir einen oder frag uns.<br />Einen Elternteil! Wenn du 12 Jahre alt oder juenger bist, muss ein Erwachsener die ganze Zeit ueber dabei sein.</p><p>Bericht vom 1. CoderDojo in Braunscheig:</p><p><a href="https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/</a></p><p>Bericht vom 2. CoderDojo in Braunschweig:</p><p><a href="https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/</a></p><p><br /><br />English:<br /><br />Send an email to coderdojobs@gmail.com and we will add you to the mailing list for reminders and updates.<br />CoderDojo is a club for kids aged 5 to 17 to learn to code and have fun.<br /><br />Read more about it here: <a href="http://coderdojo.com/about">http://coderdojo.com/about </a><br /><br />Bring:<br /><br />A laptop. Borrow one from someone, or contact us if you need one.<br />A parent! If you are 12 or under, an adult must stay with you during the session.</p><p>&nbsp;</p><p>Reports: (only in german):</p><p><a href="https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/07/19/1-coderdojo-braunschweig/</a></p><p><a href="https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/">https://stratum0.org/blog/posts/2014/08/30/2-coderdojo-braunschweig/</a></p>', 'coderdojobs@gmail.com', NULL, 'coderdojobs', NULL, '15688954084', 'https://stratum0.org/wiki/Logo#mediaviewer/Datei:Sanduhr-wiki-logo.svg', 0, NULL, NULL, 0, 'de/lower-saxony/donnerburgsiedlung/braunschweig', 'EU', 'DE', 'DEU', 'Stratum0, Hamburger Str. 273 A, 38114 Braunschweig', NULL, 276, 'Germany, Federal Republic of', '06', 'Lower Saxony', '', '', '', '', '', '', '2936224', 'Donnerburgsiedlung', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f568e-f3f9-11e4-910d-080027c336f0', 353, NULL, 'Caceres, Extremadura @ AROtec', 'df7514d1-f3f9-11e4-910d-080027c336f0', '2013-05-07 18:53:13+00', '2014-09-24 13:09:42+00', '4124', 1, 1, 1, 0, 'Mensual, Sábados, 11-13h', '{"countryName":"Spain","geonameId":"2510769","alpha2":"ES"}', '{"toponymName":"Caceres"}', '{"toponymName":"Extremadura"}', '{"toponymName":"Cáceres"}', '{"name":"Hospital Provincial Nuestra Señora de la Montaña","geonameId":"7266439"}', '39.46843789552457,-6.380259566409336', '{"lat":39.46843789552457,"lon":-6.380259566409336}', '<div><h1>A tener en&nbsp;cuenta en CoderDojo C&aacute;ceres</h1><p>Si quieres participar reserva tu ticket si puedes venir, si no le est&aacute;s quitando la plaza a otra persona. Te recordamos que si eres menor de 12 a&ntilde;os tienes que venir acompa&ntilde;ado de un adulto.</p><p>Recuerda que s&oacute;lo puedes participar si te ha llegado el email de confirmaci&oacute;n, descartaremos a la gente que no est&eacute; apuntada previamente.</p><p>Normas:</p><p>1.- TRAE TU PROPIO PORT&Aacute;TIL &ndash; Hay que traer ordenador propio.</p><p>2.- Si te quedas sin entrada una semana, int&eacute;ntalo a la siguiente.</p><p>3.- Los menores de 12 a&ntilde;os tienen que venir acompa&ntilde;ados de un adulto.</p><p>4.- La gente que no haya firmado la hoja de autorizaci&oacute;n o de &ldquo;no autorizaci&oacute;n&rdquo; de toma de im&aacute;genes tiene que firmarla</p><p>5.- Las entradas estar&aacute;n disponibles en d&iacute;as previos a la celebraci&oacute;n del evento.</p><p>6.- NUNCA dejes de pensar que existe m&aacute;s de una soluci&oacute;n para el mismo problema.</p></div>', 'coderdojocaceres@gmail.com', 'http://coderdojocaceres.wordpress.com', 'coderdojo_CC', 'https://groups.google.com/d/forum/coder-dojo-caceres', '13382831409', NULL, 0, NULL, NULL, 0, 'es/extremadura/hospital-provincial-nuestra-senora-de-la-montana/caceres-extremadura-arotec', 'EU', 'ES', 'ESP', 'C/ Gil Cordero, 4', NULL, 724, 'Spain, Kingdom of', '57', 'Extremadura', '', '', '', '', '', '', '7266439', 'Hospital Provincial Nuestra Señora de la Montaña', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df91610d-f3f9-11e4-910d-080027c336f0', 1274, NULL, 'Sint-Katelijne Waver', 'df771765-f3f9-11e4-910d-080027c336f0', '2015-02-11 11:04:09+00', '2015-02-11 11:37:10+00', '4124', 1, 0, 0, 0, 'Every last Saturday of the month, 10pm-13pm', '{"countryName":"Belgium","geonameId":"2802361","alpha2":"BE"}', '{"toponymName":"Antwerp Province"}', '{"toponymName":"Flemish"}', '{}', '{"name":"Sint-Katelijne-Waver","geonameId":"2786641"}', '51.0660044,4.528412600000024', '{"lat":51.0660044,"lon":4.528412600000024}', '<p>&nbsp;</p><ul><li>A laptop. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'info@coderdojobelgium.be', 'http://www.coderdojobelgium.be', 'coderdojobe', NULL, NULL, NULL, 0, NULL, NULL, 0, 'be/flemish/sint-katelijne-waver/sint-katelijne-waver', 'EU', 'BE', 'BEL', 'Gemeentelijke basisschool G.L.O.C. Daliastraat 35 2860 Sint-Katelijne Waver', NULL, 56, 'Belgium, Kingdom of', 'VLG', 'Flemish', '', '', '', '', '', '', '2786641', 'Sint-Katelijne-Waver', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df915cda-f3f9-11e4-910d-080027c336f0', 1256, NULL, 'Castlebar, Co.Mayo, @ Crimlin', 'df7716fd-f3f9-11e4-910d-080027c336f0', '2015-02-07 18:41:47+00', '2015-02-13 12:28:07+00', '4124', 1, 1, 3, 0, 'Evert Thursday 3pm - 4pm', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Connaught"}', '{}', '{"name":"Castlebar","geonameId":"2965654"}', '53.8550014,-9.28792569999996', '{"lat":53.8550014,"lon":-9.28792569999996}', '<p>Attendees, please bring a light snack and your own laptop if you this is possible.&nbsp;</p><p>Parental drop off and pick up.</p>', 'crimlin.ie@coderdojo.com', NULL, 'crimlinschool', NULL, '15745402924', NULL, 0, NULL, NULL, 1, 'ie/connaught/castlebar/castlebar-comayo-crimlin', 'EU', 'IE', 'IRL', 'Crimlin N.S, Crimlin, Castlebar, Co.Mayo', NULL, 372, 'Ireland', 'C', 'Connaught', '', '', '', '', '', '', '2965654', 'Castlebar', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df914edc-f3f9-11e4-910d-080027c336f0', 1238, NULL, 'Geel', 'df771544-f3f9-11e4-910d-080027c336f0', '2015-02-02 14:44:39+00', NULL, NULL, 0, 0, 0, 0, 'Every month', '{"countryName":"Belgium","geonameId":"2802361","alpha2":"BE"}', '{"toponymName":"Antwerp Province"}', '{"toponymName":"Flemish"}', '{}', '{"name":"Poijel","geonameId":"2788813"}', '51.1608366,4.962115499999982', '{"lat":51.1608366,"lon":4.962115499999982}', '<p>CoderDojo &nbsp;organiseert evenementen, de zogenaamde &quot;Dojo&#39;s&quot;. Op die Dojo&#39;s leren jongens en meisjes programmeren, websites maken, apps en spelletjes ontwikkelen enzovoort. Ze ontmoeten gelijkgestemde deelnemers en laten elkaar zien waaraan ze gewerkt hebben. CoderDojo maakt van ontwikkelen en programmeren&nbsp;een superleuke, keigezellige en megatoffe leerervaring.</p><p>Dojo&#39;s worden op vrijwillige basis opgezet en gerund door mentors met voldoende ICT-kennis en de juiste drive om jongeren te coachen. CoderDojo legt sterk de nadruk op open source en vrije software. De beweging heeft een snel groeiend netwerk van leden en vrijwilligers wereldwijd.&nbsp;</p><p>CoderDojo heeft maar &eacute;&eacute;n regel:&nbsp;&quot;Above all: be cool!&quot;.</p><p><br /><br /><strong>Trajecten</strong></p><p>Er zijn verschillende trajecten waaraan kan deelgenomen worden. Dit kan u steeds zelf bepalen, maar zorg ervoor dat u zich heeft ingeschreven.<br /><br /><strong>1) Scratch:</strong><br />Op een visuele manier het logisch denken aanleren om te leren programmeren. Dit is ideaal voor iedereen die wilt leren programmeren.<br /><br /><em>&nbsp;Voorlopig bieden wij nog geen andere trajecten aan.</em></p><p>&nbsp;</p><p><strong>Praktisch informatie</strong></p><p>-&nbsp;Deelnemers tussen 7 en 18 jaar zijn toegelaten.&nbsp;Deelnemers jonger dan 12 worden het best begeleid door een ouder. De ouders hoeven niet de hele tijd aanwezig te zijn, maar moeten wel in de buurt blijven zodat we&nbsp;hen kunnen contacteren.</p><p>- Indien zou blijken dat de deelnemer niet aanwezig zou kunnen zijn, dan kan u dat melden via <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>, waarna&nbsp;het ticket geannuleerd zal worden.</p><p>- We vragen bij de inschrijving wel aan alle deelnemers om een e-mailadres en telefoonnummer van de ouders of voogd op te geven. Indien nodig&nbsp;zal CoderDojo&nbsp;| Geel&nbsp;rechtstreeks contact opnemen met de ouders of voogd.</p><p>- De deelnemer dient te beschikken over een draagbare computer. De coaches zullen ervoor zorgen dat alle benodigde software ge&iuml;nstalleerd zal worden. Indien dit niet het gaval is, dan zal CoderDojo | Geel een draagbare computer voorzien.</p><p>&nbsp;</p><p><strong>Vragen </strong></p><p>Contacteer ons via <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>! See you soon!<br /><br />Door inschrijving en deelname aan de CoderDojo- activiteiten, gaat u als ouder of voogd ermee akkoord dat er beeldmateriaal kan genomen worden van uw kinderen en dat dit beeldmateriaal kan gebruikt worden voor publicatie in het kader van bekendmaking/marketing van CoderDojo. Indien u hiermee niet akkoord bent, kan u dit laten weten via: <a href="mailto:geel@coderdojobelgium.be">geel@coderdojobelgium.be</a>.</p>', 'geel@coderdojobelgium.be', 'http://www.coderdojobelgium.be', NULL, NULL, '15048121336', NULL, 1, '5136', '2015-02-02 14:46:03+00', 0, 'be/flemish/poijel/geel-1', 'EU', 'BE', 'BEL', 'Kleinhoefstraat 4, 2440 GEEL, BELGIUM', NULL, 56, 'Belgium, Kingdom of', 'VLG', 'Flemish', '', '', '', '', '', '', '2788813', 'Poijel', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90bc02-f3f9-11e4-910d-080027c336f0', 947, NULL, 'Oxford @ Barclays', 'df76b95f-f3f9-11e4-910d-080027c336f0', '2014-09-13 14:59:22+00', '2014-09-15 09:00:00+00', '4124', 1, 1, 2, 0, '15th October (next session)', '{"countryName":"United Kingdom","geonameId":"2635167","alpha2":"GB"}', '{"toponymName":"Oxfordshire"}', '{"toponymName":"England"}', '{"toponymName":"Oxford"}', '{"name":"Summertown","geonameId":"2636537"}', '51.77668250000001,-1.264848700000016', '{"lat":51.77668250000001,"lon":-1.264848700000016}', '<p>Are you an enthusiastic coder who wants to develop their ideas further? Or are you maybe someone just fascinated by what can be done in the world of code and want to get started?&nbsp;It makes no difference because either way we want YOU to join us at our CoderDojo in Oxford!</p><p>Attend our weekly sessions held in the amazing workspaces of Barclays for a free golden ticket inside the world of code. This event is open to ANY young person aged between 7-17, whether boy or girl, keen programmer or beginner. Just sign up, and bring yourself, &nbsp;a parent (if you&#39;re under 12) &nbsp;and a laptop (or any other hardware you like) along! We will provide you with comfort, Wifi, and most importantly fantastic mentors and other bright young people at your disposal.</p><p>Remember the only rule: be cool!</p><p>What are you waiting for? sign up now!!!</p><p>&nbsp;</p><p>TO REGISTER:</p><ul><li>email coderdojo@barclays.com with &#39;we want to attend the Summertown CoderDojo&#39; and then include their name and age.</li><li>if you would like more infromation, email coderdojo@barclays.com or joanauk@gmail.com</li></ul>', 'coderdojo@barclays.com', NULL, NULL, 'https://groups.google.com/forum/#!forum/coderdojo-barclaysoxford', NULL, NULL, 0, NULL, NULL, 0, 'gb/england/summertown/oxford-barclays', 'EU', 'GB', 'GBR', '211-213 Banbury Rd Oxford OX2 7HH', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', 'ENG', 'England', '', '', '', '', '', '', '2636537', 'Summertown', NULL);
