INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fbeb6-f3f9-11e4-910d-080027c336f0', 564, NULL, 'Brisbane Indooroopilly', 'df757400-f3f9-11e4-910d-080027c336f0', '2013-11-28 02:47:17+00', '2013-12-20 12:28:25+00', '3006', 1, 0, 2, 0, 'Every Saturday from 10th May 2014 14th June 2014, 12.00 - 2.00pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Indooroopilly","geonameId":"6943573"}', '-27.498717,152.97288200000003', '{"lat":-27.498717,"lon":152.97288200000003}', '<ul><li>A pack lunch.</li><li>A laptop. Borrow one from someone if needs be.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'info@coderdojobrisbane.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', NULL, NULL, NULL, 1, '4153', '2014-09-09 00:56:33+00', 0, 'au/queensland/indooroopilly/brisbane-indooroopilly', 'OC', 'AU', 'AUS', 'Indooroopilly Library, 322 Moggill Rd, Indooroopilly QLD 4068', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '6943573', 'Indooroopilly', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f5fe6-f3f9-11e4-910d-080027c336f0', 385, NULL, 'Cologne', 'df75794f-f3f9-11e4-910d-080027c336f0', '2013-06-04 16:43:17+00', '2013-12-01 14:25:27+00', '3006', 1, 1, 1, 0, '21. März', '{"countryName":"Germany","geonameId":"2921044","alpha2":"DE"}', '{}', '{"toponymName":"North Rhine-Westphalia"}', '{}', '{"name":"Stadtgarten","geonameId":"6691075"}', '50.9325071,6.933415599999989', '{"lat":50.9325071,"lon":6.933415599999989}', '<p><strong>Eine Aufsichtsperson! (Sehr wichtig). Wenn Du unter 13 bist, muss eine Aufsichtsperson waehrend der gesamten Sitzung anwesend sein.</strong></p><p>Unser n&auml;chster Termin findet am 21. M&auml;rz statt.&nbsp;Wie immer muss w&auml;hrend des gesamten Dojos eine Aufsichtsperson dabei sein.</p><p>Wenn du W&uuml;nsche hast, was du gerne lernen w&uuml;rdest &ndash; dann sag uns einfach Bescheid! Wir werden auf jeden Fall folgendes anbieten:</p><ul><li>Wir bauen eine Webseite mit HTML und CSS</li><li>Wir programmieren gemeinsam ein Spiel</li><li>Wir helfen euch bei den Grundlagen von Java</li><li>Wenn du sonstige Fragen oder Ideen hast, wir helfen dir gerne!</li></ul><p>Wenn du immer auf dem neuesten Stand bleiben m&ouml;chtest: Wir sind auf <a href="https://www.facebook.com/coderdojocgn">Facebook</a>, auf <a href="https://twitter.com/coderdojocgn">Twitter</a>&nbsp;oder du kannst unseren <a href="http://eepurl.com/MF6Ir">Email Newsletter</a> abonnieren.</p><p>Bei den letzten Events haben wir schon ein paar Webseiten gebaut &ndash; schau sie dir doch einfach mal an:</p><ul><li>Valentina und Felicitas erstellten eine <a href="https://musiclines_neu-c9-erdnusskeks.c9.io/pop.html">Seite zu Musik und Gedichten</a>.</li><li>Leo und Michel arbeiten an der <a href="https://mlstudios-c9-mlstudios.c9.io">Seite f&uuml;r ihr Kino</a>&nbsp;(gerade nicht verf&uuml;gbar)</li><li>Und Leo hat an seiner <a href="http://leoma.2ix.de">Homepage</a> gearbeitet</li><li>Anna hat eine <a href="http://www.annagreta.de/tierseite.html">Webseite mit Meerestieren</a> gebaut.</li><li>Svenja hat eine <a href="https://dinos-c9-erdnusskeks.c9.io">Webseite &uuml;ber Dinos</a> gebaut.</li><li>Irem erkl&auml;rt <a href="https://kochenfuerkinder-c9-erdnusskeks.c9.io">auf ihrer Webseite</a> wie man Nudeln macht.</li></ul>', 'lucas@dohmen.io', NULL, 'coderdojocgn', NULL, '16053716097', NULL, 0, NULL, NULL, 0, 'de/north-rhine-westphalia/stadtgarten/cologne', 'EU', 'DE', 'DEU', 'ConceptBakery, Lindenstraße 82, 50674 Köln', NULL, 276, 'Germany, Federal Republic of', '07', 'North Rhine-Westphalia', '', '', '', '', '', '', '6691075', 'Stadtgarten', NULL);
