INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90dd40-f3f9-11e4-910d-080027c336f0', 1046, NULL, 'Grosseto @ WCH', 'df76e9ec-f3f9-11e4-910d-080027c336f0', '2014-10-29 20:48:30+00', '2014-10-31 11:37:19+00', '4124', 1, 0, 0, 0, 'Saturday 2pm - 4pm (on biweekly basis)', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Grosseto"}', '{"toponymName":"Tuscany"}', '{"toponymName":"Grosseto"}', '{"name":"Grosseto","geonameId":"3175786"}', '42.7717676,11.112576399999966', '{"lat":42.7717676,"lon":11.112576399999966}', '<p>The Grosseto Dojo works is organized thanks to the support of Working Class Hero (WCH), an Onlus which hosts several courses ranging in the fields of artistic disciplines, foreign languages and computer science.&nbsp;</p><p>We meet at the WCH co-working space in via Podgora 6, Grosseto. Classes are in Italian, but we have some good english speaker (as well as a Chinese one!) available among our mentors.</p><p>Our CoderDojo will organize a meeting the 1st and the 3rd saturday of every month, plus additional events every time we can.</p><p>Follow for our updates on the website (coming soon) and <a target="_blank" href="https://twitter.com/CoderDojo_GR">Twitter</a>.</p>', 'coderdojo@workingclasshero.it', 'http://workingclasshero.it/coderdojo', 'CoderDojo_GR', NULL, NULL, 'http://workingclasshero.it/wp-content/uploads/2014/09/logo-scritte-small.png', 0, NULL, NULL, 0, 'it/tuscany/grosseto/grosseto-wch', 'EU', 'IT', 'ITA', 'Grosseto, via Podgora 6', NULL, 380, 'Italy, Italian Republic', '16', 'Tuscany', '', '', '', '', '', '', '3175786', 'Grosseto', NULL);
