INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90b3ea-f3f9-11e4-910d-080027c336f0', 918, NULL, 'To be Deleted - Brisbane - Sunnybank Hills', 'df76bab4-f3f9-11e4-910d-080027c336f0', '2014-08-21 06:31:34+00', NULL, NULL, 0, 1, 3, 0, 'Every Saturday from Saturday 11th October - Saturday 29th November, 12.30 - 2.30pm', '{"countryName":"Australia","geonameId":"2077456","alpha2":"AU"}', '{"toponymName":"Brisbane"}', '{"toponymName":"Queensland"}', '{}', '{"name":"Calamvale","geonameId":"8348765"}', '-27.61090053924059,153.0550950203766', '{"lat":-27.61090053924059,"lon":153.0550950203766}', '<p><strong>CoderDojo Brisbane kicks off Term 4 at Sunnybank Hills Library!</strong></p><p><em><strong>Registration for this event includes all sessions from Saturday 11th October until Saturday 29th November (inclusive) from 12.30 - 2.30pm.&nbsp;</strong></em></p><p>Kids aged 7 - 17 will be exposed to programming tools such as Scratch and HTML, and can then create their own projects to work on with the assistance of volunteer mentors - some of the best tech expertise Brisbane has to offer. Participants are required to bring:</p><ul><li>laptop</li><li>snack or lunch</li><li><em><strong>Please Note: a parent is to supervise if a participant is aged under 15 years.</strong></em></li></ul><div>&nbsp;</div><div><strong>For more information, visit the&nbsp;<a href="http://coderdojobrisbane.com.au/get-involved/participants/">CoderDojo Brisbane website.</a></strong></div><p>&nbsp;</p>', 'info@coderdojobrisbane.com.au', 'http://www.coderdojobrisbane.com.au', 'CoderDojoBNE', NULL, '11551710477CoderDojo Bris', NULL, 1, '4124', '2014-09-26 14:54:29+00', 0, 'au/queensland/calamvale/to-be-deleted-brisbane-sunnybank-hills', 'OC', 'AU', 'AUS', 'Sunnybank Hills Library, Sunnybank Hills Shoppingtown, Cnr Compton &amp; Calam Rds, Sunnybank Hills QLD 4109', NULL, 36, 'Australia, Commonwealth of', '04', 'Queensland', '', '', '', '', '', '', '8348765', 'Calamvale', NULL);
