INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90601e-f3f9-11e4-910d-080027c336f0', 811, NULL, 'Twin Falls, ID, @NeverLAN', 'df763f42-f3f9-11e4-910d-080027c336f0', '2014-05-07 17:31:47+00', '2014-05-09 10:35:01+00', '3006', 1, 0, 1, 0, 'Every Tuesday, 3:30 - 5:00pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Twin Falls County"}', '{"toponymName":"Idaho"}', '{}', '{"name":"Twin Falls","geonameId":"5610810"}', '42.57253152713234,-114.45112468280331', '{"lat":42.57253152713234,"lon":-114.45112468280331}', '<p>We meet in the NeverLAN Hacker Space at Twin Falls High School. &nbsp;Go to room S3 to access the Hacker Space. &nbsp;Below is a list of things you to know about our CoderDojo</p><ul><li>We are open, during the school year, every Tuesday from 3:30pm - 5:00pm. Summer events will be annouced on the Google+ Community page.&nbsp;</li><li>Normal Tuesday events are on a walkin basis. &nbsp;If no one shows, we go home, anyone shows, we will create a super plan and work with you to become a full fledged coder!&nbsp;</li><li>The CoderDojo is open to all school-aged kids in the community. &nbsp;You absolutely do not have to be a Twin Falls High School student to join us.</li><li>We have computers you can use, but you can bring a&nbsp;laptop if you would like.</li><li>If you have food or drinks you will need to leave them on the center table. &nbsp;For the safety of the equipment do not eat or drink liquids at the computers.</li><li><strong>If you are 12 or under you MUST bring a parent, your parent must stay with you during the session.</strong></li></ul>', 'neverlan@tfhsbruins.com', 'http://neverlan.tfhsbruins.com', NULL, 'https://plus.google.com/communities/100187679719424039868', NULL, NULL, 0, NULL, NULL, 0, 'us/idaho/twin-falls/twin-falls-id-neverlan', 'NA', 'US', 'USA', 'Twin Falls High School, Room S3, 1615 Filer Ave. E, Twin Falls, ID  83301', NULL, 840, 'United States of America', 'ID', 'Idaho', '', '', '', '', '', '', '5610810', 'Twin Falls', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f7006-f3f9-11e4-910d-080027c336f0', 423, NULL, 'Southern Minnesota', 'df7540c3-f3f9-11e4-910d-080027c336f0', '2013-08-16 16:40:38+00', '2013-12-01 14:25:26+00', '3006', 1, 0, 2, 0, 'Tuesdays at 6:00 PM CST for Scratch, Thursdays at 6:00 PM CST for Web Development', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Olmsted County"}', '{"toponymName":"Minnesota"}', '{}', '{"name":"Rochester","geonameId":"5043473"}', '44.01516339515142,-92.4649715423584', '{"lat":44.01516339515142,"lon":-92.4649715423584}', '<ul><li>A pack snack.</li><li>A laptop. Borrow one from someone if needs be. If you can''t find one, let us know.<em><br></em></li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul> <br> <b>To register for a class</b>, go to <a href="http://www.rochfamy.org/registration/" target="_blank"> http://www.rochfamy.org/registration</a>, click on "First Time Users Of Our Online Registration System" or "Current Y Members and Program Participates", enter "dojo" in the Program Search box, select "CoderDojoSoMN" and pick a class!', 'rochester.mn.us@coderdojo.com', NULL, NULL, NULL, NULL, 'http://www.rochfamy.org/wp-content/uploads/YMCA-logo.png', 0, NULL, NULL, 0, 'us/minnesota/rochester/southern-minnesota', 'NA', 'US', 'USA', 'Rochester Area Family YMCA', NULL, 840, 'United States of America', 'MN', 'Minnesota', '', '', '', '', '', '', '5043473', 'Rochester', NULL);
