INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df914926-f3f9-11e4-910d-080027c336f0', 1219, NULL, 'Salerno', 'df771287-f3f9-11e4-910d-080027c336f0', '2015-01-24 16:44:39+00', '2015-03-06 14:28:42+00', '4124', 1, 0, 1, 0, '&quot;Every Second Sunday each month, 5 pm - 7  pm&quot;', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Provincia di Salerno"}', '{"toponymName":"Campania"}', '{"toponymName":"Salerno"}', '{"name":"Salerno","geonameId":"3168673"}', '40.671985, 14.784921', '{"lat":40.671985,"lon":14.784921}', '<ul><li>Primo appuntamento : domenica 15 marzo ore 17!</li><li>Cosa portare? Un computer portatile: chiedilo in prestito alla mamma, a tuo fratello, tua cugina o un amico. Non dimenticare l''alimentatore, ovviamente! </li><li><strong>Puoi portare anche un genitore: se hai meno di 12 anni puoi chiedere a mamma o a papà di venire ad assistere alla sessione di coding, li accoglieremo volentieri! </strong> </li>', 'salerno.it@coderdojo.com', NULL, 'coderdojosalerno', NULL, NULL, NULL, 0, NULL, NULL, 0, 'it/campania/salerno/salerno', 'EU', 'IT', 'ITA', 'Via Padula, 1,  Salerno', NULL, 380, 'Italy, Italian Republic', '04', 'Campania', '', '', '', '', '', '', '3168673', 'Salerno', NULL);
