INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8eccd7-f3f9-11e4-910d-080027c336f0', 44, NULL, 'Dublin 15', 'df7403b0-f3f9-11e4-910d-080027c336f0', '2012-03-09 14:16:58+00', '2013-12-01 14:25:30+00', '3006', 1, 1, 3, 0, 'Every Saturday 10am - 12:00noon during ITB Term Time', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Leinster"}', '{}', '{"name":"Ballycorden","geonameId":"3315327"}', '53.404759933463716,-6.378486153442395', '{"lat":53.404759933463716,"lon":-6.378486153442395}', '<p>Age Limit is from 8 to 18 years old.</p><p>The dojo runs on Saturday mornings from 10am to 12noon.</p><p>New sessions will start on Jan 17th 2015<strong>.&nbsp; Booking now closed.</strong></p><p>For further information, please contact us via email (see below on right).</p>', 'CoderDojoD15@gmail.com', 'http://www.coderdojod15.com/', 'coderdojod15', 'https://groups.google.com/forum/#!forum/coderdojodublin15', '14941283782', 'https://dl.dropboxusercontent.com/u/51906171/Combined_Logo.PNG', 0, NULL, NULL, 0, 'ie/leinster/ballycorden/dublin-15', 'EU', 'IE', 'IRL', 'Institute of Technology Blanchardstown in the F Block, Reception building (Room F102 and F103 upstairs)', NULL, 372, 'Ireland', 'L', 'Leinster', '', '', '', '', '', '', '3315327', 'Ballycorden', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8f2f9a-f3f9-11e4-910d-080027c336f0', 250, NULL, 'Dungarvan', 'df74c7ce-f3f9-11e4-910d-080027c336f0', '2013-02-21 16:49:41+00', '2013-12-01 14:25:28+00', '3006', 1, 0, 2, 0, 'Every Saturday 11.30 - 14.30 except bank holiday weekends', '{"countryName":"Ireland","geonameId":"2963597","alpha2":"IE"}', '{}', '{"toponymName":"Munster"}', '{}', '{"name":"Dungarvan","geonameId":"2964528"}', '52.085008, -7.621210', '{"lat":52.085008,"lon":-7.62121}', '<ul><li>A packed lunch if you wish. We provide small snack &nbsp;of a drink and biscuits at breaktime. Tea/coffee facility available for parents.</li><li>A laptop. We have spares but they need to be booked in advance. Borrow one from someone if needs be.</li><li><strong>A parent! (Very important). If you are 12 or under, your parent must stay with you during the session.</strong></li></ul>', 'coderdojodungarvan@gmail.com', 'http://www.coderdojodungarvan.ie', 'CoderdojoDungar', NULL, NULL, NULL, 0, NULL, NULL, 0, 'ie/munster/dungarvan/dungarvan', 'EU', 'IE', 'IRL', 'Fusion Centre, Quanns, Boreentra, Dungarvan, Co. Waterford', NULL, 372, 'Ireland', 'M', 'Munster', '', '', '', '', '', '', '2964528', 'Dungarvan', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90d446-f3f9-11e4-910d-080027c336f0', 1026, NULL, 'Trani, Puglia', 'df76e75f-f3f9-11e4-910d-080027c336f0', '2014-10-21 08:06:11+00', '2014-10-23 13:53:24+00', '4124', 1, 0, 0, 0, 'Sabato 16.00 - 18.00', '{"countryName":"Italy","geonameId":"3175395","alpha2":"IT"}', '{"toponymName":"Barletta - Andria - Trani"}', '{"toponymName":"Apulia"}', '{"toponymName":"Trani"}', '{"name":"Trani","geonameId":"3165322"}', '41.2687906,16.41759730000001', '{"lat":41.2687906,"lon":16.41759730000001}', '<p>Ciao e benvenuto al CoderDojo di Trani &quot;palestra per giovani programmatori&quot;</p><p>Attivita&#39; sessione del 22 Novembre dalle 16.00 alle 18.00:</p><ul><li>Il nostro primo videogioco</li><li>Animiamo il videgioco con il pongo! : come costruire un joypad</li></ul><p>L&#39;evento gratuito verr&agrave; organizzato in collaborazione con gli Operatori Emergenza Radio di Trani presso la loro sede.</p><p>Possono partecipare ragazzi\e di et&agrave; compresa tra i 7 e 15 anni.&nbsp;<br />La prenotazione &egrave; obbligatoria in quanto i posti sono limitati.&nbsp;<br />Dopo la prenotazione verrete ricontattati telefonicamente per confermare i dati comunicati.</p><p>Per partecipare ricordati di portare:</p><ol><li><strong>Un portatile con l&#39;alimentatore ed il mouse.</strong></li><li><strong>Scatola per scarpe, colla stick, did&ograve;(pongo), carta stagnola, forbici punte tonde, colori a spirito</strong></li><li><strong>Un adulto accompagnatore! (Importante: deve restare con te durante l&#39;evento)</strong></li></ol><p><strong>Per informazioni sui prossimi eventi:</strong></p><ul><li><a href="http://coderdojotrani.eventbrite.com/" target="_blank">http://coderdojotrani.eventbrite.com</a></li><li><a href="https://www.facebook.com/coderdojotrani">https://www.facebook.com/coderdojotrani</a></li><li><a href="mailto:trani.it@coderdojo.com?subject=Richiesta informazioni">trani.it@coderdojo.com</a></li></ul>', 'trani.it@coderdojo.com', 'http://www.coderdojotrani.it', 'CoderDojoTrani', NULL, '14441203027', NULL, 0, NULL, NULL, 0, 'it/apulia/trani/trani-puglia', 'EU', 'IT', 'ITA', 'Via Giuseppe di Vittorio, 47, Trani', NULL, 380, 'Italy, Italian Republic', '13', 'Apulia', '', '', '', '', '', '', '3165322', 'Trani', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df915e37-f3f9-11e4-910d-080027c336f0', 1262, NULL, 'Minneapolis, MN @Southwest High', 'df77190f-f3f9-11e4-910d-080027c336f0', '2015-02-10 17:15:11+00', '2015-02-11 14:52:29+00', '4124', 1, 0, 2, 0, 'Monthly, next meeting is Tues, Mar 24, 7-8:30pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Hennepin County"}', '{"toponymName":"Minnesota"}', '{}', '{"name":"Calhoun Beach","geonameId":"5019951"}', '44.918504,-93.32476969999999', '{"lat":44.918504,"lon":-93.32476969999999}', '<ul><li><strong>This dojo is for teens (ages 13-18) with no previous coding experience. &nbsp;We will do a group activity at each meeting.</strong></li><li><strong>To register call: 612-668-3100</strong></li><li><strong>We provide the computers, unless otherwise noted for a specific dojo date. &nbsp;Please bring earbuds.</strong></li><li><strong>No food or drink allowed in the computer lab.</strong></li></ul>', 'minneapolissouthwest.us@coderdojo.com', 'http://www.codesavvy.org/p/coderdojo-at-sw-high.html', 'CodeSavvyOrg', 'https://groups.google.com/forum/#!forum/southwest-coder-dojo', NULL, 'http://commed.mpls.k12.mn.us/', 0, NULL, NULL, 0, 'us/minnesota/calhoun-beach/minneapolis-mn-southwest-high', 'NA', 'US', 'USA', 'Southwest High School, 3414 West 47th Street, Minneapolis', NULL, 840, 'United States of America', 'MN', 'Minnesota', '', '', '', '', '', '', '5019951', 'Calhoun Beach', NULL);
