INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df90f7e3-f3f9-11e4-910d-080027c336f0', 1091, NULL, 'Yverdon-les-Bains', 'df76fbab-f3f9-11e4-910d-080027c336f0', '2014-11-28 14:29:09+00', '2014-12-09 14:26:39+00', '4124', 1, 0, 2, 0, 'one Saturday per month from 10:00 am to 12:00 am (March to June).', '{"countryName":"Switzerland","geonameId":"2658434","alpha2":"CH"}', '{"toponymName":"Jura-Nord vaudois District"}', '{"toponymName":"Vaud"}', '{"toponymName":"Yverdon-les-Bains"}', '{"name":"Yverdon-les-Bains","geonameId":"2657941"}', '46.78106820273549,6.647326286816451', '{"lat":46.78106820273549,"lon":6.647326286816451}', '<p>Nous organisons de mars &agrave; juin 2015 des ateliers <strong>ludiques </strong>et <strong>gratuits</strong> pour les jeunes :</p><ul><li>Cr&eacute;ation de minis-jeux ou d&#39;histoires anim&eacute;es avec Scratch</li><li>R&eacute;alisation d&#39;un site internet basique en HTML et CSS</li><li>Programmation d&#39;un robot</li><li>Et bien plus encore !</li></ul><p>Le jour de l&#39;atelier n&#39;oublie pas de venir avec :</p><p>- Un ordinateur portable (laptop) (Nous en pr&eacute;tons si n&eacute;cessaire)</p><p>- Un snack et boisson pour la pause</p><p>- Un accompagnant si tu as moins de 10 ans</p><p><strong>Dates :&nbsp; 21 mars 2015, 25 avril 2015, 23 mai 2015</strong></p><p><strong>Informations et inscriptions sur : http://codeclub.heig-vd.ch/</strong></p>', 'yverdonlesbains.ch@coderdojo.com', 'http://codeclub.heig-vd.ch/', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'ch/vaud/yverdon-les-bains/yverdon-les-bains', 'EU', 'CH', 'CHE', 'HEIG-VD, Avenue des Sports 20, 1401 Yverdon-les-Bains', NULL, 756, 'Switzerland, Swiss Confederation', 'VD', 'Vaud', '', '', '', '', '', '', '2657941', 'Yverdon-les-Bains', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ecae4-f3f9-11e4-910d-080027c336f0', 42, NULL, 'London Web Summit, London EC1Y 4SD', 'df740347-f3f9-11e4-910d-080027c336f0', '2012-03-09 10:14:57+00', NULL, NULL, 2, 0, 2, 0, 'Monday March 19th 2012 4.30pm - 6pm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '</li><li>Come along to our free coding club for kids at London Web Summit to learn the basics of how to become a great coder!<em><br></em></li><li>To sign up: Please email vicky@coderdojo.com with the child''s name, age and experience level, and the parent''s name and contact number. We will reply to confirm your place.<em><br></em></li><li>On the day you''ll need to bring along a laptop.<em><br></em></li><li>Parents must attend to supervise.<em><br></em></li><li>Further details about Coder Dojo at www.coderdojo.com.<em><br></em></li><li>Please email vicky@coderdojo.com with any questions or if you would like to support us in any way.</li>', 'vicky@coderdojo.com', NULL, 'CoderDojoLondon', NULL, NULL, 'http://tctechcrunch2011.files.wordpress.com/2012/03/lws.jpg?w=288', 1, NULL, NULL, 0, 'gb/london-web-summit-london-ec1y-4sd', 'EU', 'GB', 'GBR', 'The Brewery, 52 Chiswell Street, City of London, EC1Y 4SD. Find us in the King Vault when you arrive!', NULL, 826, 'United Kingdom of Great Britain & Northern Ireland', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fbc75-f3f9-11e4-910d-080027c336f0', 558, NULL, 'Bucharest @ Romtelecom', 'df7575b3-f3f9-11e4-910d-080027c336f0', '2013-11-27 15:38:51+00', '2013-12-01 14:25:25+00', '3006', 1, 1, 2, 0, 'Last Saturday of every month, 10am - 1pm', '{"countryName":"Romania","geonameId":"798549","alpha2":"RO"}', '{}', '{"toponymName":"Bucureşti"}', '{}', '{"name":"Băneasa","geonameId":"685473"}', '44.515932128820836,26.08101502152101', '{"lat":44.515932128820836,"lon":26.08101502152101}', '<ol> <li>Please use this form to register: <a href="http://coderdojo.ro/formular-inscriere-copii" target="_blank">http://coderdojo.ro/formular-inscriere-copii</a></li> <li>Children must be aged 8 to 14.</li> <li>A laptop. Borrow one from someone if needs be.</li> <li>Children must have an active <a href="https://www.khanacademy.org/" target="_blank">Khan Academy</a> account.</li> <li><strong>A parent! (Very important). A parent must be present at the location during the session.</strong></li></ol>', 'bucharest.ro@coderdojo.com', 'http://coderdojo.ro/locatii/bucuresti-nord', NULL, NULL, NULL, 'http://sfetea.ro/images/RTC_ver_pos_RGB.jpg', 0, NULL, NULL, 0, 'ro/bucuresti/baneasa/bucharest-romtelecom', 'EU', 'RO', 'ROU', 'Romtelecom Training Arena, Baneasa Business And Technology Park, Bucharest, Romania', NULL, 642, 'Romania', '10', 'Bucureşti', '', '', '', '', '', '', '685473', 'Băneasa', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ef2a3-f3f9-11e4-910d-080027c336f0', 166, NULL, 'Amsterdam - Urban Office', 'df7486cd-f3f9-11e4-910d-080027c336f0', '2012-07-10 09:06:41+00', '2013-12-01 14:25:28+00', '3006', 1, 0, 1, 0, 'Monthly, Sunday mornings, see www.coderdojo.nl', '{"countryName":"Netherlands","geonameId":"2750405","alpha2":"NL"}', '{"toponymName":"Gemeente Amsterdam"}', '{"toponymName":"North Holland"}', '{}', '{"name":"Weesperzijde","geonameId":"7648382"}', '52.353094,4.906051400000024', '{"lat":52.353094,"lon":4.906051400000024}', '<p>English below</p><p><span >Een keer per maand komen we zondagochtend bij elkaar in een ruim atelier van een architect. Afhankelijk van de mentoren doen we Scratch, Raspberry Pi, 3D printing ...</span></p><p><span >Er zijn computers maar je mag ook je eigen computer meenemen.</span></p><p><span >Once a month at Sunday morning we gather at a spacious architects office. Depending on mentors available we do different stuff like Scratch, RaspberryPi and 3D printing.</span></p><p><span >Laptops available, no problem if you bring your own.</span></p>', 'info@parlarie.nl', 'https://sites.google.com/site/kidscodemakespace/', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'nl/north-holland/weesperzijde/amsterdam-urban-office', 'EU', 'NL', 'NLD', 'Urban Office, Tolstraat 129,  Amsterdam', NULL, 528, 'Netherlands, Kingdom of the', '07', 'North Holland', '', '', '', '', '', '', '7648382', 'Weesperzijde', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8fde13-f3f9-11e4-910d-080027c336f0', 646, NULL, 'Kearney, Nebraska', '0', '2014-01-30 17:27:43+00', '2014-02-05 13:27:51+00', '3006', 1, 0, 2, 0, 'Every third Tuesday of the month, 6:00 - 8:00 pm', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Buffalo County"}', '{"toponymName":"Nebraska"}', '{}', '{"name":"Kearney","geonameId":"5071348"}', '40.7107775029447,-99.093503503833', '{"lat":40.7107775029447,"lon":-99.093503503833}', 'AIM Central NE is offering an exciting new program in Kearney where kids can learn to code. The first coding session will be held at the Horizon Middle School in the computer lab on Tuesday, Feb. 18. Two programs, Scratch and Minecraft, are being offered for kids ages 8 to 17. Registration is open. Sign up at www.aimforbrilliance.org/coderdojo. Parents are welcome and mandatory for children ages 12 and under. All supplies will be provided.', 'kearney.us@coderdojo.com', 'http://www.aimforbrilliance.org/coderdojo', NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, 'us/nebraska/kearney/kearney-nebraska', 'NA', 'US', 'USA', '915 W 35th St., Kearney, NE', NULL, 840, 'United States of America', 'NE', 'Nebraska', '', '', '', '', '', '', '5071348', 'Kearney', NULL);
INSERT INTO cd_dojos (id, mysql_dojo_id, dojo_lead_id, name, creator, created, verified_at, verified_by, verified, need_mentors, stage, mailing_list, "time", country, county, state, city, place, coordinates, geo_point, notes, email, website, twitter, google_group, eb_id, supporter_image, deleted, deleted_by, deleted_at, private, url_slug, continent, alpha2, alpha3, address1, address2, country_number, country_name, admin1_code, admin1_name, admin2_code, admin2_name, admin3_code, admin3_name, admin4_code, admin4_name, place_geoname_id, place_name, user_invites) VALUES ('df8ef0a4-f3f9-11e4-910d-080027c336f0', 159, NULL, 'Silicon Valley - Mountain View', 'df747d5f-f3f9-11e4-910d-080027c336f0', '2012-06-27 19:20:31+00', '2013-12-01 14:25:29+00', '3006', 1, 1, 2, 0, 'Weekedays, 6:30-8:30 p.m., monthly. Special events and multi-week mini series TBA.', '{"countryName":"United States","geonameId":"6252001","alpha2":"US"}', '{"toponymName":"Santa Clara County"}', '{"toponymName":"California"}', '{}', '{"name":"Rex Manor","geonameId":"8479299"}', '37.4132953,-122.07362230000001', '{"lat":37.4132953,"lon":-122.07362230000001}', '<p><strong>Must Pre-register to attend</strong></p><p>For event announcements and information about how to request a seat make sure to <a href="http://coderdojosv.com/join">join our mailing list</a></p><p>To get involved as a mentor, instructor or event volunteer please <a href="http://coderdojosv.com/join">join our mailing list</a> so we may contact you about upcoming needs and opportunities.</p><p>You may also visit the <a href="http://coderdojosv.com">CoderDojo Silicon Valley Regional Website</a>&nbsp;for more information about our program and to see our <a href="http://coderdojosv.com/#calspan">event calendar</a>.</p><p>What to Bring&nbsp;</p><ul><li>A laptop and charger</li><li><strong>A parent! (Very important). All minors 17 and under, must have a parent/legal guardian stay for the duration of the workshop</strong></li></ul><p>NOTE: <strong>No outside food is allowed</strong> at this venue. Please eat before you come.&nbsp;Light refreshments will be served, compliments of Microsoft!</p>', 'office@coderdojosv.org', 'http://www.coderdojosv.com', 'coderdojosv', NULL, NULL, 'http://www.microsoft.com/global/en-us/news/publishingimages/logos/MSFT_logo_Web.jpg', 0, NULL, NULL, 0, 'us/california/rex-manor/silicon-valley-mountain-view', 'NA', 'US', 'USA', 'La Avenida Street Mountain View, CA 94043', NULL, 840, 'United States of America', 'CA', 'California', '', '', '', '', '', '', '8479299', 'Rex Manor', NULL);
